INSERT INTO `pages` VALUES (1,'Home','This is Home page','<p><img style=\"width: 211px;\" src=\"data:image/jpeg;base64,\" data-filename=\"image006.jpg\"></p><p style=\"text-align: center; \">This website is made possible through a grant from the Department of Behavioral Health Office of Children Youth and Families</p><p><br></p>','','0000-00-00 00:00:00','2019-04-18 04:21:07',NULL),(2,'About','About the South Dade Cares Resource Directory','<div class=\"m_-1977661481779162877gmail-text-center\" style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 14px; text-align: center;\"><span id=\"docs-internal-guid-45367cd5-7fff-6623-79dd-1574b65bf19c\"><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">The DC Community Resource Inventory is a project of the DC Community Resource Information Exchange (DC CoRIE) Initiative.</span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span id=\"docs-internal-guid-74dba194-7fff-5e13-40e1-13b1ea2fdb29\"><br></span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Produced by the DCPCA, in partnership with the Open Referral Initiative, with technology development by Sarapis, this is a \'proof of concept\' of a functional Community Resource Inventory containing information about health, human, and social services available to DC residents in need.</span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><br></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">This website is a reference implementation for the underlying database. This database is also available via an Application Programming Interface, which can be accessed at our Developer Portal here.</span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><br></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">To suggest edits or additions to this directory, reach out to David Poms at the DCPCA.</span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><br></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">To learn more about the Open Referral Initiative, reach out to <a href=\"mailto:Greg@openreferral.org\" target=\"_blank\">Greg Bloom</a>.</span></p></span></div>','','0000-00-00 00:00:00','2019-11-18 09:56:31',NULL),(3,'Feedback','This is Feedback page','<script src=\"https://static.airtable.com/js/embed/embed_snippet_v1.js\"></script><iframe class=\"airtable-embed airtable-dynamic-height\" src=\"https://airtable.com/embed/shrGardkjNsxKA6sO?backgroundColor=teal\" frameborder=\"0\" onmousewheel=\"\" width=\"100%\" height=\"1431\" style=\"background: transparent; border: 1px solid #ccc;\"></iframe>','','0000-00-00 00:00:00','0000-00-00 00:00:00',NULL),(4,'Google Analytics','This is Google Analytics Page','UA-141306707-1','',NULL,'2019-06-07 16:05:45',NULL);
