INSERT INTO `services` VALUES (1,545735833730297,'Adult & Elder Services-Financial & Planning Services',NULL,1278015369614430,'Visits senior\'s home; $60/hr as of 2018; From their website: \"A&E takes a holistic approach to working with seniors. We manage and coordinate a full range of services to help protect and preserve assets. Its our mission to help seniors maintain their independence.\" Serving Manhattan, the Bronx, Northern New Jersey and the lower Hudson Valley including Westchester, Rockland, Orange, Putnam and Dutchess Counties.','1292974982287152','www.aecares.com',NULL,'john@aecares.com',NULL,'1080473071775397,1012417089448021,905605959147804',NULL,NULL,NULL,NULL,NULL,'1180766220018823,973157846510573',NULL,NULL,NULL,'903689394971972',NULL,NULL,NULL),(2,546324649191828,'Westchester County Livable Communities',NULL,1260510841196867,'Livable communities encourages seniors to come together to think, make choices, and take action in ways that will improve their quality of life for people of all ages through affordable, accessible housing options, recreational/social/cultural activities, public transportation and walkable streets, preservation of positive features for the future. Allows seniors to live in their homes or in appropriate and affordable housing. \n\nPosted 11/19',NULL,'seniorcitizens.westchestergov.com/livable-communities',NULL,'cap2@westchestergov.com',NULL,'1258526581948590,606548005480946,875832193340621',NULL,NULL,NULL,NULL,NULL,'647232015290320',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(3,563583310600900,'Sage-GRIOT Innovative Senior Center',NULL,1017787979767244,'From their website: \"Both organizations to expand and work together to provide emotional support, social connections, and a wide variety of programs and services for older adults.\"','898060688155114','https://sagenyc.org/nyc/centers/brooklyn.cfm',NULL,NULL,NULL,'1220426167240011',NULL,NULL,NULL,NULL,NULL,'661681652540333',NULL,NULL,NULL,'1190531990465047',NULL,NULL,NULL),(4,568545427254648,'Dumont Center for Rehabilitation & Nursing Care',NULL,NULL,'The Dumont Center is a 196 bed facility that offers short-term rehab, long-term skilled nursing care, and a secure memory care unit. Rehabilitation is based on a holistic, individualized care approach and includes palliative care. Long-term care is assisted by 24/7 nursing staff and hosts therapeutic recreation programs, events, and activities. \n\nPosted 11/19','1134526234412344','dumontcenter.com',NULL,'info@dumontcenter.com',NULL,'892286200872415,1225698418863757,624542557113105,853236516099165',NULL,NULL,NULL,NULL,NULL,'1277152323038921',NULL,NULL,NULL,'1285864870627527',NULL,NULL,NULL),(5,587434079564381,'Project SenioRepair',NULL,635776676599442,'From their website: SenioRepair is a free home safety and security program for the elderly and handicapped people throughout all five boroughs of NYC. SenioRepair service technicians are highly-skilled and fully equipped, traveling throughout the City in a retrofitted van to provide clients with necessary repairs.  The goal of the program is to upgrade the soundness of an older persons residence to improve its structural integrity and safety. HOME REPAIRS PERFORMED INCLUDE:\nInstalling locks, peepholes, doorbells, window guards and other security-related hardware, installing smoke alarms and carbon monoxide alarms, installing bathroom grab bars, fixing washers in leaking faucets, light carpentry work such as fixing broken stairs and some furniture, fixing damaged drywall, replacing or repairing flooring in small areas, painting or plastering of small area.','1166676498043777','https://www.metcouncil.org/project-metropair',NULL,NULL,NULL,'1070189534488260',NULL,NULL,NULL,NULL,NULL,'1289623818455761',NULL,NULL,NULL,'959807357164828',NULL,NULL,NULL),(6,594018446651717,'Truly Inspired',NULL,1029012567851370,NULL,'853916208626878',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'772606633064356',NULL,NULL,NULL,'602878125631566',NULL,NULL,NULL),(7,599698402386779,'Solutions at Home',NULL,1078457477748955,'Solutions at Home provides dignified care that meets the evolving needs of people as they age; we serve those who need just a little extra help managing chronic conditions at home to the frailest older adults. It is an integrated program that provides geriatric care managers and home health aides that help you receive the right home care services as your needs evolve.\n\nPosted 10/19',NULL,'https://jewishhome.org/our-care-services/homecare/solutions-at-home/',NULL,'ezenker@jewishhome.org',NULL,'1144317597848541',NULL,NULL,NULL,NULL,NULL,'1288124841484406',NULL,'965393630368808',NULL,NULL,NULL,NULL,NULL),(8,604112759450921,'Jeanne Ferrando, LCSW-R',NULL,NULL,'Clinical Social Worker/Therapist. Also has a private practice in Tarrytown. Fees are based on a sliding scale. Her specialty is both adult and geriatric psychology. Nights and weekends only.\n\nPosted 10/19','1141433948429319','https://hudson-counseling.com/',NULL,'Jeanne.ferrando@hudson-counseling.com ',NULL,'787866332874000',NULL,NULL,NULL,NULL,NULL,'774441012896831',NULL,NULL,NULL,'926744447907375',NULL,NULL,NULL),(9,600135038960416,'Andrew\'s Fund',NULL,940635116893810,'ONLY FOR CARTER BURDEN CLIENTS; From their website: \"The Carter Burden Network\'s Andrew Fund was created in 1994 by an anonymous CBN Board Member in honor of her late, beloved Yorkie named Andrew. The Andrew Fund provides assistance to New York seniors who need help caring for their pets by offering one-time or short-term assistance with boarding, veterinary bills, food, spay-neuter, and more.\"','1107802251236437','http://www.carterburdennetwork.org/socialserviceunit',NULL,NULL,NULL,'1009228235801069',NULL,NULL,NULL,NULL,NULL,'927467421613186',NULL,NULL,NULL,'674674961934925',NULL,NULL,NULL),(10,606049236910724,'Center for Lifelong Growth-Leonie Nowitz',NULL,NULL,'A professional service organization providing comprehensive care management services for the elderly, the disabled, and their families. Provides individualized care to enhance the quality of life for clients and family members. Available 24-hours; conducts assessment of health, medical, safety, social, and housing needs, provides referrals to specialists, coordinates long or short-term care, and more. Director, Leonie Nowitz LCSW, C-ASWCM has four decades of experience. As of 2019, rates are $200/hour. ','877936089968720',NULL,NULL,'nowitzloenie@gmail.com',NULL,'863555368755651',NULL,NULL,NULL,NULL,NULL,'817512204323217',NULL,NULL,NULL,'737996291058701',NULL,NULL,NULL),(11,550639993191378,'Judith Moves You, LLC',NULL,NULL,'Assists with senior relocation: seniors who are downsizing and moving within, into or out of New York, aging in place: seniors who are trying to de-clutter, re-organize or remodel their homes, (also assist family or friends who are trying to help a senior do any of the above). Clean outs: family or Estate administrators who are emptying a residence, and de-cluttering and organizing for people of all ages who need assistance in reorganizing and de-cluttering their home. Judith Kahn, owner.','1072852792815959','www.judithmovesyou.com',NULL,'judith@judithmovesyou.com ',NULL,'917020988773351,1183042635305812,656941113483002,1294594151119548',NULL,NULL,NULL,NULL,NULL,'898864287712317',NULL,'603369659404025',NULL,'955971997114080',NULL,NULL,NULL),(12,554169331480949,'Senior Planet',NULL,NULL,'Offers 5- and 10-week courses scheduled on a quarterly basis. See  calendar for scheduled classes or drop in to use computers and wi-fi, play a video game or check out one of the new tech gadgets they have. Also provides classes on \"age proofing\" a resume, how to write a modern resume and cover letter using Google docs templates, and how to use job search websites. The course also covers tips for writing professional emails, emailing attachments, uploading files, and how to ace a video interview. In addition, they offer a Money Matters class on building smart financial habits and finding resources online. ','886567588768031','https://seniorplanet.org/',NULL,'info@seniorplanet.org',NULL,'1080473071775397,669632099553613,1137020311225588',NULL,NULL,NULL,NULL,NULL,'815702977901696',NULL,NULL,NULL,'856424619809452',NULL,NULL,NULL),(13,555360101755779,'Sprain Brook Manor Rehab',NULL,NULL,'Long-term skilled nursing care entails personal and medical care, as well as financial and appointment-scheduling assistance. Caregiver respite is also offered for several days or weeks at a time. The community has a dedicated floor for dementia care. Rehabilitation services include physical, speech, and occupational therapy as well as wound care, nutrition care, neuro-rehabilitation, amputee rehabilitation, and stroke/traumatic brain injury care. \n\nPosted 11/19','886902586328624','www.sprainbrookmanor.com',NULL,'Info@sprainbrookmanor.com',NULL,'853236516099165,1057136254371539,1225698418863757,624542557113105',NULL,NULL,NULL,NULL,NULL,'1174749031887385',NULL,NULL,NULL,'1261034736784408',NULL,NULL,NULL),(14,565820535663626,'Bereavement Support Group',NULL,617910248814061,'\"This group provides a safe, caring environment for those who have suffered the loss of a loved one and are seeking a supportive place to grieve and heal.\"','1181165896671487','http://www.dorotusa.org/site/PageServer?pagename=cc_pgms_D#supportgroups',NULL,NULL,NULL,'1063168571768300,1200594795378183,877451051471319',NULL,NULL,NULL,NULL,NULL,'637042726567005',NULL,NULL,'1272863013225282','801326186311509',NULL,NULL,NULL),(15,571465129413363,'Income Support Services',NULL,979198190503025,'From their website: \"Income Support Services provides cash assistance to help individuals achieve education and employment goals. Income Support Services provides grants to pay for tools, clothing/uniforms, test fees and transportation, thus allowing people to take vital steps toward employment and economic stability. This Initiative is funded by The New York Times Neediest Cases Campaign.\"','1159983662799826','www.cssny.org/programs/entry/income-support-services',NULL,'info@cssny.org    ',NULL,'1080473071775397',NULL,NULL,NULL,NULL,NULL,'856695096564723',NULL,NULL,NULL,'645570276764240',NULL,NULL,NULL),(16,594579557870542,'Music and Memory at The Library',NULL,889050494528761,'A personalized music playlist can increase participation in the activities of daily living and positively impact the lives of people living with Alzheimer\'s or Dementia. Westchester Library System offers a free music workshop explaining the program, which reviews the impact of music on those with dementia or Alzheimers, explains the key principles for music selection, provides a hands-on with the recommended equipment (Apple Shuffle and over the ear headphones), and offers a tutorial on how to import music into the music player through iTunes and Freegal. \n\nPosted 10/19',NULL,'https://www.westchesterlibraries.org/services-programs/music-and-memory/',NULL,'musicandmemory@wlsmail.org',NULL,'853236516099165',NULL,NULL,NULL,NULL,NULL,'859854129542417',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(17,609793261225466,'Cedar Manor Nursing and Rehabilitation Center',NULL,NULL,'Situated on the Hudson River, Cedar Manor offers rehabilitative services seven days a week, respite stay, and extensive therapeutic recreation programming. \n\nPosted 11/19','885499464622138','www.cedarmanornursing.com',NULL,'frontdesk@cedarmanornursing.com',NULL,'1057136254371539,624542557113105',NULL,NULL,NULL,NULL,NULL,'1347942831150250',NULL,NULL,NULL,'1164534763609607',NULL,NULL,NULL),(18,610100627647163,'Medicare Physician Compare',NULL,1091823286822466,'Through Medicare.gov. Physician Compare helps you find doctors who accept Medicare, so you can make an informed decision for your health care needs. Its an easy way to see up-to-date information about clinicians anytime you need it. Search by location and specialty. ',NULL,'https://www.medicare.gov/physiciancompare/?utm_campaign=20190619_gmd_cpt_gal&utm_content=english&utm_medium=email&utm_source=govdelivery',NULL,NULL,NULL,'804710974459801,1060789001254366',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(19,582404943926369,'NYC Free Clinic-NYU Langone',NULL,749515156693869,'The only requirement to receive care at the NYCFC is that you must be an uninsured adult age 18 or older. Comprehensive Free Health Services Provided by the NYCFC: basic primary care, patient education, disease prevention and screening physical exams, women\'s health, including gynecological care, men\'s health, vaccinations, sexually transmitted infection testing (including HIV), laboratory testing, and specialty referrals for: colon cancer screening, optometry appointments (including a free pair of glasses), dental cleaning, screening to help you qualify for Medicaid, Family Health Plus, or similar free public insurance programs. We can also fill out your physical exam forms for employment, college, or special programs. If you need to see a specialist for further care, we will refer you to the appropriate clinic at Bellevue Hospital Center. This will not cost you anything, even if you require such procedures as outpatient surgery or MRI. Unable to provide: pre-natal care, emergency room visits, inpatient hospital stays, and inpatient surgeries. All services provided by the clinic are free of charge to patients. The only fee that may be associated with a patient visit is a small co-pay for prescription medications ($15 for generic medications; $40 for brand-name medications). All new patients must be seen by a social worker at 17th Street to look at their eligibility for the NYC Free Clinic. We are able to make referrals to specialists when appropriate. Be sure to specify with whomever answers the phone that you want to make an appointment at the Free Clinic. ','977989706294434','http://nycfreeclinic.med.nyu.edu/information-for-patients/health-services',NULL,NULL,NULL,'930870677737263,1060789001254366',NULL,NULL,NULL,NULL,NULL,'905078980297168',NULL,NULL,NULL,'781763572705473',NULL,NULL,NULL),(20,584037093110292,'Columbia College of Dental Medicine',NULL,749199819507130,'Low-cost/sliding scale dental services provided by dental students.','636786818241649','https://www.dental.columbia.edu/teaching-clinics',NULL,NULL,NULL,'1060789001254366,930870677737263',NULL,NULL,NULL,NULL,NULL,'1222744716525272',NULL,NULL,NULL,'1219157248301161',NULL,NULL,NULL),(21,585192826161477,'LawHelp/NY',NULL,NULL,'From their website: \"LawHelp.org/NY is an online resource for low-income New Yorkers seeking pro-bono legal assistance.Find help on issues such as housing, immigration, family & juvenile, identity theft, taxes, consumer, public benefits, health and more!Featuring thousands of resources in over 39 languages, an instructional video and a mirror site in Spanish. Free trainings available.\"','1188943911061184','www.LawHelp.org/NY',NULL,NULL,NULL,'885600197309781,785468758686103',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'955971997114080',NULL,NULL,NULL),(22,589265063758770,'UJC Cemetery Visit Program',NULL,1308744014948525,'Hosts a program in August/September (call in the end of July to find out exact date and which cemeteries they go to), there are no requirements to participate. Fee is $15/$20 (depending on which location). Enrollment is rolling until spaces are filled. ','1157439885702996','http://ujceastside.org/ujc-senior-services/',NULL,NULL,NULL,'811793752303717',NULL,NULL,NULL,NULL,NULL,'852568932014888',NULL,NULL,NULL,'620719617398611',NULL,NULL,NULL),(23,607345388834247,'Gatekeeper Program',NULL,1137676839800411,'The Gatekeeper Program was created to help recognize, identify, and refer older adults who may be experiencing or at risk of depression, anxiety, and other related symptoms. The Gatekeepers are trained individuals in the community who come into contact with older adults in the course of their everyday jobs or normal activities. These community members are often in a unique position to observe vulnerable seniors who may be experiencing difficulties that place them at risk of losing their ability to live independently in the community. \n\nPosted 11/19',NULL,'www.fsw.org/our-programs/older-adults/geriatric-mental-health',NULL,'tmonti@fsw.org',NULL,'871376605323560',NULL,NULL,NULL,NULL,NULL,'1112218543731803',NULL,'1349049648864073',NULL,NULL,NULL,NULL,NULL),(24,616027474928772,'Queens Community House Case Management',NULL,854389601348497,'Provides case management services, home delivered meals, and Friendly Visiting for seniors in Queens. ','966914096445103','https://www.qchnyc.org/',NULL,NULL,NULL,'981685343230150,830617726149111,969672981978469,784392560809728',NULL,NULL,NULL,NULL,NULL,'976858699590362',NULL,NULL,NULL,'1103807924148960',NULL,NULL,NULL),(25,632484546642124,'Services for Older Adults',NULL,952675500351470,'St. Vincent\'s offers services focusing on the mental health needs of individuals age 60 and older. All treatment services are provided by a multidisciplinary treatment team including psychiatrists, a clinical psychologist, social workers, nursing staff, and activity therapists, all with expertise and experience in treating older adults. \n\n-Geriatric ambulatory program\n-Outpatient geriatric program\n-Inpatient geriatric unit\n-Senior social club\n-ECT\n\nPosted 11/19','1275169097954443','www.stvincentswestchester.org',NULL,NULL,NULL,'871376605323560',NULL,NULL,NULL,NULL,NULL,'1134164728573907',NULL,NULL,NULL,'1301817408777665',NULL,NULL,NULL),(26,567213982298655,'Bereavement Services','VNA of Hudson Valley',884951785590196,'Free of charge support services for bereaved individuals living in Westchester and Putnam counties. Includes individual and family counseling, support groups, workshops, community outreach, and annual memorial services. \n\nPosted 11/19','893798353548387','www.vnahv.org',NULL,NULL,NULL,'1093941699026800',NULL,NULL,NULL,NULL,NULL,'736188312521341',NULL,NULL,NULL,'614626305837322',NULL,NULL,NULL),(27,577119440814762,'Paws & Reflect',NULL,1320241290206172,'ONLY FOR CLIENTS OF ENCORE COMMUNITY SERVICES; \"Volunteers take our puppies to visit homebound elderly senior citizens in Manhattan. Visits occur on weekends, Saturday mornings or Sunday afternoons (once a week for 45 minutes, a commitment of 1 year). To participate in this program, you must live in Manhattan (the West Side, from Chelsea up to the 80\'s, depending on whether volunteer has a car).\"','770656150916599','www.puppiesbehindbars.com',NULL,NULL,NULL,'1009228235801069',NULL,NULL,NULL,NULL,NULL,'1307508907633677',NULL,NULL,NULL,'762608704158308',NULL,NULL,NULL),(28,590472117584228,'RiseBoro Community Partnership',NULL,NULL,'On-site programs, home delivered meals, case management, caregiver support and friendly visiting; serving seniors in Ridgewood and Bushwick, Brooklyn (multiple locations).','1218778159588031','www.riseboro.org',NULL,'info@riseboro.org',NULL,'784392560809728,969672981978469,830617726149111,1261747089209037',NULL,NULL,NULL,NULL,NULL,'771100219665746',NULL,NULL,NULL,'674423877161880',NULL,NULL,NULL),(29,592617644766948,'Search & Care Notary Public Service',NULL,875189273598571,'Public notary service for adults 60+. For a $2.00 fee, you can have all your documents that require having your signature witnessed and notarized at Search and Care the first Friday of the month from 9:30 am-1:30 pm. Call to inquire and/or schedule your appointment.','604286463973708','https://www.searchandcare.org/',NULL,'SandC@searchandcare.org',NULL,'785468758686103',NULL,NULL,NULL,NULL,NULL,'933127730613617',NULL,NULL,NULL,'1129861482680271',NULL,NULL,NULL),(30,607491556351537,'OATS-Computer Basics Class at Lehman Village Senior Center',NULL,573672047726819,'Weekly computer classes.','1218399656701078','http://www.carterburdennetwork.org/',NULL,'contactus@carterburdennetwork.org',NULL,'1137020311225588',NULL,NULL,NULL,NULL,NULL,'1122307373790275',NULL,NULL,NULL,'981402837243283',NULL,NULL,NULL),(31,608815884165791,'Care Buddies',NULL,832749361091520,'From their website: \"A volunteer companionship program for people with dementia. Our Care Buddies are trained based on a Seivah-created curriculum. Our unique program is based on an active dialogue  between Seivah, our volunteers, people with dementia and their caregivers.\"','1192824025321946','https://beyondmemory.org/care-buddies/',NULL,NULL,NULL,'853236516099165,943955981947035,642511572093907,1248151266206446',NULL,NULL,NULL,NULL,NULL,'748856120890280',NULL,NULL,NULL,'1177660468233004',NULL,NULL,NULL),(32,615713842018740,'Sparkle and Shine-Home Organizing',NULL,NULL,'Kathleen Fiorito, organizer.  Free consultation; $45/hour (or sliding scale), in-home assistance.',NULL,NULL,NULL,'kathleenfiorito@aol.com',NULL,'656941113483002',NULL,NULL,NULL,NULL,NULL,'633713236729897',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(33,623429254053582,'Lenox Hill Neighborhood House Legal Advocacy Clinics',NULL,798994226105048,'On-going drop-in programs and clinics that offer assistance with SNAP, tenants\' rights, and NYC rent freezer (DRIE/SCRIE). Call for times and locations.   ','1267609685792488','https://www.lenoxhill.org/legaladvocacy',NULL,NULL,NULL,'669623054114376,775024125555217,785468758686103',NULL,NULL,NULL,NULL,NULL,'1107297795302467',NULL,NULL,NULL,'870634650166451',NULL,NULL,NULL),(34,625862012895176,'PAWS NY-Housecall Program',NULL,NULL,'Provides volunteers for dog walking, cat litter cleaning, feeding/water, and medication administration to pets for seniors who are 60 and up or for those who have an illness or disability.  The program is for in-home care for clients who are living at home and are in need of on-going assistance. PAWS NY services are designed to help our clients overcome the physical and financial limitations they face caring for their animal companions.  If you are a senior or someone with an illness or disability, and you are struggling with the day to day care of your pet, then PAWS NY might be able to assist. In order to qualify for services, individuals must meet each of the following criteria: Be in need of on-going Housecall Services as outlined above, be a New York City resident, be a senior citizen (60+), or individual suffering from a temporary or permanent disability or illness, have an impaired ability to provide day-to-day care for your pet(s), have a maximum gross monthly income of no more than $1,850, limit of 4 pets per household.\nThey DO NOT Provide: Assistance when individuals are hospitalized if they are not existing Housecall clients, adoption/placement services, spay/neuter services, temporary boarding for pets not in our Housecall Program (foster only provided in cases where an on-going client is facing a medical emergency), veterinary care for pets not in our Housecall Program, financial assistance. ','844364176767799','https://pawsny.org/services',NULL,'referrals@pawsny.org',NULL,'1009228235801069',NULL,NULL,NULL,NULL,NULL,'975745652465415',NULL,NULL,NULL,'782487894656894',NULL,NULL,NULL),(35,637789679159005,'Coming of Age NYC-Men\'s Morning','PSS',790488986368738,'\"Are you missing those informal mens conversations that you had at work? Would you like to meet other men who want to talk about life in general and life after retirement? Join a new, casual conversation group for New York City men age 50+ at Coming of Age NYC.\"','970995924679302','http://comingofagenyc.org/',NULL,'pramsden@pssusa.org',NULL,'975020390374256',NULL,NULL,NULL,NULL,NULL,'941281116455568',NULL,NULL,NULL,'1010477474135532',NULL,NULL,NULL),(36,633842245420873,'Laguardia Senior Center',NULL,929828904477796,'Meals and recreational activities.','769404684056511','http://www.nyfsc.org/support-services/senior-centers/',NULL,NULL,NULL,'1299575089394687',NULL,NULL,NULL,NULL,NULL,'1273769326487579',NULL,NULL,NULL,'833553668427052',NULL,NULL,NULL),(37,640786236939343,'Friendly Visiting NY',NULL,779805618185923,'From their website: \"A dynamic and diverse group of volunteers who visit homebound individuals each week. Our visitors come from all ages and are available to provide companionship, reading assistance (reading mail or a favorite news / magazine article), light grocery shopping, support and more.\" Serves Brooklyn and Queens.\nBrooklyn: Bay Ridge, Bensonhurst, Boro Park, Brighton Beach, \nCanarsie, Carol Gardens, Coney Island, Flatbush, Madison, Manhattan Beach, Marine Park, Midwood; Queens: Forest Hills, Kew Gardens, Kew Gardens Hills, Rego Park.','869437581538741','https://www.friendlyvisitingny.org',NULL,NULL,NULL,'981685343230150,1261747089209037,969672981978469',NULL,NULL,NULL,NULL,NULL,'816900089931246',NULL,NULL,NULL,'1265939883950171',NULL,NULL,NULL),(38,581914407561626,'The New York Hearing Center',NULL,NULL,'Offer patients a comprehensive array of services specific to the evaluation, rehabilitation, and prevention of hearing impairment and balance disorders.','629528344595784,910630569868465,1035489378662589','http://thenewyorkhearingcenter.com',NULL,NULL,NULL,'927475609486366',NULL,NULL,NULL,NULL,NULL,'835085424564704',NULL,NULL,NULL,'1170467860831905,673413315824519,832734633665814',NULL,NULL,NULL),(39,601657347342653,'Daily Administrative Solutions, LLC                         ',NULL,NULL,'Mary Ellen McMahon, PDMM, CSA; Daily money management and organizational services which provides: professional organizational support services, internal control and risk management, financial, medical, insurance and legal paperwork filing, budgeting services, senior support, bill payment. Makes home visits and currently serves Westchester County and New York City (areas on the upper East and West sides from 72nd Street to 97th Street, but will occasionally travel out of that area if needed).','1058744444148098','www.dailyadminsolutions.com ',NULL,'MaryEllen@DailyAdminSolutions.com',NULL,'1012417089448021,1080473071775397',NULL,NULL,NULL,NULL,NULL,'665110288049818',NULL,NULL,NULL,'1294610371622695',NULL,NULL,NULL),(40,619599394487325,'Tech Squad',NULL,850259382865797,'From their website: \"A group of neighbors willing and able to help other neighbors with minor household repairs or computer tasks. Because we cannot gauge the volume of requests in advance nor the availability of our Tech Squad volunteers, requests go into a queue. Members are informed whether a volunteer is available to assist. Must be a member to use services. Become a member by calling or filling out registration form online.\" Catchment area: West 96th Street to West 110th Street, between Riverside Drive and Central Park West.','561148298054173','https://www.bloominplace.org/tech-squad.html',NULL,NULL,NULL,'1070189534488260,1137020311225588',NULL,NULL,NULL,NULL,NULL,'887982365412282',NULL,NULL,NULL,'617201724489692',NULL,NULL,NULL),(41,624710230310127,'CityMeals Friendly Visiting ',NULL,NULL,'From their website: \"Must have case management through a DFTA agency to use the program; Matches volunteers with homebound seniors in need of companionship. Volunteers visit for one hour on a weekly basis, forging friendships and helping to alleviate loneliness.\" Serves all 5 boroughs.',NULL,'https://www.citymeals.org/get-involved/friendly-visiting',NULL,NULL,NULL,'969672981978469',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(42,641800255430222,'Lincoln Center Moments',NULL,805627125800715,'From their website: \"Free-performance based program in an intimate and supported setting, specially designed for individuals with dementia and their caregivers. Each program includes a one-hour performance, followed by a one-hour art-making workshop for participants to reflect upon their experience. Registration is required.\"','600077058426789','https://www.lincolncenter.org/festival/lincoln-center-moments',NULL,'access@lincolncenter.org',NULL,'869870722824619,956181681492566,943955981947035,642511572093907,1248151266206446',NULL,NULL,NULL,NULL,NULL,'1118773524261889',NULL,NULL,NULL,'1161463956709772',NULL,NULL,NULL),(43,638311592110417,'ClearCaptions',NULL,NULL,'Phone captioning service',NULL,'www.clearcaptions.com',NULL,NULL,NULL,'927475609486366',NULL,NULL,NULL,NULL,NULL,'1313483683156484,1257693866320676',NULL,'649615701194495',NULL,NULL,NULL,NULL,NULL),(44,598860279139020,'Lions Eyeglass Recycling Center',NULL,991660898573819,'Look up donation drop-off sites online or mail donations to recycling center; reading glasses and sunglasses are donated to people in need and prescription glasses are cataloged so those in need can find a matching prescription to suit them free of charge. ','1330788678148804','http://www.njlerc.org/donations.html',NULL,NULL,NULL,'796531679969625',NULL,NULL,NULL,NULL,NULL,'791782596800343',NULL,NULL,NULL,'597207415067761',NULL,NULL,NULL),(45,609901449758872,'Complementary Care in the Home',NULL,827525452625081,'Pain management and palliative care--also entails treatment of psychological, social, and spiritual issues. Services include hospital or home-based evaluation, treatment by trained team of nurses, HHAs for personal care, physical and occupational therapy, mental health resources, social workers for psychosocial support, collaboration with a physician, and referral. \n\nPosted 11/19',NULL,'www.vns.org/physician-services-program/pain-management-and-palliative-care',NULL,'PainCare@vns.org',NULL,'892286200872415',NULL,NULL,NULL,NULL,NULL,'993998041715828',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(46,617563123105780,'Westchester County\'s Safe Center for Seniors',NULL,1260510841196867,'Westchester County\'s Safe Center for Seniors provides one-stop support for at-risk elderly or a family member overwhelmed by the demands of care giving. Signs that may signal an at-risk senior include isolation, depression, fear, poor hygiene, hunger and unexplained bruises or burns. Services provided include counseling, and case management.\n\nPosted 11/19',NULL,'https://www.nyconnects.ny.gov/services/safe-centers-for-seniors-sofa38342',NULL,NULL,NULL,'1334445722577337',NULL,NULL,NULL,NULL,NULL,'788946701169368',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(47,619738429158848,'Foster Grandparent Program',NULL,616711493480804,'\"The Foster Grandparent Program is part of the National Senior Corps program, which offers low-income older Americans opportunities to give back to their communities. Foster grandparents are 55 or older, can give 20 hours of their time each week, volunteer at hospitals, day cares, elementary schools, after-school programs, Head Start, mentor and encourage children, help children with math, reading, and other subjects, understand that the volunteer program pays a modest stipend.\"','791468515442281','https://www1.nyc.gov/site/dfta/volunteering/foster-grandparents.page',NULL,NULL,NULL,'669632099553613',NULL,NULL,NULL,NULL,NULL,'578208419719036',NULL,NULL,NULL,'955971997114080',NULL,NULL,NULL),(48,623497844436346,'CaptionCall',NULL,NULL,'Phone captioning service','736016270382730','https://captioncall.com/',NULL,NULL,NULL,'927475609486366',NULL,NULL,NULL,NULL,NULL,'615697326988261',NULL,NULL,NULL,'955971997114080',NULL,NULL,NULL),(49,629330886498169,'The Blue Card',NULL,NULL,'From their website: \"Holocaust survivors seeking assistance must be referred to The Blue Card by social service agencies or government agencies in the communities where they live. A case manager at the social service agency performs a financial assessment and reviews the applicant\'s income and expenses to establish need and, when appropriate, helps the senior access any public entitlements for which a the survivor may be eligible. Programs: Claims Conference Emergency Cash Assistance Program  One time grant assistance for emergency needs, Claims Conference In-Home Care Services, Emergency Prevention Programs, Health and Wellbeing Programs, Educational & Outreach Programs.\"','670929657094775','www.bluecardfund.org ',NULL,'info@bluecardfund.org',NULL,'917614737211305,1080473071775397',NULL,NULL,NULL,NULL,NULL,'1173180035979255',NULL,NULL,NULL,'1124196137589616',NULL,NULL,NULL),(50,636494090986396,'Loren Gilberg',NULL,966577103082059,'Elder care consultant and geriatric care manager.\n\nPosted 10/19','1169797880045188',NULL,NULL,'eldercarecorp@aol.com',NULL,'1144317597848541',NULL,NULL,NULL,NULL,NULL,'1145143899367450',NULL,NULL,NULL,'837588754394116',NULL,NULL,NULL),(51,645796006367089,'Leave No Footprint',NULL,NULL,'At this time we are not accepting large furniture for donation. Small pickups of clothing, household items, books, etc. start at $20, depending on the size of the load.  If there is a particular charity a customer would like their donations to go we would gladly deliver there. Donation receipts are provided as well. To book an appointment just send an email with your preferred dates/times and a general list of donations and well proceed with an estimate. Serves all 5 boroughs of NYC, Westchester, and parts of NJ.','1201838337524842','http://leavenofootprintnyc.com/',NULL,'christine@leavenofootprintnyc.com',NULL,'796531679969625',NULL,NULL,NULL,NULL,NULL,'725610732320337',NULL,NULL,NULL,'955971997114080',NULL,NULL,NULL),(52,647963469199800,'Senior Companion Program',NULL,621590574293234,'Medical escorting, light errands, Friendly Visiting, companionship, meal planning, medication reminders, caregiver respite, senior volunteers (55+) escort and assist other seniors. It is a free service that mostly serves the Lower East Side and mid-town Manhattan. Call for availability. ','745545957016997','www.henrystreet.org/programs/senior-services/senior-companion-program',NULL,'sscott@henrystreet.org',NULL,'969672981978469,910515645454451,877451051471319',NULL,NULL,NULL,NULL,NULL,'947211911095759',NULL,NULL,NULL,'1231025244767006',NULL,NULL,NULL),(53,648525876344618,'Elder Law Answers',NULL,NULL,'\"Provides legal information regarding issues facing seniors and provides referrals to elder law attorneys.\"','824412171835980','https://www.elderlawanswers.com/',NULL,NULL,NULL,'785468758686103',NULL,NULL,NULL,NULL,NULL,'1340381736836616',NULL,NULL,NULL,'955971997114080',NULL,NULL,NULL),(54,650697226576535,'High Holidays & Passover Food Drive',NULL,1086901533394341,'Donate nonperishable, kosher foods to make sure no one in our city goes hungry during the High Holidays and Passover. Check in August for information for High Holidays (and in March for Passover) about how to start your own drive! Accepts Kosher nonperishable food.','1144855430685302','https://www.cityharvest.org/programs/food-drives/',NULL,NULL,NULL,'1113477575023431,796531679969625',NULL,NULL,NULL,NULL,NULL,'1168965348029088',NULL,NULL,NULL,'771969867372890',NULL,NULL,NULL),(55,659598091313548,'RSVP of Westchester','Senior Corps',1185131042370952,'Volunteer organization for adults 55+. Reimbursement for transportation, supplemental liability insurance, annual recognition events, birthday acknowledgments, and volunteer placement provided for members. \n\nPosted 11/19',NULL,'www.volunteernewyork.org/adults',NULL,'wendy@volunteernewyork.org',NULL,'1174744908232674','Mail or fill in the application online',NULL,NULL,NULL,NULL,'886135179708593',NULL,'1128244555571853',NULL,NULL,NULL,NULL,NULL),(56,662053153004389,'Morningside House Adult Day Health Care Program',NULL,NULL,'Morningside ADHCP\'s mission is to provide a broad spectrum of quality health care services and recreational activities to meet the physiological and psychosocial needs of individuals residing in the community with Alzheimer\'s Disease, related dementias, or other medical or psychological conditions to actively support caregivers to maintain those individuals in the community.\n\nPosted 11/19','1106986722041635','disabled.westchestergov.com/morningside-house-adult-day-health-care',NULL,'lgoldman@cassenacare.com',NULL,'1114469131907548,853236516099165',NULL,NULL,NULL,NULL,NULL,'1172502082395416',NULL,'809119216202381',NULL,'1274441827605514',NULL,NULL,NULL),(57,622439516438446,'Telehealth Intervention Programs for Seniors','TIPS',1260510841196867,'Through regular remote monitoring, patients can self-manage chronic conditions, avoid unplanned and emergency medical visits, and reduce medical expenses for themselves and caregivers. \n\nPosted 10/19',NULL,'https://seniorcitizens.westchestergov.com/',NULL,NULL,NULL,'1133396357269256',NULL,NULL,NULL,NULL,NULL,'647232015290320',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(58,633851278206049,'Jewish Family and Children\'s Services of Northern NJ',NULL,NULL,'Services include a Friendly Visiting program, Care Management, Kosher Meals on Wheels, Telephone Reassurance, Monthly Luncheon, programs specific to Holocaust survivors, Telecare Connections Skype calls and Shabbat meals.  Seniors need an intake and home assessment. For Friendly Visiting, meals, and Telephone Reassurance, seniors must be homebound. For seniors residing in Northern New Jersey. ','792178334018646,888888544923370,1296402255519103','https://www.jfcsnnj.org/elder-service-care',NULL,'info@jfsbergen.com',NULL,'917614737211305,784392560809728,830617726149111,969672981978469,1126107523105430',NULL,NULL,NULL,NULL,NULL,'1279540666574393',NULL,NULL,NULL,'1090470540858526,883799361816161,800229404655809',NULL,NULL,NULL),(59,642763383791055,'Gilda\'s Club Westchester',NULL,NULL,'Gildas Club Westchester creates communities of emotional and social support for everyone living with cancer  women, men, teens, children and their families, providing support groups, educational lectures, healthy lifestyle workshops and social activities.\n\nPosted 10/19','1103716398703959','www.gildasclubwestchester.org ',NULL,'info@gildasclubwestchester.org',NULL,'1184375293767958',NULL,NULL,NULL,NULL,NULL,'606404525571499',NULL,NULL,NULL,'778372507284518',NULL,NULL,NULL),(60,660358273093811,'Church of the Holy Apostles Soup Kitchen',NULL,1214287184965619,'From their website: \"Food donations can be dropped off between 9 a.m. and 2 p.m. Please come to the building next to the church, ring the kitchen buzzer, and the kitchen staff will retrieve the food. Clothing can be dropped off between 9 a.m. and 5 p.m. Before 1 p.m., please come to the building next to the church, enter at the volunteer entrance and take items to the counseling room. After 1 p.m., please come to the building next to the church, ring the 3rd floor buzzer, and the administrative staff will retrieve the items. Monday-Friday from 10:30-12:30, limited supply of free Metro Cards. Bring proof of an appointment or proof of employment. Holy Apostles can also write a letter of financial difficulty that can be shown at subway stops, and sometimes the clerk will then allow the person to ride for free.\" ','606626868016020','https://holyapostlessoupkitchen.org/contact-us/',NULL,'rtrifiro@holyapostlesnyc.org',NULL,'1048629387183766,796531679969625',NULL,NULL,NULL,NULL,NULL,'577382760984543',NULL,NULL,NULL,'883017278918660',NULL,NULL,NULL),(61,609974918602397,'Mavencare Home Care',NULL,NULL,'Serving New York Citys five boroughs and Nassau County. Provide personal care, companionship, and specialty care from home health aid (hourly, live-in, 24/7 active), skilled care from Licensed Practical Nurse. They screen for the most qualified and compassionate home health aides. All hired caregivers are W2 employees, fully licensed, bonded, insured, and well-paid with the option for health insurance. Rates (as of March 2019): Private pay, HHA $28/hour, $325/day live-in; LPN $55/hour. Medicaid (VillageCareMAX MLTC/MAP plan & Integra MLTC plan). They can bill all major Long Term Care Insurance companies. Each client has a designated team of HHA(s) and full-time RN, Social Worker, and Care Coordinator. This level of support allows them to take on clinically and psychosocially complex clients, including those with Alzheimers, Dementia, Parkinsons, and Heart Diseases. They have a Connected Home Care App, so families can stay connected with their loved ones care and their entire care team, and they also have 24/7 care and support. Client Services Director, John J. Bayeux III\n','946791668288409','https://mavencare.com/',NULL,NULL,NULL,'1324596060194399',NULL,NULL,NULL,NULL,NULL,'600649944791407',NULL,NULL,NULL,'757931812959756',NULL,NULL,NULL),(62,615964161627015,'Work NYC',NULL,818742815221035,'From their website: \"Connects families withcritical resourcesessential to self-sufficiency (benefits access, financial empowerment, and workforce development opportunities) and connects New Yorkers to resources for skills training that meet employer demands and place them on career pathways.\" ','825513025459215','www.unitedwaynyc.org',NULL,NULL,NULL,'669632099553613',NULL,NULL,NULL,NULL,NULL,'620329918682642',NULL,NULL,NULL,'887138243308767',NULL,NULL,NULL),(63,625928363836513,'Food Pantry & Clothing ',NULL,859311048444171,'Accepts donations of healthy, nutritional non-perishable foods. They do not distribute high-salt or high-sugar prepared foods. Also accepts clothing donations of folded, laundered, lightly-used clothing. Families may shop for a free three-day supply of food once a calendar month. Fresh fruit, vegetables, fresh milk, meat, other proteins, whole grains, etc. Hours of operation: Monday 8:00 am-12:00 pm & 1:00 pm-6:30 pm, Wednesday, Thursday, & Friday 8:00 am-12:00 pm & 1:00 pm-6:30 pm. Closed on Tuesday. Bring identification (driver\'s license, NYS ID, EBT card, passport, legal residency card, foreign ID, or birth certificate) and proof of address (letter from school, shelter, community agency, post-marked bill, utility bill, or current lease).','1123801795689517','https://www.wscah.org/food-clothing/',NULL,NULL,NULL,'1113477575023431,796531679969625',NULL,NULL,NULL,NULL,NULL,'1309002671500522',NULL,NULL,NULL,'834669419954225',NULL,NULL,NULL),(64,627733787707334,'It Takes A Village','ITAV',NULL,'Aging in place resources in Tarrytown and Sleepy Hollow. Provides transportation, at home services (minor repairs and light housework and cooking in emergency situations). Medical services are not provided. Volunteers are often seniors themselves, which leads to social connections between members and volunteers. Second Tuesday meetings are opportunities for education in issues related to aging. \n\nPosted 12/19','1205659672479780','www.itav10591.org',NULL,NULL,NULL,'1260794998607714,808645273134339,1257808542253052',NULL,NULL,'$25 annually for membership',NULL,NULL,'976396516929335',NULL,NULL,NULL,'689585651637569',NULL,NULL,NULL),(65,639799693024150,'Caregivers\' Support Group',NULL,617910248814061,'Onsite spousal support group, led by staff social worker. Meets every other Tuesday from 10 am- 11:30 am. In order to participate: a caregiver must be met with and interviewed to determine if this is the right group for them.','872398746454681','www.dorotusa.org',NULL,NULL,NULL,'1063168571768300,877451051471319',NULL,NULL,NULL,NULL,NULL,'637042726567005,1053545479364272',NULL,NULL,'1272863013225282','801326186311509',NULL,NULL,NULL),(66,645544600514407,'Food Bank of New York City-Food Pantries',NULL,NULL,'Online directory of food pantries in the five boroughs, including kosher pantries. ','840514443838048','www.foodbanknyc.org',NULL,NULL,NULL,'1113477575023431',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1122669078685279',NULL,NULL,NULL),(67,647550805587258,'Sunnyside Community Services-Senior Programs',NULL,826319322006898,'Provides case management, home care, benefits counseling, friendly visiting, pet pals program, onsite activities for active seniors, and a day program for older adults with cognitive impairments, such as Alzheimers disease for seniors 60 and up. ','622250378340276','https://www.scsny.org/programs/senior-programs',NULL,'info@scsny.org',NULL,'1009228235801069,981685343230150,1299575089394687,784392560809728',NULL,NULL,NULL,NULL,NULL,'606516128608267',NULL,NULL,NULL,'594630229760890',NULL,NULL,NULL),(68,647229496315746,'Wartburg Independent Senior Living',NULL,NULL,'Independent living with a choice of luxury town-homes or affordable apartments. \n\nPosted 11/19','1244833784703696','wartburg.org',NULL,NULL,NULL,'1281533535852091',NULL,NULL,NULL,NULL,NULL,'1140236227763481',NULL,NULL,NULL,'1125985473489689',NULL,NULL,NULL),(69,659031193612793,'SelfHelp-Safety Net',NULL,685028959367331,'Social workers can help individuals who qualify to access financial assistance. This program is funded by New York Times Neediest and other private grants and donations. They have a catchment area of West 70th and above and East 80th Street and below. They will serve seniors 60 and over for short-term or long-term case management and also those who are disabled and under 60. ','1037743861488348','www.selfhelp.net',NULL,NULL,NULL,'1080473071775397',NULL,NULL,NULL,NULL,NULL,'655472709820870',NULL,NULL,NULL,'926390961461476',NULL,NULL,NULL),(70,662290598368678,'City Opera Thrift Shop',NULL,NULL,'Accepts clothing, books, furniture, decorative household items, picks up any of these items--call to schedule.','1181479920064319','https://cityoperathriftshop.org/donate',NULL,NULL,NULL,'796531679969625',NULL,NULL,NULL,NULL,NULL,'1180851557883688',NULL,NULL,NULL,'1007514442673709',NULL,NULL,NULL),(71,666160522829291,'Lighthouse Guild-Volunteer Reading Services',NULL,NULL,'Volunteer readers make home visits to seniors in the 5 boroughs to read to them for two hours, once a week. Call for intake. ','946288203514985','https://www.lighthouseguild.org/',NULL,NULL,NULL,'969672981978469,821861174676380',NULL,NULL,NULL,NULL,NULL,'1186346032225073',NULL,NULL,NULL,'944853548512062',NULL,NULL,NULL),(72,671609118944117,'Atria Senior Living',NULL,NULL,'Luxury independent and assisted living, as well as memory care in select locations. 24/7 staff assistance with personal care, medications, and incontinence management. Apartment accommodations, concierge service, maintenance staff, recreation, and scheduled transportation available. \n\nPosted 11/19','1123588260654177','www.atriaseniorliving.com/clusters/westchester-county/',NULL,NULL,NULL,'1057136254371539,1281533535852091,853236516099165,979043836689591',NULL,NULL,NULL,NULL,