d practical advocate who works tirelessly on behalf of his clients to efficiently navigate senior living options in the greater NYC and Northern NJ area.',NULL,'https://www.callericnyc.com/',NULL,'eric@callericnyc.com',NULL,'632606603203298,1149247622463332,1157747719793788',NULL,NULL,NULL,NULL,NULL,'1209027815338439',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(78,652845412907744,'Riverdale Senior Services',NULL,NULL,'Provide social services including health education and management, \nEarly Stage Memory Loss Program, behavioral health services, homebound support, transportation, certified pet therapy dog, support groups, caregiver resources, etc. Onsite programs include technology help, meals, trips, games, intergenerational programs, exercise, films, lectures, and more. \n(Updated 12/4/19)','826434062003328','https://rssny.org/',NULL,NULL,NULL,'634570173416697,1299575089394687,1137020311225588',NULL,NULL,NULL,NULL,NULL,'820345153653373',NULL,NULL,NULL,'1125425694826942',NULL,NULL,NULL),(79,650947090756768,'RideConnect',NULL,1137676839800411,'RideConnect, a not-for-profit program of Family Services of Westchester, is dedicated to finding the fastest and most cost-effective transportation options to meet the needs of older adults, age 60+, in southern Putnam and Westchester Counties.\n\nPosted 10/19',NULL,'http://www.rideconnectwestchester.org',NULL,NULL,NULL,'1260794998607714',NULL,NULL,NULL,NULL,NULL,'1220215952032500',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(80,655477513239628,'VillageCare at 46 and Ten',NULL,NULL,'From their website: \"Supportive living environment for seniors 62 or older. Apartments have a complete kitchen, which includes a refrigerator and stove. Air conditioners are provided in each apartment. Available services: weekly housekeeping and linen change, three meals a day, served restaurant-style, case management services, medication management, personal care/home health aide services, recreation activities, 24-hour security, 24-hour concierge and security service, personal emergency response call systems in each apartment.\" ','1230252559669970','http://www.46and10village.org/',NULL,NULL,NULL,'1149247622463332,1157747719793788',NULL,NULL,NULL,NULL,NULL,'1080773681073798',NULL,NULL,NULL,'611758640912280',NULL,NULL,NULL),(81,671412938379029,'HCC Legal Consultation Services',NULL,983279313641184,'Fifteen minute consultations in their housing legal clinic for NYC residents who do not meet eligibility requirements (who are outside of their catchment area of 34th to 100th Street, west of 5th Avenue to the Hudson River, or do not meet income eligibility criteria), Monday nights from 7:00 pm  9:00 pm. Call to confirm times and days.','769619830768525','http://hcc-nyc.org/',NULL,'info@hcc-ny.org',NULL,'785468758686103,632606603203298',NULL,NULL,NULL,NULL,NULL,'1177385215314132',NULL,NULL,NULL,'769461493908132',NULL,NULL,NULL),(82,669619303185507,'CarePatrol',NULL,NULL,'Free senior placement service for families considering Assisted Living, Memory Care Communities, and Nursing homes. \n\nFrom Website: We are local professionals that schedule tours and accompany you throughout care facilities to ensure that you are finding the best place for your friend or family member. Our services are free to families as we are compensated by our network of providers.\n\nPosted 11/19',NULL,NULL,NULL,NULL,NULL,'606548005480946',NULL,NULL,NULL,NULL,NULL,'1146775943975111',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(83,678225650204200,'Medicare Rights Center',NULL,NULL,'From their website: \"Counselors are available Monday through Friday, and are happy to answer your questions about insurance choices, Medicare rights and protections, payment denials and appeals, complaints about care or treatment, and Medicare bills.\"','820448574506867','www.medicarerights.org/',NULL,NULL,NULL,'775024125555217',NULL,NULL,NULL,NULL,NULL,'981955137220066',NULL,NULL,NULL,'787663585182344',NULL,NULL,NULL),(84,679316262960090,'Care Program',NULL,798994226105048,'For seniors who are unable to function independently because of a memory impairment and are in need of support throughout the day. A diagnosis of dementia is required for participation in the program (cost depending on attendance: art/pet therapy, music, poetry, yoga, farm to table lunch).','1130738975518235,940883776000708','http://www.lenoxhill.org/careprogram',NULL,NULL,NULL,'1106100275196851,943955981947035,642511572093907,1248151266206446',NULL,NULL,NULL,NULL,NULL,'1132756091918877',NULL,NULL,NULL,'870634650166451,748216179850947',NULL,NULL,NULL),(85,629288783459442,'NAC Kinship Care Program',NULL,1116923382250023,'Services for grandparents caring for grandchildren, serves all five boroughs. From their website: \"The Kinship Care Program at New Alternatives for Children (NAC) will provide a variety of services to kinship and fictive kin caregivers in the community. The services provided by the Kinship Care Program includes parent education trainings, support groups and case management services. Case management services consist of education advocacy including navigating the special education system, referrals to community resources, such as mental health services, recreation for children, housing and legal services, as well as advocacy and support with government entitlements. NACs Kinship Care Program is open to all kin and fictive kin families and also specializes in serving families who have children with complex medical and behavioral health needs.\"\n','1071945974194624','www.NacKidsCan.org',NULL,' info@NacKidsCan.org',NULL,'784392560809728,1098435126525914,877451051471319',NULL,NULL,NULL,NULL,NULL,'1194428081935565',NULL,NULL,NULL,'1091475809166190',NULL,NULL,NULL),(86,635767014777690,'NJ 211',NULL,NULL,'Resource line for the state of NJ.','638454976676154','www.nj211.org/',NULL,NULL,NULL,'1126107523105430',NULL,NULL,NULL,NULL,NULL,'831790758217048,1118602068378559',NULL,NULL,NULL,'955971997114080',NULL,NULL,NULL),(87,646672113492683,'Patient Advocacy',NULL,NULL,'H