263375',NULL,NULL,NULL),(92,665503981563170,'Senior Transportation Program',NULL,828071650886930,'From their website: \"Provides transportation for senior citizens residing in Community Districts 1, 2, 3, 4 & 7 in Queens County (districts include all of Northern Queens, specifically, Astoria, Long Island City, Steinway, Sunnyside, Woodside, Jackson Heights, Elmhurst Corona, Flushing, Whitestone and College Point). Both van and car service is used to accommodate the needs of the clients that utilize the program. Van service provides group transportation for seniors to various senior centers, as well as for group shopping and day trips. Car service provides private transportation to physically handicapped or extremely frail seniors for medical appointments.\"','878704477770045','http://hss.hanac.org/hanac.org/transportation.php',NULL,NULL,NULL,'981685343230150,1048629387183766',NULL,NULL,NULL,NULL,NULL,'939101045497128',NULL,NULL,NULL,'1111497187226592',NULL,NULL,NULL),(93,671244311648067,'Alzheimer\'s Association: Resources, Services, and Support Groups',NULL,889831606200239,'The Alzheimer\'s Association works on a national and local level to provide care and support for all those affected by Alzheimer\'s and other dementias.\n\nPosted 10/19',NULL,'http://www.alzhudsonvalley.org/',NULL,NULL,NULL,'853236516099165',NULL,NULL,NULL,NULL,NULL,'1127376173747334',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(94,684649127511411,'Council Senior Center',NULL,1005320638690324,'Educational and recreational activities and classes (bridge, computers, art, literature, creative writing, and fitness). Trips, movies, performances, cafe on site (non-kosher), support groups, social services, and LINC program for those who are memory impaired (Wednesdays & Fridays).','895924441806597','https://www.ncjwny.org/programs/',NULL,NULL,NULL,'1299575089394687',NULL,NULL,NULL,NULL,NULL,'1179699628550260',NULL,NULL,NULL,'578674092200867',NULL,NULL,NULL),(95,689580955851277,'Nicolle Brunale, LMSW: Elder Abuse Prevention Program',NULL,1137676839800411,'FSWs Elder Abuse Prevention Program is designed to improve the safety and well-being of older adults living in Westchester County who are at risk of abuse by family members.\n\nPosted 10/19',NULL,'https://www.fsw.org/our-programs/older-adults/elder-abuse-prevention-program',NULL,'nbrunale@fsw.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1138943674330460,874040990130824',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(96,689279594966959,'Fresh Direct',NULL,NULL,'Order online, book a few days in advance, 2 hour window, delivery fee $5.99.','1232602786078763','www.freshdirect.com',NULL,NULL,NULL,'1235894498248246',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'955971997114080',NULL,NULL,NULL),(97,691036117584255,'Paper Moon Moves',NULL,NULL,'Assists in pre-move, moving, and unpacking; also does estate clear-outs and downsizing, home modifications, and de-cluttering.','942582231528336','www.papermoonmoves.com/',NULL,'katie@papermoonmoves.com  ',NULL,'917020988773351,1183042635305812,656941113483002,1294594151119548',NULL,NULL,NULL,NULL,NULL,'741375174756650',NULL,NULL,NULL,'1242402592239497',NULL,NULL,NULL),(98,696303730765573,'Happy Donations',NULL,NULL,'You pack and ship donations (clothing) via UPS for free--donated to US Veterans (print free shipping label & bring to UPS).','933697276528216','www.happydonations.org/',NULL,NULL,NULL,'796531679969625',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'955971997114080',NULL,NULL,NULL),(99,704949997839383,'Crossing Guard Positions',NULL,639979342463408,'As of 7/22/19: The NYPD position of school crossing guard is part-time employment that comes with a personal sense of job satisfaction as you safeguard school children walking across busy intersections on their way to and from school. School crossing guards oversee and control traffic flow around schools in the morning, at lunch time, and at the end of the school day. Entrusted with the safety of the city\'s schoolchildren, candidates for this position are asked to meet certain physical and medical requirements, and complete six days of training at the NYC Police Academy once appointed. In return, school crossing guards are rewarded with an exceptional opportunity to serve their community, while earning a competitive salary with family health insurance benefits. Pay and Benefits: $15.00/hour, health insurance with 20-plus hours worked per week, work close to home, summer work also available. Requirements: There are no formal education or experience requirements for this job, but all candidates must be able to understand English and speak English well enough to be understood.\nPrior to appointment, prospective candidates must pass a qualifying medical examination, which includes drug screening, and a character/background investigation. Once appointed, candidates must complete six days of training at the Police Academy. Apply online at the link below or contact your local police precinct.','1089674865749089,865426227582678','https://www1.nyc.gov/site/nypd/careers/civilians/school-crossing-guard.page',NULL,NULL,NULL,'669632099553613',NULL,NULL,NULL,NULL,NULL,'834857618004619,666677882082048',NULL,NULL,NULL,'955971997114080',NULL,NULL,NULL),(100,713324434220839,'Greenwich House-Case Management',NULL,796026064627918,'Caseworkers (fluent in English and Spanish) provide assistance with questions about SCRIE, maintain an extensive file of resources and information on legal aid, meals-on-wheels, affordable dental care, mental health providers, and a host of other services. They also provide referrals to Money Management or Senior Health and Consultation services through Greenwich House, where necessary.','813872266131333','http://www.greenwichhouse.org/cc_senior_centers/case-management',NULL,NULL,NULL,'784392560809728',NULL,NULL,NULL,NULL,NULL,'828032746657818',NULL,NULL,NULL,'1092371168209127',NULL,NULL,NULL),(101,708105628538848,'Vintage Thrift',NULL,1308744014948525,NULL,'888854290272678',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'704422111355233',NULL,NULL,NULL,'752947842269144',NULL,NULL,NULL),(102,726964458915620,'ParaTransit',NULL,1114707966679244,'For people with disabilities who are not able to ride a regular fixed-route bus. Requires prior certification and advanced reservations (one to seven days).\n\nPosted 10/19\n',NULL,'https://transportation.westchestergov.com/bee-line-paratransit',NULL,NULL,NULL,'1260794998607714',NULL,NULL,NULL,NULL,NULL,'1089327306725078',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(103,730910006564936,'Legal Referral Service',NULL,843755999363023,'From their website: \"Call or request lawyer online to discuss your legal question with one of our attorney referral counselors or submit it online. All information you provide will be kept confidential to the fullest extent possible under the law. Get referred to a screened and qualified lawyer or the right resource. Initial consultations are $35 or free, depending on the type of case, and last up to 30 minutes.\"','633941962467510','http://www.nycbar.org/get-legal-help/',NULL,NULL,NULL,'785468758686103',NULL,NULL,NULL,NULL,NULL,'838851197051074',NULL,NULL,NULL,'919181871279364',NULL,NULL,NULL),(104,733448619284596,'Moravian Open Door',NULL,NULL,'Transitional housing for people 50+. Fee of $355 a month. Provides cooked meals, breakfast, and a community kitchen if residents want to cook for themselves.','775481781223730','www.moravianhouse.org',NULL,'info@moravianhouse.org',NULL,'632606603203298',NULL,NULL,NULL,NULL,NULL,'851093536874721',NULL,NULL,NULL,'925661966666383',NULL,NULL,NULL),(105,742345692201969,'Weill Cornell Community Clinic','WCCC',874300745043714,'Dental referrals for low-cost/sliding scale dental services.','771483187355049','https://wccc.weillcornell.org/community-resources/dental-referrals',NULL,NULL,NULL,'1060789001254366,930870677737263',NULL,NULL,NULL,NULL,NULL,'1334772655775155',NULL,NULL,NULL,'1064244123014557',NULL,NULL,NULL),(106,757049656815040,'Caregiver Support Program',NULL,1132655505483770,'Center provides a space for respite, contact with experienced volunteers, computer usage, and a resource library.\n\nPosted 11/19','677875567988405',NULL,NULL,NULL,NULL,'1160439364324685',NULL,NULL,NULL,NULL,NULL,'810751312188465',NULL,NULL,NULL,'1271093616374851',NULL,NULL,NULL),(107,769342040158147,'Westchester Independent Living Center','WILC',NULL,'Not-for-profit, community based, consumer-directed advocacy and resource center that services people of all ages with all types of disabilities. It is part of a national network of Independent Living Centers that provide a wide spectrum of non-residential and non-medical services. \n-Benefits and entitlements advisement\n-Information and referral\n-Community outreach\n-Independent living skills\n-Peer advisement\n-Individual and systems advocacy\n-Deaf services\n-Equal access consultation\n\nSpecialized Programs:\n-Client Assistance Program\n-Minority Outreach Program\n-Mental Health Advocacy Program\n-Traumatic Brain Injury Regional Resource Development Center\n-Nursing Home and Transition Diversion Waiver\n-Partners for Success Program\n-Disability Program Navigator\n-Educational Advocacy Program\n\nPosted 11/19','1160536297048294','www.wilc.org',NULL,NULL,NULL,'1258526581948590',NULL,NULL,NULL,NULL,NULL,'574879341811964',NULL,NULL,NULL,'598262043782165',NULL,NULL,NULL),(108,775129095879874,'My Second Home: An Intergenerational Adult Day Program',NULL,1312050182905151,'My Second Home (MSH), established in 1998, offers a refreshing and innovative intergenerational approach to adult day services, and is an affordable alternative to assisted living or nursing home care. Our award-winning intergenerational day program  the only one of its kind in Westchester County and a model for the nation  offers older adults a safe, supervised, home-like day care environment.\n\nPosted 10/19','975370975593398','https://www.fsw.org/our-programs/my-second-home',NULL,NULL,NULL,'1114469131907548,853236516099165',NULL,NULL,NULL,NULL,NULL,'1080998288598265',NULL,'568744748839211',NULL,'582545310816360',NULL,NULL,NULL),(109,784080264183843,'The Caregiver Resource Center',NULL,NULL,'-Information & Education\n-Family Discussion\n-Needs Assessment\n-Caregiver Support & Guidance\n-Case Management\n-Counseling\n-Referrals to Providers\n-Crisis Management\n-Advocacy\n-Corporate Programs & Services\n\nPosted 10/19','657308519913165','www.caregiverresourcecenter.com',NULL,'Care4you@optonline.net',NULL,'1160439364324685',NULL,NULL,NULL,NULL,NULL,'1284790787206670',NULL,NULL,NULL,'1116749681420034',NULL,NULL,NULL),(110,727746373311059,'Penn South Program for Seniors',NULL,919573592529568,'Monday-Friday, 9 am-5 pm and two Wednesday evenings per month, health, educational, recreational, and cultural programs for NYC residents 55 years and older. ','972498722527865','https://psss.org/',NULL,NULL,NULL,'1299575089394687',NULL,NULL,NULL,NULL,NULL,'1128762562999775',NULL,NULL,NULL,'1240598614624115',NULL,NULL,NULL),(111,781635249160488,'Afya Foundation',NULL,NULL,'Medical supply recovery organization collecting still-usable but no-longer-needed medical and humanitarian supplies to send them to developing nations in Africa, Haiti and nations-in-need. Drop off only. Call for details on drop-off times and locations. East End Temple Drop-off Location at 245 East 17th Street, (212) 477  6444 or Plaza Jewish Community Chapel Drop-off Location at 630 Amsterdam Avenue, (212) 769  4400.','804057057119015,1089297167490921','http://afyafoundation.org',NULL,NULL,NULL,'796531679969625',NULL,NULL,NULL,NULL,NULL,'1227678808451178,1286994761497347,1270418240534661',NULL,NULL,NULL,'921615263478420,605021630756792',NULL,NULL,NULL),(112,729819108773188,'Escort Assistance Services',NULL,1233682522628423,'\"Serving those who live, work, or go to school in Chelsea, with a focus on those in need, adult services for older adults age 55+,  staff speaks many languages including Spanish, Cantonese and Mandarin in addition to English. Must be a member of Penn South or live at the Hudson Guild NORC, Elliott-Chelsea Houses. Call for intake over the phone or in person.\"','859141805722434','https://hudsonguild.org/programs/adult-services/',NULL,NULL,NULL,'910515645454451',NULL,NULL,NULL,NULL,NULL,'899500549900682',NULL,NULL,NULL,'942751698425590',NULL,NULL,NULL),(113,745033395868348,'Friendship Line-Hotline ',NULL,NULL,'National 24-hour support for lonely, isolated, depressed, frail and/or suicidal seniors. Also does grief support through assistance and reassurance. They also make on-going outreach calls to lonely older adults. From their website: Institute on Agings 24-hour toll-free Friendship Line is the only accredited crisis line in the country for people aged 60 years and older, and adults living with disabilities. The Friendship Line is both a crisis intervention hotline and a warmline for non-emergency emotional support calls. Friendship Line provides round-the-clock crisis support services including: providing emotional support, elder abuse reporting, well-being checks, grief support through assistance and reassurance, active suicide intervention, information and referrals for isolated older adults, and adults living with disabilities. In addition to receiving incoming calls, Friendship Line also offers outreach to eligible callers. We connect with people on a regular basis, and help monitor their physical and mental health concerns. The call-out services act as an intervention to prevent suicide in the long term by improving the quality of life and connected-ness of isolated callers. Any aging adult or person living with disabilities, who suffers from depression, loneliness, isolation, anxiousness, or may be thinking about death or suicide, can benefit from completely confidential phone calls with Friendship Line volunteers. ','942007178258006','https://www.ioaging.org/services/all-inclusive-health-care/friendship-line',NULL,NULL,NULL,'1063168571768300,975020390374256,1000576764179618',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(114,753881045700684,'God\'s Love We Deliver',NULL,NULL,'Home delivered meals for those with a life-altering illness such as HIV/AIDS, cancer or Alzheimer\'s disease who has difficulty shopping or cooking. Individuals must be living with a serious illness, have some restrictions in activities of daily living (such as difficulty standing or walking), and be able to get doctors verification of these limitations. They provide services regardless of income. They cannot accommodate soy allergies, or gluten-free, Kosher, Halal, or vegan diets. For more information, see their website for required forms and frequently asked questions. ','1167257649168566','https://www.glwd.org/',NULL,'clientservices@glwd.org',NULL,'830617726149111',NULL,NULL,NULL,NULL,NULL,'909474513199814',NULL,NULL,NULL,'1143989115790991',NULL,NULL,NULL),(115,755136437715114,'Partnership Innovation for Older Adults Program','PIOAP',1137676839800411,'Local collaboration to bring mobile outreach and off-site services, including behavioral health and aging services and telehealth interventions to older adults in Westchester County, age 55+.\n\nPosted 11/19',NULL,'www.fsw.org/our-programs/older-adults/geriatric-mental-health',NULL,'tmonti@fsw.org',NULL,'871376605323560',NULL,NULL,NULL,NULL,NULL,'1112218543731803',NULL,'1349049648864073',NULL,NULL,NULL,NULL,NULL),(116,767280654488239,'24/7 Evaluation and Referral Service',NULL,952675500351470,'Mental health and chemical dependency evaluation and referral services for children, adolescents, and adults. Services available by appointment or on walk-in basis. \n\nPosted 11/19','1275169097954443','www.stvincentswestchester.org/outpatient-programs/evaluation-and-referral-service',NULL,NULL,NULL,'871376605323560',NULL,NULL,NULL,NULL,NULL,'1054426816640994,808731055634769',NULL,NULL,NULL,'1301817408777665',NULL,NULL,NULL),(117,771061072734541,'CareTogether',NULL,1195749892166713,'Web-based community that offers family caregivers the ability to connect with each other and share vital information such as scheduling, messaging, tasks, and resources as a means to ensure they will have the support they need to provide the best care possible for their loved ones. \n\nPosted 10/19',NULL,'www.care-together.com',NULL,NULL,NULL,'1160439364324685',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(118,767046013165180,'Escorting to Appointments',NULL,1219582025275697,'Volunteer escorting program with 1-2 volunteers available; Senior MUST BE A MEMBER OF HAFOP*. Call to discuss membership with them. Once a member, they need as much advance notice as possible to schedule a volunteer. *Membership guidelines include the following: For older adults over 60 years of age who share a common goal of\nhealthy aging, membership in the Healthy Aging Program is at the sole\ndiscretion of the Board of Directors, it is expected that members will attend exercise and wellness programs to take advantage of the support provided by Health Advocates to age with vitality and independence.','1275743859932320','http://www.hafop.org/',NULL,NULL,NULL,'910515645454451',NULL,NULL,NULL,NULL,NULL,'638061477311803',NULL,NULL,NULL,'886253808274487',NULL,NULL,NULL),(119,782938477439239,'Caregivers to the Elderly Support Group',NULL,845367419385279,'\"A Self-help group which provides support, resources, and an opportunity to connect with other caregivers of the elderly on the first and third Wednesday of each month. Meetings are held from 5:30 p.m. to 7:30 p.m. and are free for all attendees.\"\n(Updated 12.2.19)','1137483523662416','http://westviewnews.org/2018/03/update-caregiver-support-program/',NULL,NULL,NULL,'877451051471319',NULL,NULL,NULL,NULL,NULL,'1257757845975565',NULL,NULL,NULL,'612772622129876',NULL,NULL,NULL),(120,785872654393780,'Friendly Visiting',NULL,617910248814061,'Weekly or monthly social visits by a volunteer for one hour in a senior\'s home. Match is followed by a social worker. ','872398746454681','www.dorotusa.org',NULL,NULL,NULL,'969672981978469',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1272863013225282','801326186311509',NULL,NULL,NULL),(121,790614912591800,'Community Agency for Senior Citizens',NULL,NULL,'Case management, home delivered meals, Friendly Visiting, assistance with entitlements and resources, and medical transportation for seniors residing in Staten Island. ','822331158504021','http://cascsiny.org/',NULL,NULL,NULL,'1048629387183766,784392560809728',NULL,NULL,NULL,NULL,NULL,'1275388700455417',NULL,NULL,NULL,'817358056301206',NULL,NULL,NULL),(122,799191644314434,'Educational Alliance Career Connect ',NULL,NULL,'Offers one-on-one counseling and job readiness workshops to assist with resume writing, interview preparation, job applications, research tools and more at the Manny Cantor Center. Serves Manhattan.',NULL,'https://edalliance.org/our-programs/services/employment/',NULL,'employmentservices@edalliance.org',NULL,'669632099553613',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(123,805036440045659,'Lifetime Connections Without Walls',NULL,1118604789741776,'From their website: A telephone-based program that provides opportunities for socially or physically isolated older adults to connect with others in their community and across the country. We offer social and educational classes, support groups, and friendly conversation  all over the telephone  all from the comfort of home. Classes are facilitated by volunteers, community partners, and contracted professionals. \nFor people aged 55 or older who have the ability to have a conversation over the telephone with a group of people, and have access to a telephone. \nFour sessions per year (winter, spring, summer, fall). Each quarterly session is about 13 weeks long with breaks for holidays.\nEach quarterly session costs $10 which allows you to register for unlimited classes. Participation is open to U.S. residents. \nLCWW connects you to the classes you register for via a telephone conference call system. All you have to do is answer your phone to join the call. If you miss the call or prefer to call into the class on your own, this is an option, too. We would just provide you with the call-in telephone number.','1266255552527006','https://www.familyeldercare.org/programs/lifetime-connections-without-walls/',NULL,'LCWW@familyeldercare.org ',NULL,'1063168571768300,969672981978469,975020390374256,1119821956066449',NULL,NULL,NULL,NULL,NULL,'1282235343373441',NULL,NULL,NULL,'897747246265054',NULL,NULL,NULL),(124,756247067188042,'The Pocketalker',NULL,624549561849549,'From their website: \"Personal amplifier that amplifies sounds closest to the listener while reducing background noise. Ideal for one-on-one conversation, small group and TV listening, or conversing in the car. This device does not support wireless headphones.\"','1216253083316171','https://www.williamssound.com/pocketalker',NULL,'mikeh@williamssound.com',NULL,'927475609486366',NULL,NULL,NULL,NULL,NULL,'636527751646019',NULL,NULL,NULL,'955971997114080',NULL,NULL,NULL),(125,761065170179610,'Legal Services NYC Access Line',NULL,NULL,'From their website: \"Hotline for general legal info & advice: Legal Services NYC Access Line serves low income residents of NYC and is open Monday through Friday from 10am to 4pm. (Please note that Bronx Legal Services, Brooklyn Legal Services, Manhattan Legal Services, Queens Legal Services and Staten Island Legal Services are programs of Legal Services NYC.) Open Monday through Friday from 10 am to 4 pm. Our neighborhood-based offices and outreach sites across all five boroughs.\" ','1113813987371256','http://www.legalservicesnyc.org/',NULL,NULL,NULL,'632606603203298,785468758686103',NULL,NULL,NULL,NULL,NULL,'823557749703671',NULL,NULL,NULL,'596852445446641',NULL,NULL,NULL),(126,764670078154564,'Search & Care Money Matters Program',NULL,875189273598571,'From their website: \"Assist economically at-risk seniors with the following: Organize documents and bank statements, help with paying bills on time, offer assistance with creating monthly budgeting, identify and eliminate unnecessary expenses, and maximize income, advise about debt control, reduction, and/or consolidation, advocate with creditors, collection agencies, and banks, educate clients about avoiding financial risks, elder exploitation, and much more.\" For case management clients residing in Manhattans Yorkville, Carnegie Hill, and East Harlem communities (catchment area is E. 86th to E.138th Streets, East River to 5th Avenue). ',NULL,'https://www.searchandcare.org/money-matters/',NULL,' SandC@searchandcare.org',NULL,'1080473071775397',NULL,NULL,NULL,NULL,NULL,'933127730613617',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(127,760494792675702,'Wright Center EGL House Call Program',NULL,874300745043714,' The EGL House Call Program at New York Presbyterian Hospital- Weill Cornell Medical Center is comprised of physicians and a geriatric nurse practitioner that provide home-based primary (and occasionally consultative) care for homebound older adults living in Manhattan.  The service areas are primarily from 40th Street to 100th Street on the East and West sides of Manhattan. Provides on-going geriatric care at home (not for emergency situations). Seniors may refer themselves to the program (expect to hear back from a nurse practitioner or doctor in two weeks). Afterwards, an in-home evaluation is scheduled (average wait for visit is 6-8 weeks). Speak with Jasmine Lucena, Administrative Assistant. ','612991570845915','https://geriatrics-palliative.weill.cornell.edu/clinical-care/geriatric-medicine',NULL,'jal9088@med.cornell.edu',NULL,'821933984736558,1060789001254366',NULL,NULL,NULL,NULL,NULL,'683187796323901',NULL,NULL,NULL,'1286244915576853',NULL,NULL,NULL),(128,768475791536235,'Edie Windsor Sage Center',NULL,1202577900100445,'\"Sage Centers offer a number of social activities and programs for LGBT older people. These include cultural programs such as acting, creative writing, and art classes, and programs focused on health and well-being, such as nutrition classes, tai chi, meditation, bilingual discussion groups and more. The following is a select listing of regular programs and services.\"','908721052299840','www.sageusa.org/nyc/centers/midtown.cfm',NULL,NULL,NULL,'1299575089394687,1220426167240011',NULL,NULL,NULL,NULL,NULL,'1115763759666645,835909927735626',NULL,NULL,NULL,'832417426130330',NULL,NULL,NULL),(129,777878575131334,'Center for Hearing & Communication',NULL,NULL,'Offers services in audiology (hearing test, hearing aids, custom ear plugs), speech-language therapy, counseling, and more. While most hearing center services in our NYC office require an appointment, walk-in services are available on a limited basis for CHC clients in need of hearing aid repairs, ear molds and other technology needs that arise on short notice. Call for appointments. Walk-in service is available: Monday 9:00 am-12:30 pm,Tuesday 12:00 pm-4:30 pm, Wednesday 9:00 am-12:30 pm, Thursday 9:00 am-12:00 pm and 2:00 pm-4:30 pm, Friday 12:00 pm-4:30 pm.','1207137421921677','http://chchearing.org/nyc/',NULL,NULL,NULL,'927475609486366',NULL,NULL,NULL,NULL,NULL,'1252560433654868,1065689190498008',NULL,NULL,NULL,'1274441827605514',NULL,NULL,NULL),(130,749277676940883,'Sephardic Bikur Holim','SBH',NULL,'Case management, home delivered meals, onsite programs, Friendly Visiting, volunteer programs.','651750585468528','https://sbhonline.org/',NULL,'contactus@sbhonline.org',NULL,'784392560809728,1299575089394687,830617726149111,969672981978469,1261747089209037',NULL,NULL,NULL,NULL,NULL,'1153510485802142',NULL,NULL,NULL,'973009618604275',NULL,NULL,NULL),(131,756466054258839,'Day for Night: The Evening Meal Program',NULL,955701872476582,'\"For homeless and frail elders, or those who simply may not have access to kitchen facilities, Project FIND provides takeaway meals four days a week at the Coffeehouse Senior Center. From 2:00 to 2:30 p.m. on Mondays, Tuesdays, Wednesdays, and Fridays, Project FIND distributes a takeaway meal in a bag. And on Thursday evenings at 5:00 p.m., seniors can enjoy a hot meal in a communal setting, with social activities such as dancing and bingo. Takeaway dinners are free and there is a small fee for dinner on Thursdays.\"','1187778800902833','http://www.projectfind.org/services_for_the_homeless',NULL,NULL,NULL,'632606603203298',NULL,NULL,NULL,NULL,NULL,'659080347489003',NULL,NULL,NULL,'637888517639066',NULL,NULL,NULL),(132,769806025022527,'Hearing Accommodations at Museums ',NULL,NULL,'List provided by Hearing Loss Association of America-NYC (HLAA-NYC)',NULL,'http://www.hearinglossnyc.org/museums/',NULL,NULL,NULL,'927475609486366',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(133,781367055440863,'IAM International Aphasia Movement',NULL,812920078238946,'From their website: \"IAM assists people with speech and learning problems due to the disability of aphasia caused by a stroke or other brain injury. Groups are held in several locations. Our sessions at Mount Sinai Downtown and The Church of St. Luke in the Fields are conducted by licensed Speech-Language Pathologists. Groups at Hunter College, Teachers College, Columbia University, and Brooklyn College are conducted by Graduate Student Clinicians under the supervision of Senior Supervisors. All programs are free of charge.\"','831478916763568,609837285915880','http://aphasianyc.org/',NULL,'carlotaschoolman@gmail.com',NULL,'1190256961171859',NULL,NULL,NULL,NULL,NULL,'1269360271212634',NULL,NULL,NULL,'1040089308252309,1040089308252309',NULL,NULL,NULL),(134,784061477239139,'NYC Well',NULL,981339163697092,'From their website: \"New York Citys free, confidential support, crisis intervention, and information and referral service for anyone seeking help for mental health and/or substance misuse concerns, available 24 hours a day, 7 days a week, 365 days a year. NYC Well is staffed by trained professionals who can help you find the services that best meet your needs.\"','809957051513971','https://nycwell.cityofnewyork.us/en/',NULL,NULL,NULL,'1000576764179618',NULL,NULL,NULL,NULL,NULL,'790564212894605',NULL,NULL,NULL,'955971997114080',NULL,NULL,NULL),(135,789430554421597,'Frank Gobes, Esq. ',NULL,646831865630406,'Mr. Gobes focuses his practice on Trusts and Estates, including, but not limited to, Surrogates Court litigation such as Will & Trust Contests, Property Turnover Proceedings, Fiduciary Removal Proceedings, Contested Accountings, Spousal Rights Proceedings, Kinship Proceedings and Will or Trust Construction Proceedings.  He is also a Certified Public Accountant and does extensive Estate Planning and Asset Protection Planning, estate tax returns, and lifetime tax planning to minimize estate, gift and income taxes.  Mr. Gobes is also experienced in Elder Law issues, including Medicaid Planning to preserve assets from creditors and obtain eligibility for Medicaid.\n\nPosted 10/19','1230520200734896','https://ddw-law.com/',NULL,'FJG@ddw-law.com ',NULL,'885600197309781',NULL,NULL,NULL,NULL,NULL,'688879724380636',NULL,NULL,NULL,'1180401435417081',NULL,NULL,NULL),(136,821251992076057,'Connect2',NULL,779805618185923,'\"Offers companionship and support to Holocaust survivors living throughout New York City. Men and women volunteer to visit survivors in their homes for one hour each week. Volunteers and survivors are carefully matched to give young people an opportunity to connect with a unique part of our community and build strong and fulfilling friendships. In addition to critical socialization and providing assistance with shopping and personal organizing, the volunteers read to survivors, go with them for walks and accompany them to doctor visits.\"','1204325968125772','http://www.connect2ny.org/',NULL,'connect2@jccgci.org',NULL,'917614737211305,969672981978469',NULL,NULL,NULL,NULL,NULL,'940113092219097',NULL,NULL,NULL,'1265939883950171',NULL,NULL,NULL),(137,816733464389484,'Benefits Outreach Program',NULL,943089562081135,'From their website: Will screen you for eligibility and assist you throughout the entire application process. We can assist you with Supplemental Nutrition Assistance Program (SNAP - the new name for Food Stamps), Medicare Savings Program & Low Income Subsidy, Medicaid, Home Energy Assistance Program (HEAP), and the Senior Citizen Rent Increase Exemption (SCRIE/DRIE).','1256762981767588','https://www.liveon-ny.org/',NULL,NULL,NULL,'775024125555217',NULL,NULL,NULL,NULL,NULL,'882787261915258',NULL,NULL,NULL,'1263202967869983',NULL,NULL,NULL),(138,821364371870454,'Karen Horney Clinic',NULL,NULL,'From their website: \"Offers low-cost, long-term talk therapy (psychoanalytic and psycho-therapeutic services). Patients without insurance pay $75 for the initial Intake appointment and sliding scale for ongoing therapy, accepts Medicare, Medicaid, and other insurances.\"','792766212966007','http://www.karenhorneyclinic.org/',NULL,'TheClinic@karenhorneyclinic.org',NULL,'1000576764179618',NULL,NULL,NULL,NULL,NULL,'793575198331736',NULL,NULL,NULL,'1066734108371157',NULL,NULL,NULL),(139,763195561288221,'Door to Door',NULL,617910248814061,'Travel companions escort seniors to and from medical appointments and go shopping for seniors or with seniors in Manhattan.','872398746454681','www.dorotusa.org',NULL,NULL,NULL,'910515645454451',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1272863013225282','801326186311509',NULL,NULL,NULL),(140,794756455970133,'Jennifer Colby, JD, LCSW, CCM, C-ASWCM',NULL,NULL,'Geriatric Psychotherapy and Care Management. Accepts Medicare Part B. Also performs psychiatric evaluations as private pay consultations. Operates primarily south of 287. \n\nPosted 10/19',NULL,NULL,NULL,'jcolbylcswccm@gmail.com ',NULL,'787866332874000',NULL,NULL,NULL,NULL,NULL,'619221589267332',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(141,810458996121715,'Early Stage Alzheimer\'s Service Program For Adults (SPA)',NULL,1120914840730487,'Creative writing, Tai Chi, art therapy, dance, live music, movies, and field trips.','1058511955425821,1143936190869986','http://steinseniorcenter.org/programs-activities/early-stage-alzheimers/',NULL,NULL,NULL,'943955981947035,642511572093907,1248151266206446',NULL,NULL,NULL,NULL,NULL,'765111106743423',NULL,NULL,NULL,'813070462647210',NULL,NULL,NULL),(142,829454435914342,'Meals on Wheels',NULL,NULL,'Meals on Wheels America is the leadership organization supporting the more than 5,000 community-based programs across the country that are dedicated to addressing senior isolation and hunger.\n\nPosted 10/19',NULL,'https://www.mealsonwheelsamerica.org',NULL,NULL,NULL,'1252623387709832',NULL,NULL,NULL,NULL,NULL,'634042097963939,810366456414473',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(143,833708272440161,'Homeless In-Reach',NULL,955701872476582,'From their website: \"Counseling, Support, and Housing: For homeless elders, Project FIND offers case management and counseling, assistance in obtaining entitlements and benefits, help getting to the doctor and obtaining medications, and more. At our Woodstock Senior Center, seniors can get hot showers and clean clothes. Our social workers try to put homeless seniors on a path toward finding housing. Hours: Tuesday - Saturday 9 am - 5 pm, Sunday 10 am - 2 pm.\"','675922632877409','www.projectfind.org/services_for_the_homeless',NULL,NULL,NULL,'632606603203298',NULL,NULL,NULL,NULL,NULL,'1170363414364281',NULL,NULL,NULL,'857723289913679',NULL,NULL,NULL),(144,766329040815982,'Victims Assistance Services of Westchester',NULL,1114707966679244,'Provides free, comprehensive services to crime victims and their families, friends and loved ones. VAS also works to end violence through community action, public policy and cultural change and through prevention education programs in schools and in other community venues.\n\nPosted 11/19','1287995287654906','disabled.westchestergov.com/victims-assistance-services',NULL,'kamaranth@westcop.org',NULL,'1334445722577337',NULL,NULL,NULL,NULL,NULL,'1298628210772828',NULL,NULL,NULL,'1087856289552940',NULL,NULL,NULL),(145,770852295474048,'Truly Inspired ',NULL,NULL,'Specialized home care for clients with memory impairment (early or late-stage). An initial in-home assessment called \"Strengths and Rhythm Assessment\" is performed for a fee. This home visit allows their staff to learn what each client is interested in engaging with. Staff re-introduce passions that clients used to have and modify them. Helpful for people who are beginning to withdraw, need more stimuli, and want to remain in their home. The home care emphasizes engagement and keeping the client as independent as possible. Minimum of 4 hours per visit, at an hourly rate (no weekly minimum).',NULL,'www.truecareny.com/trulyinspired',NULL,NULL,NULL,'943955981947035,642511572093907,1248151266206446,1324596060194399',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(146,794585631951212,'JCCCGI Case Management',NULL,779805618185923,'JCCGCI offers case management assistance in many languages to seniors, many of whom are Holocaust survivors. Services include short-term case assistance, information and referrals for seniors to help them gain access to needed services, benefits and entitlements they would otherwise be unable to obtain. These include, but are not limited to, Medicaid, Food Stamps, Elderly Pharmaceutical Insurance Coverage Program and Section 8 Housing Assistance. Case managers and case workers communicate in English, Spanish, Russian, Hungarian, Hebrew and Yiddish.\nWe provide case assistance to seniors at our our main office, at our five senior center locations, and at our Urban Neighborhood Services Multi Service Center in Coney Island. Case assistance to Holocaust survivors is offered at our central site and at other partner sites throughout Brooklyn including Shorefront Jewish Community Council (in Brighton Beach), Boro Park Jewish Community Council and Nachas Health and Family Network (serving Borough Park and Flatbush).','869437581538741','https://www.jccgci.org/our-services/senior-support-systems/senior-case-management/',NULL,NULL,NULL,'784392560809728,1261747089209037,917614737211305',NULL,NULL,NULL,NULL,NULL,'634124727626866',NULL,NULL,NULL,'1265939883950171',NULL,NULL,NULL),(147,795976065646204,'Phyllis and Lee Coffey Geriatrics Practice',NULL,653858712031954,'A primary care practice that specializes in treating the health problems of older adults. We also offer activities, classes, and programs designed to help older adults remain energetic. The social workers at The Martha Stewart Center for Living can offer guidance on needed government and insurance supports and services, as well as on managing stress associated with caring for family members. They can also refer to and coordinate additional support and palliative care services, provided through the Lilian and Benjamin Hertzberg Palliative Care Institute.','816439873471849','https://www.mountsinai.org/locations/martha-stewart-center-living',NULL,NULL,NULL,'1060789001254366,804710974459801',NULL,NULL,NULL,NULL,NULL,'1082688720298358',NULL,NULL,NULL,'764219819443912',NULL,NULL,NULL),(148,802543237937238,'New York Legal Assistance Group (NYLAG) Tenants\' Rights Unit (TRU)',NULL,NULL,'Referrals can be made to TRU for someone facing an eviction proceeding in Housing Court if they have a household income under 200% of federal poverty with predicate notice for a case in Housing Court, an existing case in Housing Court, or a NYCHA Termination of Tenancy proceeding at 250 Broadway and live in the following zip codes: Manhattan-10025, 10026, 10027, 10031, Bronx-all zip codes, Brooklyn-11216, 11221, 11225, 11226, Queens-11433, 11434, 11373, 11385. Use the form in the link below.  \n\n','698464460411906','https://nylagtru.wufoo.com/forms/z12fb8nc0ojkbok/',NULL,NULL,NULL,'785468758686103,632606603203298',NULL,NULL,NULL,NULL,NULL,'973262116396783',NULL,NULL,NULL,'1180366400470295',NULL,NULL,NULL),(149,814314701238234,'MET \"Escapes\"',NULL,1275566162794288,'For visitors with dementia and their care partners. Discussions about art, art making, and other interactive and multi-sensory activities in galleries and classrooms; reservations are required. Programs are held 1-2 times a month and are free of charge to the senior and their caregiver. ','1211776986922808','www.metmuseum.org/events/programs/met-tours/met-tours-disabilities/met-escapes ',NULL,'access@metmuseum.org',NULL,'869870722824619,943955981947035,642511572093907,1248151266206446',NULL,NULL,NULL,NULL,NULL,'570954467954091',NULL,NULL,NULL,'1119370970092112',NULL,NULL,NULL),(150,832016928597027,'The Mobile Outreach Service Team','MOST',776754734758664,'From their website: \"In-home counseling, available as part of CAPE\'s services. The interdisciplinary team of social worker, registered nurse and psychiatric nurse practitioner, work to identify homebound elderly, assess and evaluate their psychosocial and health needs, and link the individual and family to the appropriate community programs. Services include ongoing supportive counseling and psychotropic medication monitoring.\"','1286900051399672','http://www.sfy.org/community-mental-health-services/',NULL,'Cape@sfy.org',NULL,'981685343230150,1000576764179618',NULL,NULL,NULL,NULL,NULL,'1010063553152090',NULL,NULL,NULL,'885146589556516',NULL,NULL,NULL),(151,833727414513307,'Manhattan House Calls-Denis Tarrant, NP',NULL,NULL,'Primary care home visits in Manhattan (serving SoHo, lower Manhattan, and the east and west side up to 120th street). If you are unable to leave your home without the help of another individual or assistive device (walker, wheelchair, etc.), or if leaving your home is physically taxing, you are an ideal candidate for this unique home visiting program. Services include: physical examination, prescriptions, in-home radiology (X-ray, sonograms, etc.), laboratory referrals, electrocardiogram (EKG) testing/interpretation, immunization/vaccination, medical equipment ordering, referrals for home health agencies, referrals for other house call specialists (podiatry, gastroenterology, orthopedics, etc.). Traditional Medicare policies will cover 80% of services rendered, and the remaining 20% can be covered by secondary insurance contracts (including Medicaid), personal checks, or money order. Call with any questions regarding payment options or eligibility.','995358483188297','http://www.medhousecalls.com',NULL,'info@medhousecalls.com',NULL,'821933984736558,1060789001254366',NULL,NULL,NULL,NULL,NULL,'584923734313266',NULL,NULL,NULL,'955971997114080',NULL,NULL,NULL),(152,776533076120789,'Sage Center Harlem',NULL,1202577900100445,'From their website: \"Serves LGBT older adults from across the borough and throughout the City with a diverse array of social events and support groups, daily hot nutritional lunches, a cyber center, health and wellness programs, arts and cultural events.\"','594665162219120','https://sagenyc.org/nyc/centers/harlem.cfm',NULL,'scruz@sageusa.org ',NULL,'1220426167240011',NULL,NULL,NULL,NULL,NULL,'589568886905732',NULL,NULL,NULL,'941042918078004',NULL,NULL,NULL),(153,775642325697758,'Addiction Institute',NULL,1296714727444270,'From their website: \"Centers that treat people with addictions to alcohol, substances, and behaviors such as compulsive eating or gambling. Multiple locations in Manhattan, atMount Sinai St. Luke\'s,Mount Sinai West,Mount Sinai Beth Israel, andThe Mount Sinai Hospital. Our wide range of treatments relies on research into emerging therapies. We personalize our treatment plans to meet the individual needs of you or your loved ones.\"','1151559479926531','https://www.mountsinai.org/locations/addiction-institute',NULL,NULL,NULL,'1000576764179618',NULL,NULL,NULL,NULL,NULL,'842323758211755',NULL,NULL,NULL,'903689394971972',NULL,NULL,NULL),(154,782267624918280,'Burke Rehabilitation at United Hebrew of New Rochelle',NULL,1292751234257112,'Burke is a short-term rehabilitation facility. Therapy is available uop to 7 days a week, with physical, speech, and occupational therapy. Custom splints and devices are prepared as needed for patients. Multi-disciplinary treatment teams include an attending physician; licensed, registered nurses; licensed therapists, a dietitian, and social workerall overseen by our board-certified medical director.\n\nPosted 11/19',NULL,'www.uhgc.org',NULL,' mhood@uhgc.org',NULL,'624542557113105',NULL,NULL,NULL,NULL,NULL,'910591738606762',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(155,779339624756606,'Volunteer Income Tax Assistance','VITA',866922804423485,'From their website: \"Offers free tax help to people who generally make $54,000 or less, persons with disabilities, the elderly and limited English speaking taxpayers who need assistance in preparing their own tax returns. IRS-certified volunteers provide free basic income tax return preparation with electronic filing to qualified individuals. No application is needed to use this service. For information on volunteering or for the locations of the tax assistance sites, visit the Free Tax Return Preparation for Qualifying Taxpayers page or call. To locate the nearest VITA or TCE site near you, use the VITA Locator Tool or call 800-906-9887.\"','871621197584579','https://www.irs.gov/individuals/free-tax-return-preparation-for-you-by-volunteers',NULL,NULL,NULL,'905605959147804',NULL,NULL,NULL,NULL,NULL,'923627599145439',NULL,NULL,NULL,'955971997114080',NULL,NULL,NULL),(156,788811858745327,'Goddard Riverside Law Project',NULL,923109536688861,'From their website: \"Free legal representation in nonpayment, holdover and Housing Part proceedings in the New York City Housing Court for: SRO tenants living on the west side of Manhattan, from 14th Street north; and apartment tenants living in the area from 100th to 116th Streets, from 5th Avenue to Riverside Drive. Tenant organizing and legal advocacy for individuals and groups of tenants concerning their rights developing tenant leadership and providing support to individuals and groups of tenants, including tenant associations, advocating before elected officials, administrative agencies and legislative bodies helping tenants identify and obtain housing-related benefits conducting know-your-right trainings, workshops and legal clinics for tenants in the community, screening tenants for consumer debtrelated issues and providing referrals as needed. Walk-in hours: Thursdays, 4-6 pm.','1272415379532080','https://www.goddard.org/grcc/programs/goddardlawproject/',NULL,NULL,NULL,'669623054114376,785468758686103',NULL,NULL,NULL,NULL,NULL,'607491503549312',NULL,NULL,NULL,'735399226687979',NULL,NULL,NULL),(157,800282930025758,'Westchester County Office for Women Helpline',NULL,1114707966679244,'Posted 11/19','1189230999153059','women.westchestergov.com/contact-us',NULL,NULL,NULL,'1334445722577337',NULL,NULL,NULL,NULL,NULL,'1081157382197934',NULL,NULL,NULL,'792649016550767',NULL,NULL,NULL),(158,800813664639683,'Homebound Program-Visiting Eye Doctors',NULL,663407514167044,'To refer a senior, call or send a fax to (212) 938-4037, Attention: \"Homebound\" with seniors\' contact information and note if the senior is making the appointment or if a home care aide, family member, or friend will be making it on their behalf. The doctor associated with the seniors borough will contact them directly to discuss scheduling and insurance. Serves Manhattan (Dr. Brian Wolynski), Queens (Dr. Sander Levine), and the Bronx (Dr. Merola). As of July 2019, there is approximately a one month wait list. \n\n','1213309130919325','www.sunyopt.edu/',NULL,NULL,NULL,'821933984736558,821861174676380,1201543088551419,1060789001254366,804710974459801',NULL,NULL,NULL,NULL,NULL,'652216213050197',NULL,NULL,NULL,'1089194803070930',NULL,NULL,NULL),(159,807781285922296,'SPOP-Bereavement Support','Service Program for Older People',NULL,'From their website: \"All services are free and require advance registration; specialized groups for adults of all ages, in either spousal/partner loss or non-spousal loss.  The groups are led by peer volunteers and are supervised by a clinical social worker.  All participants receive an initial interview.\"','686559333444510,1182178575582068','www.spop.org/services/bereavement-support',NULL,NULL,NULL,'1000576764179618,1200594795378183',NULL,NULL,NULL,NULL,NULL,'1210336578480685',NULL,NULL,NULL,'1243005692710265,739310310737872',NULL,NULL,NULL),(160,818597024974992,'Bill Payer Program',NULL,864711120858468,'From their website: Participants must be 60 or older, receive $60,000 or less in annual income, have a DFTA-affiliated case manager, and have a bank account with sufficient funds to cover their bills. A Bill Payer representative will visit eligible older adults, organize their bills, create a budget, and enroll them in the program, which can be tailored to personal preferences. SilverBills is now a partner of the Bill Payer program, which helps more New Yorkers pay their bills on time without writing and mailing checks, helping avoid the termination of utilities and other disruptions. ','1220414976459611','https://www1.nyc.gov/site/dfta/services/bill-payer-program.page',NULL,NULL,NULL,'1012417089448021,1080473071775397',NULL,NULL,NULL,NULL,NULL,'578208419719036',NULL,NULL,NULL,'955971997114080',NULL,NULL,NULL),(161,826218319073935,'Robbin E. Sweeney, Esq. ',NULL,665796454278494,'Posted 10/19','601838143260855',NULL,NULL,'Robbin@RoseMarkLaw.com',NULL,'885600197309781',NULL,NULL,NULL,NULL,NULL,'799437366222939',NULL,NULL,NULL,'1273336219947260',NULL,NULL,NULL),(162,831874032989869,'New Lifestyles Area Guide to Senior Residences and Care Options',NULL,NULL,'An online and print resource for information about independent living facilities in New York City.','852109915963296','https://www.newlifestyles.com/senior-living-and-care-options/independent-living/new-york-city-ny',NULL,NULL,NULL,'1149247622463332,1157747719793788',NULL,NULL,NULL,NULL,NULL,'877585854903181',NULL,NULL,NULL,'955971997114080',NULL,NULL,NULL),(163,836152397915732,'Days of Awe Cemetery Visits',NULL,724662437776878,'JCC is partnered with Plaza Jewish Community Chapel for the cemetery visit programs. The registration lottery for the Days of Awe Cemetery Visits will be open from July 10-12, 2019 to the Bronx, Long Island, and Queens. 2019\'s visits will take place on Tuesday, September 17 (Cedar Park and Riverside cemeteries) and Wednesday, September 18 (Wellwood, Beth Moses, New Montefiore, Mt. Ararat, Beth David, Mt. Hebron, Mt. Carmel, and Old Montefiore cemeteries). There is no charge to join the lottery. Limited spots available, cannot guarantee seats for each person who enters the lottery. Those selected to participate will be notified the week of July 15. After the lottery, there will be a fee of $10/person to register for the trip itself. Please note that participants must choose one day and one cemetery to visit. A representative from the JCC or from Plaza Jewish Community Chapel will reach out to each participant to assist in locating their loved ones\' plots. This program will occur rain or shine. A light breakfast will be served at Plaza Jewish Community Chapel (630 Amsterdam Ave.) at 9:30 am before transportation departs at 10 am. Seniors can come with walkers, if they have a wheelchair, they must be able to transfer on their own and fold it up on their own. Rachel Kunstadt, 646-505-4441.  ','1312695594585888','www.jccmanhattan.org',NULL,'info@jccmanhattan.org',NULL,'811793752303717',NULL,NULL,NULL,NULL,NULL,'1080338271859498',NULL,NULL,NULL,'809698659267160',NULL,NULL,NULL),(164,844405703995740,'City Harvest Mobile Food Pantries',NULL,NULL,'Available in 5 boroughs of NYC. Through our Mobile Markets, City Harvest delivers fresh fruits and vegetables, free of charge, to thousands of New Yorkers each month.\nCommunity members gather in farmers market settings, where they receive fresh produce and participate in cooking demonstrations to learn how to make healthy meals. Our community health partners also offer free wellness programs, such as blood pressure screenings. We also partner with other non-profit organizations, including Brighter Bites, Harlem Childrens Zone, and the YWCA in Queens to create bi-monthly food distributions at sites that are fully operated by members of the community they serve. See website for specific times and locations. ','1144855430685302','https://www.cityharvest.org/programs/mobile-markets/',NULL,NULL,NULL,'634570173416697,981685343230150,1261747089209037,1113477575023431',NULL,NULL,NULL,NULL,NULL,'1168965348029088',NULL,NULL,NULL,'771969867372890',NULL,NULL,NULL),(165,848009902936406,'Touching Hearts at Home',NULL,NULL,'From their website: \"We provide non-medical home care services for older adults, seniors, and people with medical conditions and/or disabilities.\" ','734935691540835','https://www.touchinghearts.com/nyc/',NULL,NULL,NULL,'1324596060194399',NULL,NULL,NULL,NULL,NULL,'644892434441299',NULL,NULL,NULL,'890365070778148',NULL,NULL,NULL),(166,805296494431920,'Folk Art Reflections',NULL,921782132780488,'This interactive and discussion-based program for individuals with Alzheimers and their family members or care partners brings the world of folk art to life through conversation. Museum admission and program are free. Registration is required. Stools are provided. First Thursday of every month, for two hours in the afternoon (call or check website for exact time and to confirm schedule).','821866257930703','https://folkartmuseum.org/visit/community-access/',NULL,'info@folkartmuseum.org',NULL,'869870722824619,642511572093907,1248151266206446,943955981947035',NULL,NULL,NULL,NULL,NULL,'1293959755724313',NULL,NULL,'725810338181239','648957681065521',NULL,NULL,NULL),(167,813571933574740,'Fairway Market',NULL,NULL,'\"The delivery fee depends on the size of your order and the delivery time that you choose. The fee for each delivery will be displayed when selecting a delivery window during checkout, before you place your order. All orders must be $10 or more. With Instacart Express, you will have no delivery fee on all orders over $35.  Service fees may still apply. Busy Pricing-When we experience high demand for a delivery time, a Busy Pricing delivery fee may apply. Order online.\"','899071973154010','https://shop.fairwaymarket.com/',NULL,NULL,NULL,'1235894498248246',NULL,NULL,NULL,NULL,NULL,'1143588266707680',NULL,NULL,NULL,'799244999157208',NULL,NULL,NULL),(168,814910120354434,'Crisis Prevention and Response Team',NULL,952675500351470,'Serves Westchester County residents of all ages who are having, or at risk of, mental health problems. The CPRT is an interdisciplinary mobile team of mental health professionals (social workers, a child and family specialist and a psychiatrist). The Team responds to people in the community, usually visiting them at home, although they can be seen elsewhere as well. The team also has offices at Saint Josephs Medical Center in Yonkers and at St. Vincents Hospital in Harrison. 24/7 phone coverage. \n\nPosted 11/19','1275169097954443','www.stvincentswestchester.org/outpatient-programs/crisis-prevention-and-response-team',NULL,NULL,NULL,'871376605323560',NULL,NULL,NULL,NULL,NULL,'779219898945022',NULL,NULL,NULL,'1301817408777665',NULL,NULL,NULL),(169,818978369006787,'House Call Dentists',NULL,NULL,'In-home dental services for traditional dental procedures and dental emergencies. From their website: \"A typical rate for a new patient visit is $495.00 (excluding travel fee).  This cost includes digital x-rays, intraoral photographs, comprehensive examination, oral cancer screening and Oral Health Assessment. Our team will submit a claim to your dental insurance and you will receive reimbursement directly from insurance, depending on your allowable coverage. Reimbursement can take up to 4 weeks.\" Serves the 5 boroughs, Westchester, and Long Island.','795409117118026','https://housecalldentists.com/',NULL,'info@housecalldentists.com',NULL,'821933984736558,1060789001254366,930870677737263',NULL,NULL,NULL,NULL,NULL,'791812099850523',NULL,NULL,NULL,'656996929758680',NULL,NULL,NULL),(170,822669918947087,'Legal Services of Hudson Valley Elder Law',NULL,NULL,'Attorneys assist low-to-moderate income seniors with limited resources who are age 60 and older with housing preservation/advocacy, government benefits, advance directives, elder abuse, consumer rights, and family law.\n\nPosted 11/19',NULL,'www.lshv.org',NULL,'info@lshv.org',NULL,'1334445722577337,885600197309781',NULL,NULL,NULL,NULL,NULL,'1121289716707263',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(171,828222998498950,'SNAP Transportation','Services Now for Adult Persons',645730693279777,'From their website: \"8:00 AM to 4:00 PM for travel to: Medical appointments, food shopping, SNAP of Eastern Queens Innovative Senior Center, community services, cultural trips. SNAP will have an escort available to accompany you on your van trips to medical appointments or wherever independent travel is difficult for you. If you need assistance because of limitations of vision, difficulty walking unassisted, or other concerns, please speak with Marci to arrange for an escort when you use the SNAP van. Please call  to discuss and schedule your requests today.\"','1239316263027446','https://snapqueens.org/servicesprograms/transportation',NULL,NULL,NULL,'981685343230150,1048629387183766',NULL,NULL,NULL,NULL,NULL,'1115977126881176',NULL,NULL,NULL,'1324143794665987',NULL,NULL,NULL),(172,851324842437370,'The Center for Learning and Living',NULL,858525228630280,'From their website: \"Non-profit lifelong learning organization offering weekday daytime classes on a wide range of subjects. Since itsfounding at Marymount Manhattan College in 1994, students have enjoyed intellectual stimulation in a lively, informal atmosphere. Allteachers are volunteers: retired academics,experts in the business world, the arts and other fields. Classes are year-round  8 weeks in the fall, winter and spring, and 4 weeks in the summer.\"','981831536235200','http://www.clandl.org/',NULL,'form@clandl.org',NULL,'1119821956066449',NULL,NULL,NULL,NULL,NULL,'919197563606308',NULL,NULL,NULL,'622167940280483',NULL,NULL,NULL),(173,846787360945082,'Lenox Hill Neighborhood House Legal Hotline',NULL,798994226105048,'Intake hotline for assistance with the following: \n\nFind out if you are eligible for DRIE and get help applying or recertifying, find out if you are eligible for SNAP benefits and get help applying, assistance with health care access such as Medicaid (including Home Care and Medicaid spend-down), Medicare, EPIC and, insurance information and enrollment through the NY State of Health Marketplace, and End-of-Life Planning/Advance Directives (counseling and individualized drafting of Health Care Proxies, Living Wills, Powers of Attorney, and simple Wills).\nAll cases will be screened through an intake process and will be accepted on an individual case-by-case basis.  If they cannot assist you directly, they will do their best to make an appropriate referral. ','1267609685792488','http://www.lenoxhill.org/legaladvocacy/',NULL,NULL,NULL,'669623054114376,785468758686103',NULL,NULL,NULL,NULL,NULL,'773442820298867',NULL,NULL,NULL,'870634650166451',NULL,NULL,NULL),(174,849677296161738,'SAGE-Pride Center of Staten Island',NULL,1202577900100445,'From their website: \"Offers LGBT older adults a place to gather, socialize, learn, and connect with community members from Staten Island and across the City. Its location in the Center provides great opportunities for inter-generational programs and celebrations, including picnics at the beach, Staten Island PrideFest and monthly art shows and exhibits.\"','1162363007529652','https://sagenyc.org/nyc/centers/statenisland.cfm',NULL,NULL,NULL,'1220426167240011',NULL,NULL,NULL,NULL,NULL,'730769750668575',NULL,NULL,NULL,'782678684051099',NULL,NULL,NULL),(175,858534666460865,'BronxWorks-Living Room Drop-in & Safe Havens Shelters',NULL,850652418731445,'The Living Room is the only 24-hour drop-in center in the Bronx for street homeless adults. Clients are welcome to spend time off the street, use the laundry and showers, eat a hot meal, and get other essential help. Safe Havens are temporary shelters for homeless adults.\nThe Barretto Street Safe Haven (in the same building as the Living Room) has 50 beds for homeless adults. The Pyramid Safe Haven has 125 beds for single adult males. The Living Room and Safe Havens offer: housing placement and benefits assistance, medical and psychiatric care, nutritional assistance, medication monitoring, substance abuse counseling, and drug and alcohol treatment referrals. For more information, please contact Noel Concepcion, Director.','1340761742480108,1158380146793847','http://www.bronxworks.org/living-room-safe-havens',NULL,'nconcepcion@bronxworks.org',NULL,'632606603203298',NULL,NULL,NULL,NULL,NULL,'668797232370572',NULL,NULL,NULL,'638499661887758',NULL,NULL,NULL),(176,828175339740471,'Learning in Retirement at Iona College','LIRIC',1180639057899319,'From Website: Serves the intellectual and social needs of a community of lifelong learners. One fee entitles members to attend all courses, with the exception of Tai Chi. Courses are taught by our own members and by experts from the larger community. Each sessions offerings cover a broad range of academic and cultural topics as well as the occasional practical (legal, medical or financial) matter. \n\nPosted 11/19','1234704131763768','www.iona.edu/liric',NULL,'spage@iona.edu',NULL,'691234617893799',NULL,NULL,'$175/year',NULL,NULL,'1127142123974030',NULL,NULL,NULL,'1176478764744540',NULL,NULL,NULL),(177,833727885336698,'Lang Hand Therapy',NULL,NULL,'From their website: \"Certified hand therapists, treat Repetitive Strain Injury, Upper Extremity Trauma, post-surgery, and naturally occurring conditions. Accepts most insurance plans as well as Workers Compensation, No Fault and participates in Medicare.\"','1295208390762416','http://www.annlangassociates.com/',NULL,NULL,NULL,'1060789001254366,804710974459801',NULL,NULL,NULL,NULL,NULL,'565565747582650',NULL,NULL,NULL,'820587146869371',NULL,NULL,NULL),(178,855881833579163,'Senior Health House Call Program',NULL,1223129242355426,'From their website: \"Provides an in-home comprehensive management, interdisciplinary team approach and individualized care to the citizens of lower and midtown Manhattan with chronic illnesses and disabilities that are unable to leave their homes. Comprehensive geriatrics care by a geriatrician or specially trained nurse practitioner (NP). Social workers help seniors find the right home care service, and also offer emotional support to them and their caregivers. Arrange for in-home lab and X-ray services if needed. Coordinate care with other specialists and community-based agencies. Help senior manage chronic illness, so seniors can remain in their own home. Also collaborate closely with hospital staff if hospitalized.\" For seniors 65+ who are homebound and live in lower and midtown Manhattan. Call for availability.','603106980746590','www.mountsinai.org/care/primary-care/upper-east-side/visiting-doctors/about',NULL,NULL,NULL,'821933984736558,1201543088551419',NULL,NULL,NULL,NULL,NULL,'671864331328810',NULL,NULL,NULL,'832844799388495',NULL,NULL,NULL),(179,853792809831330,'Willow Towers',NULL,1292751234257112,'Licensed not-for-profit assisted living with a separate Memory Support Program. Qualifies for long-term care insurance reimbursement. \n\nPosted 11/19','1096776868392058','willowtowers.com/',NULL,NULL,NULL,'853236516099165,1157747719793788',NULL,NULL,NULL,NULL,NULL,'753390261586646',NULL,NULL,NULL,'1261921802141482',NULL,NULL,NULL),(180,859261006217011,'Andrus on Hudson',NULL,NULL,'Andrus on Hudson provides rehabilitative services, long-term nursing care, memory care, and hospice and palliative care. Staff includes physical, occupational, and speech therapists as well as physician and nurse practitioner coverage seven days per week. Care team meetings are used for collaboration between medical specialists and families.\n\nPosted 11/19','1170860144791913','andrusonhudson.org',NULL,'info@andrusonhudson.org',NULL,'892286200872415,1057136254371539,853236516099165,624542557113105,1225698418863757',NULL,NULL,NULL,NULL,NULL,'985336284577506',NULL,NULL,NULL,'893995760956054',NULL,NULL,NULL),(181,807256162893695,'Family Services of Westchester',NULL,NULL,' FSW offers a comprehensive Home Health Care service that can provide licensed, professional home health aides and personal care aides to help you care for your loved one right at home.\n\nPosted 10/19',NULL,'http://www.fsw.org/our-programs/older-adults/home-health-care',NULL,NULL,NULL,'1209400832429047',NULL,NULL,NULL,NULL,NULL,'1232685467096181',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(182,813642754389966,'Elder Abuse Hotline',NULL,1109860255348000,'\"In an emergency, call 911; if you are a senior who has been the victim of a crime, or you know a senior citizen who has been abused or exploited, please call our Elder Abuse Unit; we can also provide assistance in obtaining an Order of Protection and emergency housing, and social service referrals to agencies that provide a variety of services to seniors.\" ','1176851912000413','https://www.manhattanda.org/victim-resources/elder-abuse/',NULL,NULL,NULL,'617361975501329',NULL,NULL,NULL,NULL,NULL,'1166163874621165',NULL,NULL,NULL,'977604944365977',NULL,NULL,NULL),(183,809594915267226,'Sparkle and Shine Up Your Life-Support Group',NULL,1120414012913334,'Home organizing solutions support group for seniors held at JASA\'s Club 76. Thursdays, 11:00 am to 12:00 pm. $1.00 fee and application for first time attending. Group lead by Kathleen Fiorito.','800115976710076','https://www.jasa.org/Default.aspx?PageID=15526392&A=SearchResult&SearchID=8538153&ObjectID=15526392&ObjectType=1#senior-centers-manhattan',NULL,'help@jasa.org',NULL,'975020390374256,656941113483002',NULL,NULL,NULL,NULL,NULL,'600653563177346',NULL,NULL,NULL,'653767757476457',NULL,NULL,NULL),(184,830884025300190,'305 West End Independent & Assisted Living',NULL,NULL,'Luxury senior living facility with amenities including: housekeeping, weekly linens and laundry, town car service and motor coach transportation to and from outside activities, country club dining room, bistro grill and juice bar (three meals served per day), fitness center, exercise classes, wellness programs, educational and social activities, outdoor terrace, on-site cinema, and a salon. They also have a specialized memory care unit on two private floors, fully dedicated to residents living with Alzheimers disease and other memory-related cognitive disorders. The Reflections Memory Care area is staffed with a team of experienced professionals who are trained in proven therapies, strategies and modalities for enhancing the quality of life for these special-needs residents and their families.','792647573931865','https://305westendassistedliving.com',NULL,NULL,NULL,'642511572093907,1248151266206446,943955981947035,1149247622463332,1157747719793788',NULL,NULL,NULL,NULL,NULL,'970331199447719',NULL,NULL,NULL,'1150624172907663',NULL,NULL,NULL),(185,855849468189520,'The ElderServe Mid-Westchester Caregiver Resource Center',NULL,935863789676572,'The ElderServe Mid-Westchester Caregiver Resource Center is a one-stop center and clearinghouse for information and assistance to family and other primary caregivers of older adults and cognitively imapired adults. \nPosted 10/19','634201937942078','www.hebrewhome.org',NULL,NULL,NULL,'1160439364324685',NULL,NULL,'Voluntary Contributions Accepted',NULL,NULL,'1138498950663098',NULL,NULL,NULL,'591809196286438',NULL,NULL,NULL),(186,856540091057743,'HCC Legal Clinic for Legal Representation',NULL,983279313641184,'From their website: \"Free legal services to eligible low- and moderate-income tenants, tenant associations, HDFC shareholders and other community organizations located in the Hells Kitchen/Clinton and Upper West Side neighborhoods (34th to 100th Street, west of 5th Avenue to the Hudson River) who meet our meet our income eligibility requirements. HCC provides legal services in the following matters: Housing, Domestic Violence, Public Benefits issues, Immigration issues, Consumer Law, Elder law, End of life directive.\" Monday: 4:00 pm - 6:30 pm, Thursday: 10:00 am - 12:30 pm. Call to confirm hours and days. If outside of catchment area, see HCC Legal Consultation Services.','769619830768525','http://hcc-nyc.org/',NULL,'info@hcc-ny.org',NULL,'785468758686103,632606603203298',NULL,NULL,NULL,NULL,NULL,'1177385215314132',NULL,NULL,NULL,'769461493908132',NULL,NULL,NULL),(187,861551426759241,'Alzheimer\'s Foundation of America Helpline',NULL,1288044313088279,'Helpline staffed by licensed social workers trained in dementia care; open 9:00 am to 9:00 pm ET Monday-Friday, and 9:00 am to 3:00 pm ET on Saturday and Sunday.','1149107541488250','https://alzfdn.org/caregiving-resources/',NULL,NULL,NULL,'877451051471319',NULL,NULL,NULL,NULL,NULL,'848577785284000',NULL,NULL,NULL,'1218004392452674',NULL,NULL,NULL),(188,868014343262210,'Adriane Geiger',NULL,916395530061266,'From Website: A Dignified Life develops and navigates care plans with elders and family members. We assess safety, living conditions/situation, cultural influences, and family dynamics to identify\na comprehensive care plan that addresses specific needs. We do not give lists, but vet, reference and locate specific services based on health, medical, financial, legal and psychosocial status, initially and on an ongoing basis. \n\nPosted 10/19',NULL,'www.adignifiedlife.com',NULL,'ag@adignifiedlife.com',NULL,'1209400832429047,1144317597848541',NULL,NULL,NULL,NULL,NULL,'1179817197676985',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(189,867179253373388,'Broadway Chemists',NULL,NULL,'Free delivery, has prescription services, hygiene products, and cosmetics; Monday-Friday: 9 am - 7 pm, Saturday: 10 am -5 pm, Sunday: closed.','731347581640527','http://broadwaychemists.com/home/383515',NULL,'bchemists@gmail.com',NULL,'1082992753996569',NULL,NULL,NULL,NULL,NULL,'1278901027631528',NULL,NULL,NULL,'1123120065134683',NULL,NULL,NULL),(190,865954914172697,'Hudson Guild Friendly Visiting',NULL,1233682522628423,'From their website: \"Serving those who live, work, or go to school in Chelsea, with a focus on those in need, adult services for older adults age 55+,  staff speaks many languages including Spanish, Cantonese and Mandarin in addition to English. Must be a member of Penn South or live at the Hudson Guild NORC, Elliott-Chelsea Houses. Call for intake over the phone or in person.\"','859141805722434','https://hudsonguild.org/programs/adult-services/',NULL,NULL,NULL,'969672981978469',NULL,NULL,NULL,NULL,NULL,'899500549900682',NULL,NULL,NULL,'942751698425590',NULL,NULL,NULL),(191,870520437466443,'Leonard Covello Senior Program',NULL,940635116893810,'Offers social, recreational and educational activities for any individual over the age of 60. Art workshops, health workshops and a caregiver resource program.','1304705637644101','http://www.carterburdennetwork.org/covello',NULL,NULL,NULL,'1299575089394687',NULL,NULL,NULL,NULL,NULL,'1218080962607558',NULL,NULL,NULL,'1136857024778610',NULL,NULL,NULL),(192,818205341298030,'Search & Care Case Management',NULL,875189273598571,'Serves seniors residing in Manhattans Yorkville, Carnegie Hill, and East Harlem communities (catchment area is E. 86th to E.138th Streets, East River to 5th Avenue). Services: case managers make home visits, providing information and counseling, evaluating needs and making referrals.  ','604286463973708','https://www.searchandcare.org/',NULL,'SandC@searchandcare.org',NULL,'784392560809728',NULL,NULL,NULL,NULL,NULL,'933127730613617',NULL,NULL,NULL,'1129861482680271',NULL,NULL,NULL),(193,831883454476843,'JM Journeys at The Jewish Museum ',NULL,NULL,'Visitors with early-stage dementia and their care partners are invited to explore exhibits through a gallery tour and art workshop. All Access Programs are free of charge and require advance reservation. Call to check schedule and current exhibition. ',NULL,'https://thejewishmuseum.org/programs/visitors-with-disabilities#memory-loss',NULL,'access@thejm.org',NULL,'869870722824619,943955981947035,1248151266206446,642511572093907',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(194,841770812775273,'Cemetery Visit Program-DOROT',NULL,617910248814061,'This program makes it possible for seniors to visit the gravesites of loved ones in cemeteries in the New York Metropolitan area. Volunteer escorts accompany seniors from their home via transportation provided by DOROT, offering emotional support and an arm to lean on. Cemetery Visits takes place in July.','872398746454681','www.dorotusa.org',NULL,NULL,NULL,'811793752303717',NULL,NULL,NULL,NULL,NULL,'637042726567005',NULL,NULL,'1272863013225282','801326186311509',NULL,NULL,NULL),(195,848330157196899,'Social Call Telephone Visits',NULL,828585188982858,'Sister program of Well Connected, has volunteers who will call you for a weekly phone visit. For seniors who are 60 and up.\nFrom their website: Covia matches volunteers with seniors on a one-to-one basis, bringing compassionate conversation and care into their lives and giving volunteers an opportunity to listen and learn. We are always looking for friendly, caring volunteers to provide support and friendship. All volunteers must pass a background check and attend an initial two-hour training program. ','1125554127221753,614547283019295','https://covia.org/services/social-call/',NULL,'coviaconnections@covia.org ',NULL,'969672981978469,975020390374256,1063168571768300',NULL,NULL,NULL,NULL,NULL,'915897563436802',NULL,NULL,NULL,'937132598457152',NULL,NULL,NULL),(196,852591308861622,'SPOP-Service Program for Older People','SPOP',NULL,'Accepting referrals for appointments; mental health service for adults age 55 and older, including psychiatric assessments, psychotherapy, and medication management. Onsite counseling at their outpatient clinic and satellite clinics. In-home counseling available for Manhattan residents. Accepts Medicare, Medicaid, private supplemental insurance, and participates in many insurance networks. AS OF 10/28/19: There is a wait list as they aren\'t taking new referrals. Check back in December 2019. ','686559333444510,1182178575582068','www.spop.org',NULL,NULL,NULL,'1000576764179618,877451051471319',NULL,NULL,NULL,NULL,NULL,'942456039150589',NULL,NULL,NULL,'1243005692710265,739310310737872',NULL,NULL,NULL),(197,856116942665091,'New York Public Library Tax Preparation ',NULL,NULL,'Walk-in free tax preparation help (call for days/times).',NULL,'https://www.nypl.org/help/community-outreach/income-tax-information',NULL,NULL,NULL,'905605959147804',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(198,869977772572425,'Elder Abuse Prevention Program','EAPP',1137676839800411,'This program works with adults age 60 and older who are abused or at risk of abuse. The program provides information and referrals regarding home care, medical, financial, legal, housing counseling, advocacy, safety planning, and family interventions. \n\nPosted 11/19',NULL,'www.fsw.org/our-programs/older-adults/elder-abuse-prevention-program',NULL,'KTavzel@fsw.org',NULL,'1334445722577337',NULL,NULL,NULL,NULL,NULL,'1227937685929228',NULL,'640994728413440',NULL,NULL,NULL,NULL,NULL),(199,879052282924602,'EAC Network',NULL,NULL,'Expanded In-home Services for the Elderly Program (EISEP) serving seniors on Long Island. Home delivered meals for Nassau county residents.','1052374636658866','https://eac-network.org/',NULL,NULL,NULL,'594263482089475,830617726149111,775024125555217,784392560809728',NULL,NULL,NULL,NULL,NULL,'616838803447106',NULL,NULL,NULL,'764317711663479',NULL,NULL,NULL),(200,875704457864885,'Anne B. Pagano, LCSW, ACSW, BCD, C-ASWCM',NULL,835038758009538,'Aging in Place initial evaluation and identification of care needs and optimum home care hours.  Assessment of eligibility factors for independent, assisted living or nursing home admission.  Options and eligible entitlements are reviewed to promote consumer education and choice. Connection with medical, legal, home care, community, and other services, as needed. \n \nInformation regarding the Consumer Directed Personal Attendant Program option under Medicaid.  this program gives clients the option of hiring and overseeing their own aides instead of working with a licensed homecare agency (within program guidelines and regulations).\n \nEducation and review of the nursing home application process, including how to evaluate nursing homes based on Department of Health surveys, walk through tours; Adjustment support related to relocation.\n \nAssistance in identifying skilled nursing facilities that can best meet client and family needs, including faith based and cultural preferences.\n \nAssistance in identifying additional community resources.\n \nBenefit entitlement assessments.\n \nCollaboration with medical providers, family members, guardians, elder law attorneys, Medicaid caseworkers, and the Managed Long Term Care Homecare organizations.\n \nCompletion and submission of the Medicaid homecare paperwork.\n \nAdvocacy services during the Medicaid pending process, including availability to be present during the home visit assessment by the Intake Assessment nurse through the Managed Long Term Care Organization. \n   \nAssistance with disability certification through the Social Security Administration when a community needs pooled trust is being implemented.\n\nPosted 10/19','1106732953211611','www.paganoseniorcare.com',NULL,'abpagano@yahoo.com',NULL,'1144317597848541',NULL,NULL,NULL,NULL,NULL,'766353792830812',NULL,NULL,NULL,'1119674791786092',NULL,NULL,NULL),(201,881897740733384,'ArtsWestchester',NULL,NULL,'ArtsWestchester supports creative arts in the Westchester community via grants, directories that describe and promote local events and artistic resources, partnerships within the local community, art exhibitions and performances, and transportation to events.\nPosted 12/19','1174244436297654','https://artswestchester.org/',NULL,NULL,NULL,'955546027693268,691234617893799',NULL,NULL,NULL,NULL,NULL,'1148397911105880',NULL,NULL,NULL,'942572808453646',NULL,NULL,NULL),(202,882346709521737,'Hamilton Senior Center',NULL,955701872476582,'Serves lunch and dinner, events, and activities, Monday though Friday, 9:00 am to 7:00 pm. Sunday, 9:00 am to 4:00 pm.','844869320287985','http://www.projectfind.org/hamilton_center',NULL,NULL,NULL,'1299575089394687',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1017082442313506',NULL,NULL,NULL),(203,855181083326261,'Riverwalk Jenny and John Paulson Residences',NULL,1098856670939907,'From their website: \"Independent living facility that offers luxury, residential-style living with concierge services, cultural activities, meals, laundry, and housekeeping services. Residents can attend college lectures, enjoy live entertainment, exercise in state-of-the-art fitness center, participate in yoga, tai chi, and so much more. 146 full apartments (kitchenette, living room, bedroom, bathroom). Housekeeping staff, maintenance, activities available. Two glatt kosher, restaurant-style meals (breakfast and dinner). Shuttle to town. Trips to Manhattan (museums, etc.).\" ','1056584562594595','https://www.riverspringhealth.org/independent-living/',NULL,NULL,NULL,'1149247622463332,1157747719793788',NULL,NULL,NULL,NULL,NULL,'973161705216288',NULL,NULL,NULL,'1012648205679109',NULL,NULL,NULL),(204,857712296030293,'Mott Street Senior Center',NULL,929828904477796,'Serves meals and provides recreational activities.','1287623235982960','http://www.nyfsc.org/support-services/senior-centers/',NULL,NULL,NULL,'1299575089394687',NULL,NULL,NULL,NULL,NULL,'614687616236690',NULL,NULL,NULL,'1116536142852359',NULL,NULL,NULL),(205,865486474700577,'Caregiver Resource Center',NULL,864711120858468,'From their website: \"Staffed with specialists in dementia and long-term care issues. The Center offers free counseling, referrals, and can connect you with support groups.\"','600230560300467','https://www1.nyc.gov/site/dfta/caregivers/caring-for-adults.page',NULL,NULL,NULL,'877451051471319',NULL,NULL,NULL,NULL,NULL,'954275487484485,578208419719036',NULL,NULL,NULL,'955971997114080',NULL,NULL,NULL),(206,866884149771351,'Hospice Program of Calvary Hospital',NULL,1284114710934347,'Hospice Services are: Nursing care; as needed to maintain the patient at home, 24 hours a day, 7 days a week on-call nurse, Physician services, Medical social services, Pastoral care, Counseling services, Nutritional counseling , Short-term inpatient and respite care, Medical supplies and equipment related to the terminal illness, Personal care provided by Certified Home Health Aides, Therapies (e.g., physical, occupational and speech), Medications for symptom management and pain control related to the terminal illness, Bereavement counseling for family members and significant others, Volunteer services\nCalvary@Home partners with patients families to promote the quality of life, address pain management and other symptoms, and help prepare both the patient and their loved ones for what to expect in the final days of life. \nHow to Make a Referral:\nAnyone can make a referral to Calvary Hospital Hospice. After a referral is made to Calvary Hospital Hospice, the nurse contacts the patient and/or family to schedule a time to meet. The ultimate decision regarding the acceptance of hospice care is made by the patient and family/caregiver.','1160596143883349','https://www.calvaryhospital.org/calvary-care/hospice-care/',NULL,NULL,NULL,'1212182778974229',NULL,NULL,NULL,NULL,NULL,'1242448392717275',NULL,NULL,NULL,'1160936336950978',NULL,NULL,NULL),(207,868979199647621,'Geriatric House Call Dentistry',NULL,NULL,'Dr. Alisa Kauffman and staff visit home bound seniors in their home for dental procedures, also treat seniors with Alzheimer\'s/dementia.','989921779096527','https://geriatrichousecalldentistry.com',NULL,NULL,NULL,'821933984736558,1060789001254366,930870677737263',NULL,NULL,NULL,NULL,NULL,'1128164531867061',NULL,NULL,NULL,'955971997114080',NULL,NULL,NULL),(208,872321036841122,'Union Settlement Transportation Program',NULL,1299477450227528,'From their website: \"Our Transportation program provides East Harlem seniors with an array of trips for necessities, such as visiting the pharmacy or the bank, and group recreational excursions. The program enhances many aspects of our senior center programming, enabling us to take seniors to activities, employment or volunteer work sites, and computer classes.\"','877157950664285','https://unionsettlement.org/senior-services/',NULL,NULL,NULL,'1048629387183766',NULL,NULL,NULL,NULL,NULL,'898842574081173,884751042759569',NULL,NULL,NULL,'955971997114080',NULL,NULL,NULL),(209,883376399970656,'Talking Books and Braille Library',NULL,889050494528761,'Eligible residents of New York State who have a visual impairment, are blind, have a physical condition that makes holding a book or turning pages difficult, and those with a medically diagnosed reading disability can receive a digital player, audio books, and braille materials for free. \n\nPosted 11/19',NULL,'nysl.nysed.gov/tbbl/apply.htm',NULL,NULL,NULL,'1200164878065478',NULL,NULL,NULL,NULL,NULL,'1277684382042532',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(210,888464653240277,'Westchester Center for Independent and Assisted Living',NULL,NULL,'Assisted and independent living that accepts Medicare and Medicaid through the Assisted Living Program (ALP). Offers assistance with personal care as well as housekeeping services and recreation programs. \n\nPosted 11/19','882287285471115','thewcenter.com/',NULL,'info@thewcenter.com',NULL,'979043836689591,1281533535852091',NULL,NULL,NULL,NULL,NULL,'1192953329195488',NULL,NULL,NULL,'1220633018170310',NULL,NULL,NULL),(211,893792185496529,'Hearing Accommodations at Museums',NULL,1184355160704972,NULL,'611465990733201',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1180859359074125',NULL,NULL,NULL),(212,840030666232520,'Caregivers Coaching Program',NULL,1260510841196867,'Become a trained volunteer and provide one-on-one support to caregivers, enabling them to face challenges and make informed decisions. All persons who are looking to improve caregivers\' quality of life are eligible. Training courses with a Fordham University curriculum about the aging process and care-giving are required. \n\nPosted 11/19',NULL,'seniorcitizens.westchestergov.com/caregiving/caregiver-corner/caregiver-coaching',NULL,'cap2@westchestergov.com',NULL,'1174744908232674',NULL,NULL,NULL,NULL,NULL,'1257643832006638',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(213,839158671206438,'Road to Recovery',NULL,557038388785779,'Provides cancer patients with ground transportation to and from cancer-related medical appointments at no charge. Rides are dependent on volunteer availability. Patients must be able to walk unassisted to and from the vehicle, or have an accompanying caregiver to assist. \n\nPosted 10/19',NULL,'https://www.cancer.org/treatment/support-programs-and-services/road-to-recovery',NULL,NULL,NULL,'1184375293767958,1260794998607714',NULL,NULL,NULL,NULL,NULL,'1175412403635544',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(214,869422949711757,'Catholic Charities of the Archdiocese of Newark Financial Assistance',NULL,926566663310552,'\"Financial assistance is one of the tools our case managers can use to stabilize families in crisis.  \nWe help prioritize needs, create a budget and set realistic financial goals. We also provide financial literacy classes to keep problems from reoccurring.\"','1081850790467536,1183790945873310','https://catholiccharitiesny.org/our-agencies/catholic-charities-community-services',NULL,NULL,NULL,'1080473071775397,1126107523105430',NULL,NULL,NULL,NULL,NULL,'1141004778938528',NULL,NULL,NULL,'1147007275983955,602099679392461',NULL,NULL,NULL),(215,885401816965082,'The Clinton Street Center',NULL,1316338228202900,'Programs and services designed to meet the needs of Pleasantville Residents that are 55+. It also serves the general community by providing social and cultural events. Programs are open to residents of the Village of Pleasantville and the school district first. Those outside of the district are invited to sign up, as space permits. Open 8-4 Monday-Friday. \nPosted 11/19','1099836114714012',NULL,NULL,'clintonstreetcenter@gmail.com',NULL,'1114469131907548',NULL,NULL,NULL,NULL,NULL,'791016197241063','815266508963097',NULL,NULL,'1288185441349354',NULL,NULL,NULL),(216,886820512656238,'Victoria Home',NULL,NULL,'Victoria Home offers skilled nursing and rehabilitative care, with three floors for distinct populations--those who need medical supervision, those with cognitive and memory impairment, and higher-functioning residents with a need for supervision. Physical, speech, and occupational therapy are available to residents, as well as medical specialty services like psychiatry and ophthalmology. Short term rehab is available. \n\nPosted 11/19','1142218786400766','www.victoriahome.org',NULL,NULL,NULL,'853236516099165,892286200872415,1225698418863757,624542557113105',NULL,NULL,NULL,NULL,NULL,'781837813469479',NULL,NULL,NULL,'1142969600429861',NULL,NULL,NULL),(217,906057727348234,'Arts & Minds Museum Experiences',NULL,1149907944072308,'From their website: \"Museum based experiences for people with dementia and their caregivers.\"','632376271916875','https://artsandminds.org/',NULL,NULL,NULL,'869870722824619,943955981947035,642511572093907,1248151266206446',NULL,NULL,NULL,NULL,NULL,'1304100492650843',NULL,NULL,NULL,'903689394971972',NULL,NULL,NULL),(218,846867475547086,'SAGE Long Island',NULL,902781566366502,'From their website: \"Serving GLBT older adults (age 50+), SAGE-LI provides social and recreational programming; health and wellness events; educational programs; advocacy; supportive and mental health services; and community education. Friendly Visiting program and onsite Older Adult Mingle.\" ','779111459211010','www.sageli.org',NULL,NULL,NULL,'1220426167240011',NULL,NULL,NULL,NULL,NULL,'635918232386334',NULL,NULL,NULL,'1077968827043382',NULL,NULL,NULL),(219,852387643645016,'Project Time-Out',NULL,604657247231584,'Respite services for caregivers of seniors: companion and escort services, free needs assessment, outside referrals.\n\nPosted 10/19','1322880754340982',NULL,NULL,'ckobroff@wjcs.com',NULL,'1160439364324685,1129663593860154',NULL,NULL,'Sliding Scale',NULL,NULL,'1131495687937402',NULL,NULL,NULL,'974738233198185',NULL,NULL,NULL),(220,875403809995974,'Adult Day Health Programs and Services',NULL,553326749957149,'Bethel\'s Adult Day Services program is for seniors and adults who might otherwise be left alone during the day while their caregivers are at work. Designed to provide an entertaining and interactive day for those who attend. 8am-4pm, Monday through Friday. Transportation available for those living within 10 miles. \n\nPosted 11/19','1279609127127414','www.bethelwell.org',NULL,NULL,NULL,'1114469131907548',NULL,NULL,NULL,NULL,NULL,'1267006672398501',NULL,NULL,NULL,'1099501997135733',NULL,NULL,NULL),(221,878265177488162,'Paul Feiner, Town Supervisor',NULL,598938318454195,'Greenburgh Residents--Assistance with snowblowing for elderly or disabled individuals. \n\nPosted 10/19',NULL,NULL,NULL,'pfeiner@greenburghny.com',NULL,'1258526581948590',NULL,NULL,NULL,NULL,NULL,'884687832197119',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(222,887505557148962,'Search & Care Volunteer Program',NULL,875189273598571,'From their website: \"Companionship, visiting, and conversation, shopping, prescription pickups, and errandsparticularly for the homebound, strolls throughthe neighborhood, technology tutorials (internet, email, e-books), socialization and entertainment activities (e.g. playing board games)\" for seniors residing in Manhattans Yorkville, Carnegie Hill, and East Harlem communities (catchment area is E. 86th to E.138th Streets, East River to 5th Avenue). Seniors must receive a home assessment by one of their social workers and not have involvement with other agencies to use this service.','604286463973708','https://www.searchandcare.org/volunteers/',NULL,'SandC@searchandcare.org',NULL,'910515645454451,1137020311225588,969672981978469',NULL,NULL,NULL,NULL,NULL,'933127730613617',NULL,NULL,NULL,'1129861482680271',NULL,NULL,NULL),(223,892767966533916,'Sharsheret',NULL,NULL,'From Website: Sharsheret, a national non-profit organization, improves the lives of Jewish women and families living with or at increased genetic risk for breast or ovarian cancer through personalized support and saves lives through educational outreach.\nWhile our expertise is in young women and Jewish families as related to breast cancer and ovarian cancer, Sharsheret programs serve all women and men.\n\nPosted 10/19',NULL,'www.sharsheret.org',NULL,'info@sharsheret.org',NULL,'1184375293767958',NULL,NULL,NULL,NULL,NULL,'737534413280285',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(224,901976308727761,'Home Sharing Program',NULL,929828904477796,'From their website: \"The Foundations free Home Sharing Program helps link adult hosts with extra private spacesin their homes or apartments with appropriate adult guests (18+) to share their space. One of the \"matchmates\" must be age 60 or older. The program also serves adult hosts age 55 or older, who are interested in sharing with developmentally disabled adult guests capable of independent living; They require the following information from the person looking for housing:\n-a copy of their ID\n-proof of income\n-three professional references\nAfter they receive the items above, they will schedule an in-office \"guest assessment\" interview.\"','1192388551570388','http://www.nyfsc.org/home-sharing',NULL,NULL,NULL,'632606603203298',NULL,NULL,NULL,NULL,NULL,'812147480260529',NULL,NULL,NULL,'1179892637853969',NULL,NULL,NULL),(225,904435870052202,'The ATTAIN Laboratory','Advanced Technology Training and Information Networking ',621590574293234,'From their website: \"Computer lab offers free access to the Internet and free computer training to members of the community in an attractive, comfortable environment. Features state-of-the-art computers  is a partnership between Henry Street Settlement, the State University of New York and Microsoft. Come in person to the lab during registration hours, listed on the monthly calendar, to register for lab access. Once registered, you can take an exam to acquire a Digital Literacy Certificate, or enroll in the Computer Basics class. Bring your own USB storage device (flash drive). M-Th: 10 am-8 pm and Fri-Sat: 10 am-5 pm.\"','745545957016997','www.henrystreet.org/programs/employment/attain-computer-lab/',NULL,'james.hilzendeger@hss.attain.suny.edu',NULL,'1137020311225588',NULL,NULL,NULL,NULL,NULL,'596375484728437',NULL,NULL,NULL,'1231025244767006',NULL,NULL,NULL),(226,918399294039588,'Medical Car Service-Staten Island',NULL,1010580337283883,'Medical car service for transportation to medical appointments with car or passenger van, free of charge, although it is recommended that the driver is tipped. Monday-Friday, 9 am-4 pm. Senior must be ambulatory, no assistance needed to get in and out of the car, not eligible if they have Access-A-Ride or Medicaid. For appointments on Staten Island only.','1166381524871046','www.nyconnects.ny.gov/providers/community-agency-for-senior-citizens-sofanya438775',NULL,NULL,NULL,'1048629387183766',NULL,NULL,NULL,NULL,NULL,'1275388700455417',NULL,NULL,NULL,'817358056301206',NULL,NULL,NULL),(227,883656468114296,'Computer Tutors',NULL,617910248814061,'\"For seniors who want to become computer and websavvy, DOROT volunteers visit at mutually convenient times to teach basic computer skills and Internet navigation. DOROT works with both seniors and volunteers to determine the number of sessions and duration of instruction.\" **As of June 2019, this program is on hiatus (see UWW for Connect Through Tech tech coaching program).** ','872398746454681','www.dorotusa.org',NULL,NULL,NULL,'1137020311225588',NULL,NULL,NULL,NULL,NULL,'637042726567005',NULL,NULL,'1272863013225282','801326186311509',NULL,NULL,NULL),(228,889290953225814,'Lenox Hill Neighborhood House Case Management',NULL,NULL,'From their website: Geriatric Care Management Program provides comprehensive care management services to frail and homebound older adults each year in Community Districts 6, 8 and 11, covering the East Side of Manhattan from 14th Street to 143rd Street including Roosevelt Island. Geriatric Care Clients must be sixty or older, frail and homebound.','1267609685792488','http://www.lenoxhill.org/geriatriccare',NULL,NULL,NULL,'784392560809728',NULL,NULL,NULL,NULL,NULL,'1269542982566838',NULL,NULL,NULL,'870634650166451',NULL,NULL,NULL),(229,886872882742418,'Supportive Housing & Housing Advocacy',NULL,1165481515831627,'From their website: \"We provide individualized, recovery-oriented services to 22 residents who have been homeless, have a mental health diagnosis orsubstance abuse issues. We help them improve their quality of life by providing help establishing financial solvency, consistent and effective medical and psychiatric care, and positive engagement in daily social activities. Gathering around our large dining table to celebrate holidays and other special occasions gives tenants, who are otherwise living by themselves, a sense of belonging to a supportive community.\"','1157439885702996','http://ujceastside.org/ujc-social-services',NULL,NULL,NULL,'669623054114376,632606603203298',NULL,NULL,NULL,NULL,NULL,'711348531869838',NULL,NULL,NULL,'620719617398611',NULL,NULL,NULL),(230,888456338601707,'Healthy Hearing',NULL,NULL,'From their website: \"The mission of Healthy Hearing is to improve the quality of life for people with hearing loss by providing education about hearing loss and its implications and treatment options. Healthy Hearings directory of consumer-reviewed clinics across the U.S. connects people who are ready to get help for their hearing to qualified local hearing care professionals.  Hearing Help pages have basic information about hearing loss, hearing aids, tinnitus and assistive listening devices. You may also download our free consumer guides.\"','1184649940863336','healthyhearing.com/help/assistive-listening-devices/hearing-impaired-phones',NULL,NULL,NULL,'927475609486366',NULL,NULL,NULL,NULL,NULL,'1097862475451062',NULL,NULL,NULL,'1093634927600387',NULL,NULL,NULL),(231,895897993855079,'BJCC Transportation Program','BJCC',608478388100121,'\"Funded through the Department for the Aging, provides services for seniors primarily in Community Board 11. This program brings seniors to doctors appointments, local senior centers, shopping and other neighborhood activities.\"','803273260259437','https://www.bjcconline.org/',NULL,'info@bjcconline.org',NULL,'634570173416697,1048629387183766',NULL,NULL,NULL,NULL,NULL,'938318263388040',NULL,NULL,NULL,'800166269666778',NULL,NULL,NULL),(232,911239601037044,'Alzheimer\'s Foundation of America-Education & Resource Center',NULL,1288044313088279,'The Alzheimers Foundation of America hosts programs for senior with Alzheimers and their caregivers on music, art, yoga, and more. Call for specific dates and times. ','1149107541488250','https://alzfdn.org/events/',NULL,NULL,NULL,'642511572093907,1248151266206446,943955981947035,877451051471319',NULL,NULL,NULL,NULL,NULL,'848577785284000',NULL,NULL,NULL,'1218004392452674',NULL,NULL,NULL),(233,913495435605886,'Medicare & Medicaid Advisory Group',NULL,NULL,'Client assistance and advocacy in obtaining Medicare & Medicaid eligibility. Call for a free consultation. ','1069598601708938','https://mmag.org/',NULL,NULL,NULL,'669623054114376,785468758686103,775024125555217',NULL,NULL,NULL,NULL,NULL,'875723948585454',NULL,NULL,NULL,'817631397701148',NULL,NULL,NULL),(234,916134569938827,'Eden Gourmet',NULL,NULL,'\"Every order is delivered FREE of charge in Manhattan, regular items must be ordered at least 24 hours before the delivery time. Order online.\"','576975032913041','http://edengourmet.com',NULL,NULL,NULL,'1235894498248246',NULL,NULL,NULL,NULL,NULL,'1168763045102687',NULL,NULL,NULL,'1302585473484597',NULL,NULL,NULL),(235,924734829034925,'AUDIENT',NULL,962280279701770,'Helps low income people nationwideaccess quality hearing aids and related care at a significantly lower cost. AUDIENT income qualifies families to be eligible for a discount on brand name hearing aids available through the AUDIENT Alliance\'s national network of dedicated hearing care providers. Brand selection includes Oticon, Phonak, Siemens, Widex, & Unitron hearing aids. If the person qualifies based on income, they will receive a notice of approval and will be referred to an audiologist in their area. Application can be found on their website at www.audientalliance.org/downloads/patients/AUDIENT_application.pdf and should be faxed or mailed.','809668888101005,966012842323076','http://www.audientalliance.org/',NULL,NULL,NULL,'927475609486366',NULL,NULL,NULL,NULL,NULL,'958056495301779',NULL,NULL,NULL,'903689394971972',NULL,NULL,NULL),(236,867670607442498,'Social Adult Day Program',NULL,603673939047614,'8:00-4:00 Monday-Friday\n\nPosted 11/19','1299900450585072','yorktownrnc.com/social-adult-daycare/',NULL,' tblake@YorktownRNC.com',NULL,'1114469131907548',NULL,NULL,NULL,NULL,NULL,'1084171257401774','815266508963097','614004714222285',NULL,'1254923980737856',NULL,NULL,NULL),(237,875627478974399,'Holocaust Survivor Program',NULL,979989167470485,'Provides services to Holocaust survivors.','1212546812400921','www.selfhelp.net',NULL,'info@selfhelp.net',NULL,'917614737211305',NULL,NULL,NULL,NULL,NULL,'783848767095069,930906764780885',NULL,NULL,NULL,'684462579679665',NULL,NULL,NULL),(238,886002483710503,'JCC Senior Lounge',NULL,724662437776878,NULL,'1312695594585888',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1149916861813349',NULL,NULL,NULL,'809698659267160',NULL,NULL,NULL),(239,899826943268588,'The Bridge-Behavioral Health Supportive Housing',NULL,1010051820509387,NULL,'1166797562585238',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'869088980926062',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(240,902915716647397,'Union County Paratransit System',NULL,NULL,'Provides curb to curb, non-emergency transportation for older adults, ages 60 and older, veterans, those who are temporarily disabled, and low income individuals. The unit can provide transportation for any of the following requests:\nMedical appointments, education, employment, nutrition, shopping, recreation, bus & rail. Services are available on a first come first serve basis. Riders are asked to call 5 to 7 days in advance to request transportation services (chemo treatment and dialysis appointments get priority), $2 each way, billed at the end of the month.','599306518734171','http://ucnj.org/departments/human-services/paratransit-system/',NULL,'kcarmello@ucnj.org',NULL,'1217112216075611,1048629387183766,1126107523105430',NULL,NULL,NULL,NULL,NULL,'1005487151098202',NULL,NULL,NULL,'1234378012832324',NULL,NULL,NULL),(241,901066062072005,'The Hebrew Free Loan Society',NULL,NULL,'From their website: \"Fosters financial self-sufficiency and stability among New Yorkers in need through interest-free lending. HFLS loans make an immediate, concrete difference in the lives of our borrowers, enabling them to invest in their education, start a business, meet emergency expenses, and more. The General Needs Loan Program provides interest-free loans of up to $7,500 to low-and moderate-income residents of New York Citys five boroughs, Westchester, or Long Island to help fund significant expenses that borrowers cannot meet with their own resources or to help bridge a period of unexpected income loss. The Mitchell Lama Housing Loan Program provides interest-free loans of up to $30,000 to low-and moderate-income residents of New York Citys five boroughs, Westchester, or Long Island to help purchase a Mitchell Lama apartment.\"','913322059376271','https://hfls.org/ ',NULL,'info@hfls.org',NULL,'1080473071775397',NULL,NULL,NULL,NULL,NULL,'1148987270703767',NULL,NULL,NULL,'1267855411228292',NULL,NULL,NULL),(242,911782926228446,'Selfhelp Senior Housing',NULL,979989167470485,'From their website: \"Selfhelp owns and operates 10 affordable senior apartment buildings in Queens, the Bronx, and Nassau County, with two more under development in Brooklyn. Our buildings offer seniors the opportunity to lead independent lives in affordable and appropriate apartments, with access to on-site services if and when needed, including health and wellness, social work, skilled nursing and home care. There are also computer and Skype rooms, large community rooms and libraries, as well as exercise equipment and telehealth monitoring, Each unit is equipped with emergency pull cords, there is closed-circuit TV surveillance in each lobby, and the buildings are near to public transportation. Seven of our residences are also in close proximity to one of Selfhelps senior centers, where residents can participate in stimulating programs and enjoy a nutritious lunch.\"','1212546812400921','https://selfhelp.net/community-based-programs.php',NULL,NULL,NULL,'632606603203298',NULL,NULL,NULL,NULL,NULL,'708463359521157',NULL,NULL,NULL,'684462579679665',NULL,NULL,NULL),(243,942162107607836,'Visions',NULL,NULL,'Services are free of charge. An individualized plan is created to help each senior become or remain as independent as possible at home or in the community. There is a multi-lingual full-time staff and part-time interpreters. Serves all five boroughs and Long Island. Also at VCB in Rockland County and Selis Manor in Manhattan.','1246575464969417','www.visionsvcb.org/visions/?',NULL,'info@visionsvcb.org',NULL,'821861174676380',NULL,NULL,NULL,NULL,NULL,'880970653449227',NULL,NULL,NULL,'1261367709410468',NULL,NULL,NULL),(244,881761004286809,'University Without Walls: Caregivers\' Connection',NULL,617910248814061,'Weekly telephone-based support groups and workshops give caregivers the opportunity to speak with experts, learn about resources, and meet other caregivers.\n\nPosted 10/19',NULL,'http://www.dorotusa.org/site/PageServer?pagename=seniors_programs_on_phone_D#.XbHIkJpKiUk',NULL,NULL,NULL,'853236516099165',NULL,NULL,NULL,NULL,NULL,'1280829032163526',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(245,884103943459443,'Carnegie East House',NULL,NULL,'\"Independent living facility that provides three meals a day, lunch and dinner are served in a dining room. Daily activity schedule (exercise, music, art, knitting, games, etc.) and a movie every evening. Nurse on staff 7 days/week.\"','1245210302703235','www.carnegieeast.org',NULL,NULL,NULL,'1149247622463332,1157747719793788',NULL,NULL,NULL,NULL,NULL,'1260469478260780',NULL,NULL,NULL,'1129861482680271',NULL,NULL,NULL),(246,898653528603878,'Active Retirement Center','PARC',1176924668005479,'From their website: \"Brings the most affordable programs for active adults 55 and older to lower Manhattan. A full-year\'s membership fee entitles you to the Coffee and Culture lecture series; computer assistance; sponsored events including films, tours, and performing arts; use of Pace\'s library, computer labs and dining facilities; and a calendar of rich events.\"','964118028121674','https://cps.pace.edu/lifelong-learning/senior-programs-parc/',NULL,'cps@pace.edu',NULL,'1119821956066449',NULL,NULL,NULL,NULL,NULL,'572117183428877',NULL,NULL,NULL,'1278447139829997',NULL,NULL,NULL),(247,933237624354771,'Partners in Care',NULL,667266331396288,'-Personal care and companionship\n-Ambulatory escort service\n-Bathing & dressing service\n-Skilled nursing care\n-Assessment for nursing home eligibility\n-Professional therapy sessions\n-Geriatric care management\n\nPosted 10/19',NULL,'https://www.vnsny.org/how-we-can-help/private-care-services/get-started/',NULL,'clientservices@partnersincareny.org',NULL,'1144317597848541,1209400832429047',NULL,NULL,'Private Pay',NULL,NULL,'758665881907713',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(248,938841885181310,'Diana Morris',NULL,1115005045803946,'Privatus provides private nursing services (HHAs and RNs) all managed by seasoned registered nurses and senior managers. Oversight performed by RNs every 10-14 days. Services also include a lifestyle concierge for personal preferences. \n\nPosted 10/19',NULL,'https://www.privatuscare.com/',NULL,NULL,NULL,'1209400832429047',NULL,NULL,NULL,NULL,NULL,'1094658663094659',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(249,933790200082155,'The Rubin Museum-Mindful Connections ',NULL,NULL,'Free tour program for visitors with Alzheimer\'s and dementia and their caregivers. Trained museum guides facilitate a gallery experience designed to promote conversation and engagement with works of art and each other. This program meets on the third Friday of every month from 2:00-3:00 pm. Visitors are encouraged to arrive at 1:30 pm for complimentary tea and conversation in the museum\'s Caf Serai. All tours are free of charge and require advanced registration.  \n\n','1190507733701014','https://rubinmuseum.org/',NULL,'access@rubinmuseum.org',NULL,'869870722824619,1248151266206446,642511572093907,943955981947035',NULL,NULL,NULL,NULL,NULL,'839802323250782',NULL,NULL,NULL,'951335486669329',NULL,NULL,NULL),(250,939872204189528,'PEARLS (Program to Encourage Active Rewarding Lives)',NULL,1311274178917071,'Free program that helps seniors with depression, short-term (approximately 6 visits); for seniors living in Queens and Manhattan.','1003476291614985','https://www.vnsny.org/how-we-can-help/community-programs/community-mental-health-services/pearls-program-encourage-active-rewarding-lives/',NULL,NULL,NULL,'1000576764179618',NULL,NULL,NULL,NULL,NULL,'1272040877370789',NULL,NULL,NULL,'955971997114080',NULL,NULL,NULL),(251,938961765281346,'Clearview Senior Center Medical Transportation Program',NULL,685028959367331,'For seniors residing in Queens: Seniors interested in making an appointment can call the Selfhelp Clearview Senior Center at 718-224-7888 between 9:00 am and noon to schedule next-day rides. Service users are required to fill out an application with demographic information, emergency contact and destination. When they are ready for pick up, seniors must call Selfhelp again to schedule a return trip. Four Twos and Central Car Service will provide rides for seniors. ','786555442968834','https://www.selfhelp.net/community-based-programs.php',NULL,NULL,NULL,'981685343230150,1048629387183766',NULL,NULL,NULL,NULL,NULL,'1232479289309431',NULL,NULL,NULL,'1097684414081172',NULL,NULL,NULL),(252,943177373790677,'Cabrini Eldercare',NULL,NULL,'Cabrini Eldercare offers respite care, residence at St. Cabrini Nursing Home, short-term rehabilitation, home health services, and affordable senior living. \n\nPosted 11/19','1268369769901803','www.cabrini-eldercare.org/',NULL,NULL,NULL,'606548005480946,1209400832429047,624542557113105,1225698418863757,1057136254371539',NULL,NULL,NULL,NULL,NULL,'767136569135955',NULL,NULL,NULL,'1162553500902394',NULL,NULL,NULL),(253,883958506636599,'William Alanson White Institute ',NULL,NULL,'Individual psychotherapy, one to two times a week, for up to forty weeks. Sessions are available from 8:00 am to 8:45 pm. Fees are adjusted on a sliding scale or applied to the portion of the clinic fees that are not covered by your insurance.  After forty weeks, you may decide with your therapist if you would like to continue in the therapists private practice at a modest fee.  Also offer group psychotherapy on Monday evenings from 6:30 to 8:00 pm.',NULL,'http://www.wawhite.org/index.php?page=adult-treatment-services',NULL,NULL,NULL,'1000576764179618',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(254,886515346401663,'The Weinberg Center for Elder Justice',NULL,935863789676572,'Provides emergency short-term housing, healthcare services, legal advocacy, financial maintenance and support services to victims of elder abuse. \n\nPosted 11/19','750855764478228','www.theweinbergcenter.org',NULL,NULL,NULL,'1334445722577337',NULL,NULL,NULL,NULL,NULL,'1119269001487233',NULL,NULL,NULL,'911353104260518',NULL,NULL,NULL),(255,895920199651907,'Caring Kind 24-Hour Helpline',NULL,911697756644478,' Social workers provide in-depth, personalized consultations for individuals and families facing the decisions and challenges associated with Alzheimers disease and other dementias. Professional social work staff can assist with: developing a better understanding of the disease,\ncreating a plan to obtain necessary care, discussing options for symptom management, and addressing the emotional impact of the disease. Licensed social workers address each familys unique concerns to develop a care plan. Social workers can meet by appointment, in person or phone.','1154290583346128','https://caringkindnyc.org/socialwork/',NULL,'helpline@caringkindnyc.org',NULL,'853236516099165,943955981947035,642511572093907,1248151266206446,877451051471319',NULL,NULL,NULL,NULL,NULL,'739859138867716',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(256,908649413224832,'ClearCaptions',NULL,NULL,'From Website: If you are experiencing hearing loss that inhibits your phone use, you may qualify to receive a ClearCaptions phone at no cost to you! ClearCaptions offers real-time phone captioning that allows you to see every word said on the call.\n\nPosted 11/19',NULL,'clearcaptions.com/',NULL,NULL,NULL,'1200164878065478',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(257,922570750485340,'Health Advocates for Older People-Equipment Exchange Program',NULL,1219582025275697,'Gently-used equipment may be donated or received (at no cost) on either Monday or Tuesday afternoon, with appointment only, at Holy Trinity Church (213 W 82nd Street between Broadway and Amsterdam). Please call beforehand for availability to reserve needed item or to drop off equipment. Categories include of items accepted include: canes, crutches, armed crutches, plain walkers, rollators (with seat), wheelchairs, portable commodes, toilet seat supports with arms, shower chairs, bed guard rails, transfer chairs (with push handles), folding tray table, knee walkers, grab rails (under mattress bed assist). Shower grab bars are also available.','1275743859932320','http://www.hafop.org',NULL,NULL,NULL,'949152871495532,913198060459802,796531679969625',NULL,NULL,NULL,NULL,NULL,'1131121820107153',NULL,NULL,NULL,'886253808274487',NULL,NULL,NULL),(258,923646230075508,'Resources and Services',NULL,1260510841196867,'Posted 10/19',NULL,'https://seniorcitizens.westchestergov.com',NULL,NULL,NULL,'853236516099165',NULL,NULL,NULL,NULL,NULL,'1100595324045699',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(259,922757855773332,'Home Instead Senior Care',NULL,NULL,'Posted 10/19','877628105870328,1211465314122001','https://www.homeinstead.com/557',NULL,'rhonda.schreiber@homeinstead.com',NULL,'1209400832429047',NULL,NULL,NULL,NULL,NULL,'778347577179944',NULL,NULL,NULL,'847439785754434,1325364228156121',NULL,NULL,NULL),(260,943189738216572,'Upper Manhattan Partnership For Senior Independence-Isabella','Isabella',1296886809714650,'From their website: \"Provides free case management services to older adults living in Inwood, Washington Heights, Central and West Harlem (Community Boards 9, 10 and 12). If you are 60 years or older and live in the neighborhoods identified above - we can help assess your needs and link you with an array of supports and services such as Home Care, Social Day Care, shopping and chore services, counseling and home delivered meals.\"','971129219715911','http://www.isabella.org/Isabella/Programs/CaseManagement.aspx',NULL,NULL,NULL,'784392560809728',NULL,NULL,NULL,NULL,NULL,'996241475228602',NULL,NULL,NULL,'607808160572943',NULL,NULL,NULL),(261,944976351051041,'Senior Helpers',NULL,NULL,'Home care, including concierge care for multiple tasks.','624587549571008','www.seniorhelpers.com/',NULL,NULL,NULL,'1324596060194399',NULL,NULL,NULL,NULL,NULL,'799800317913732,1264445479148921,871160022530687',NULL,NULL,NULL,'1010477474135532',NULL,NULL,NULL),(262,964120808558816,'Memory Center Caregiver Support Group',NULL,1170391776658941,'From their website: \"In conjunction withCaring Kind, an evening group is held at the New York Memory Center. The group meets twice a month on thefirst andthird Wednesdays, and sessions are free but you must pre-register.\"','1272585219567649','www.nymemorycenter.org',NULL,'mchrist@nymemorycenter.org',NULL,'877451051471319',NULL,NULL,NULL,NULL,NULL,'539933937712273,646240608574729',NULL,NULL,NULL,'1179412541609232',NULL,NULL,NULL),(263,900904477977142,'Lighthouse Guild-Technology Training',NULL,NULL,'Technology training can be done in their center for $75/hour (private pay). Their training is only free when it is through the NY State Commission for the Blind for someone who is planning to go back to work or school. ','946288203514985','https://www.lighthouseguild.org/',NULL,NULL,NULL,'1137020311225588,821861174676380',NULL,NULL,NULL,NULL,NULL,'617719321457783',NULL,NULL,NULL,'944853548512062',NULL,NULL,NULL),(264,909531836331413,'IMpact Life Transition Advocates',NULL,NULL,'From their website: \"After an initial consultation, provides assistance with document organization, insurance claims, personal advocacy, and referrals to resources such as: financial advisers, elder care attorneys, home care, senior move Managers, etc.\" Ilene Mandell, Founder.','992945602125128','https://impactadvocates.com/',NULL,'ilene@impactadvocates.com',NULL,'1012417089448021,656941113483002',NULL,NULL,NULL,NULL,NULL,'1145474595596336',NULL,NULL,NULL,'955971997114080',NULL,NULL,NULL),(265,923999939595541,'Fran Pantaleo, Esq. ',NULL,1289369597440419,'Founded in 1937, Bleakley Platt & Schmidt is a firm of legal professionals. With offices in White Plains, New York and Greenwich, Connecticut, Bleakley Platt & Schmidt represents national clients as well as clients from the New York metropolitan region, ranging from the five boroughs of New York City to Westchester and the Hudson Valley as well as southern Connecticut.','991953561809803','https://www.bpslaw.com/',NULL,'fpantaleo@bpslaw.com',NULL,'885600197309781',NULL,NULL,NULL,NULL,NULL,'913045701943478',NULL,NULL,NULL,'1180401435417081',NULL,NULL,NULL),(266,939447269767314,'Caring Kind Support Groups',NULL,911697756644478,'\"Support groups led by trained facilitators, provide caregivers with the opportunity to discuss the many challenges of caring for a family member with Alzheimers disease and related dementias, with others who understand in a safe setting.\"','1154290583346128','www.caringkindnyc.org/',NULL,NULL,NULL,'943955981947035,642511572093907,1248151266206446',NULL,NULL,NULL,NULL,NULL,'739859138867716',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(267,954772931172809,'Cancer Care',NULL,NULL,'Counseling, support groups, financial assistance.','818262783520902','www.cancercare.org',NULL,'info@cancercare.org      ',NULL,'1060789001254366,804710974459801,877451051471319',NULL,NULL,NULL,NULL,NULL,'1235024221443523',NULL,NULL,NULL,'612919070135370',NULL,NULL,NULL),(268,960617758768539,'Social Services at West Side Campaign Against Hunger',NULL,859311048444171,'Offers access to benefits and connection to community resources including SNAP, health insurance, referrals to ESL and GED programs, job training and placement, financial and legal counseling, eviction prevention counseling, clothing, food pantry. Also, from February through April, there is a free walk-in tax preparation help service (call for days/times).','657741214801376','https://www.wscah.org/social-services/',NULL,'info@wscah.org',NULL,'9056059591