ber (24-hour emergency response line) which will alert caregivers and first responders to their status so they can be returned home. Cost: $55.00 + $7.00 shipping and handling. Includes: member\'s ID jewelry with personalized information and MedicAlert + Safe Return\'s 24-hour emergency toll-free number, personalized emergency wallet card, 24-hour emergency response service, personal health record (PHR), six Steps to a safe return magnet. Optional cost of additional $35.00 for a caregiver ID jewelry and membership. An annual fee of $35.00 will be due after the first year for each membership. ','897643592121126','https://alz.org/help-support/caregiving/safety/medicalert-safe-return',NULL,NULL,NULL,'1063168571768300,642511572093907,943955981947035,1248151266206446',NULL,NULL,NULL,NULL,NULL,'1102095914534738',NULL,NULL,NULL,'1103152850074440',NULL,NULL,NULL),(280,960228911790200,'Alix Keast Asian Bodywork Therapy',NULL,NULL,'Alix Keast is a New York state licensed Asian bodywork therapist. Her holistic healing techniques are based on Chinese medicine. She is available to do home visits. Call for rates and details. ','1080980334266782',NULL,NULL,'alixk3@gmail.com',NULL,'821933984736558,1060789001254366',NULL,NULL,NULL,NULL,NULL,'1188424253705335',NULL,NULL,NULL,'1194305757951964',NULL,NULL,NULL),(281,956467620276211,'Westchester County Adult Protective Services','APS',1114707966679244,'From Website: ...System of services provided without regard to income under the New York State Office of Children and Family Services for persons 18 or older, who, because of a mental and/or physical impairment, are at risk of harm or are unable to meet their own needs and have no one to assist them responsibly. In New York State, local social services departments have the primary responsibility to provide services to impaired adults who may be abused, neglected or exploited and are living in the community.\n\nPosted 11/19',NULL,'https://socialservices.westchestergov.com/adult-protective-services',NULL,NULL,NULL,'1334445722577337',NULL,NULL,NULL,NULL,NULL,'766394057278074',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(282,962155089881489,'The Osborn Pavilion',NULL,878229778994259,'Short-term and outpatient rehabilitation, long-term skilled nursing, and respite care. \n\nPosted 11/19','950726685241038','www.theosborn.org/rehabilitation',NULL,NULL,NULL,'1057136254371539,1225698418863757,624542557113105',NULL,NULL,NULL,NULL,NULL,'1322695515358480',NULL,NULL,NULL,'887752054714624',NULL,NULL,NULL),(283,971120844945671,'Catholic Charities Brooklyn & Queens Home Delivered Meals & Friendly Visiting ',NULL,NULL,'Friendly visiting program for seniors who receive home delivered meals and case management. ',NULL,'https://www.ccbq.org/what-we-do/family-and-community-services/senior-services',NULL,NULL,NULL,'1261747089209037,981685343230150,969672981978469,830617726149111',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(284,979647759133794,'Search & Care Pets and Elders Together',NULL,875189273598571,'From their website: \"For low-income, frail, pet-owning clients with animal-upkeep and hygiene, dog-walking, cat litter clean-up, light grooming, pet-play, as well as visits from friendly dogs to provide companionship to the isolated and homebound. During the holidays, volunteers deliver a signature Holiday Pet Stocking filled with goodies that clients may not be able to afford. The agency has a Veterinary Assistance Program which helps to cover expenses of emergency vet care, a Pet Fund for emergency supplies (e.g. pet food), while a Companion Animal Advocate identifies emergency contacts (family, friends, neighbors) who can care for pets in the event that the client is in distress.\" For clients of case management program, serving seniors residing in Manhattans Yorkville, Carnegie Hill, and East Harlem communities (catchment area is E. 86th to E.138th Streets, East River to 5th Avenue). (212) 289-5300','604286463973708','https://www.searchandcare.org/pets-and-elders-together/',NULL,'SandC@searchandcare.org',NULL,'1009228235801069',NULL,NULL,NULL,NULL,NULL,'933127730613617',NULL,NULL,NULL,'1129861482680271',NULL,NULL,NULL),(285,914898037644455,'Friendship Houses',NULL,1120414012913334,'Locations in Brooklyn and the Bronx. A psycho-social club that helps seniors 55 and older who have a mental health condition, diagnosis, or co-occurring disorders improve and maintain successful community living. Reduces isolation, promotes socialization, living skills, and self-esteem and offers volunteer opportunities. Also promotes health with wellness programs and peer support groups. Members benefit from a hot lunch, programming, and other JASA services.','635813831197877,1104382866223370','https://www.jasa.org/community/mental-health-services#.W3W3k85KiUk',NULL,NULL,NULL,'1000576764179618',NULL,NULL,NULL,NULL,NULL,'1178997443558007',NULL,NULL,NULL,'646770628651997,966920271985196',NULL,NULL,NULL),(286,945752833105371,'Family Caregiver Network',NULL,604657247231584,'Provides support to caregivers of older adults (60+) and creates programs tailored to meet the needs of synagogues, JCCs, and hospitals located in the Rivertowns and northern Westchester.\n\nPosted 10/19','1322880754340982','http://www.wjcs.com/family-caregiver-network/',NULL,'jslevin@wjcs.com',NULL,'1160439364324685',NULL,NULL,NULL,NULL,NULL,'1051185535430439',NULL,NULL,NULL,'974738233198185',NULL,NULL,NULL),(287,950276035895444,'Weissman Wellness-Private Geriatric Care Managers',NULL,NULL,'A bio-psychosocial assessment is conducted during the first visit. Which includes an assessment which may include topics of: home safety, personal health, finances, family, health and disability, referrals and resources, and advocacy. Staff of three social workers, serving New York City and surrounding areas.  ','820918468700428','https://weissmanwellness.com/welcome',NULL,'JYWeissman@weissmanwellness.com',NULL,'863555368755651',NULL,NULL,NULL,NULL,NULL,'988824700474415',NULL,NULL