s can receive information on a variety of services designed to foster the independence and dignity of New Jersey citizens in need of assistance.\"','808841261990530','https://seniorsresourceguide.com/directories/National/NJEASE/index.html',NULL,NULL,NULL,'1126107523105430',NULL,NULL,NULL,NULL,NULL,'1243737524074413',NULL,NULL,NULL,'955971997114080',NULL,NULL,NULL),(315,969591362936554,'Judie Kaplan: Personal Concierge',NULL,NULL,'Judie provides lifestyle management services including bills, shopping, medical advocacy, and geriatric care management. She has 35 years of experience in healthcare administration. She does not provide cooking or care-giving services.\n\nPosted 10/19',NULL,'http://judiekaplan.com/',NULL,'jkaplan@judiekaplan.com',NULL,'1144317597848541,1258526581948590',NULL,NULL,NULL,NULL,NULL,'1089446791508155',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(316,977076741986226,'Ilene Amiel',NULL,857790876391380,'Daily Money Manager, Certified Money Coach\n\nPosted 10/19','905133685569773','www.personalaffairsadministrator.com',NULL,'ilene@personalaffairsadministrator.com',NULL,'1258526581948590',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(317,979828351062250,'Lincoln Square Neighborhood Center',NULL,NULL,'Provides community members aged 60+ with programming and services such as painting classes, yoga sessions, computer workshops, and a hot lunch.','1252212274923057','http://www.lsncny.org/',NULL,NULL,NULL,'1299575089394687',NULL,NULL,NULL,NULL,NULL,'843743119320527',NULL,NULL,NULL,'978693219788877',NULL,NULL,NULL),(318,980311998959939,'Sage Eldercare',NULL,NULL,'Information and referrals, shopping help, home delivered meals, classes, home care, adult day program, advocacy.','780043939873286','http://www.sageeldercare.org/',NULL,'contactus@sageeldercare.org',NULL,'1126107523105430',NULL,NULL,NULL,NULL,NULL,'945066579726397',NULL,NULL,NULL,'937477360910589',NULL,NULL,NULL),(319,991868453384068,'JASA-One Stop',NULL,1120414012913334,'Case assistance, case management, benefits and entitlements assistance, counseling, and home care for a drop-in senior population as well as home-bound seniors. Drop-in services available Monday to Friday, 9:00 am to 1:30 pm in Manhattan. Case management services (for those with an income of $25,000 and below) also available in Bronx, Brooklyn, Queens, and Long Island.  ','1304313664181912','www.jasa.org/community/one-stop-at-jasa',NULL,NULL,NULL,'775024125555217,594263482089475,981685343230150,634570173416697,784392560809728,1261747089209037',NULL,NULL,NULL,NULL,NULL,'887655578966616',NULL,NULL,NULL,'1256625945825770',NULL,NULL,NULL),(320,1008498020135532,'SilverSneakers',NULL,NULL,'SilverSneakers provides access to fitness equipment, group exercise classes, social networking, online education and a sense of community. More than 16,000 locations nationwide. All SilverSneakers classes are designed by experts in older adult fitness and taught by credentialed fitness professionals. Classes are created for adults of all ages, fitness levels and abilities. Modifications are offered and chairs are available in certain classes. See if you have SilverSneakers with your Medicare Advantage Plan, then create an online account and download your SilverSneakers membership card. Go online to find the nearest location and join a fitness class or exercise on your own.\nIf you have additional questions regarding your SilverSneakers eligibility or membership, contact support@silversneakers.com or call customer service at 866-584-7389, Monday through Friday, 8:00 am  8:00 pm. Eligibility can be checked online at https://tools.silversneakers.com/Eligibility/CheckEligibility?_ga=2.214455639.1331131524.1576513917-486327298.1576513917',NULL,'https://www.silversneakers.com/',NULL,'support@silversneakers.com',NULL,'1311468932506646',NULL,NULL,NULL,NULL,NULL,'951896497474314',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(321,1012491329529162,'Nothing Forgotten',NULL,NULL,'Bereavement Care Service that respectfully and carefully facilitates the dissolution, relocation, donation, storage and other appropriate management of the treasured belongings of loved ones who have passed on. Also assists non-bereaved clients and individuals who are going to an assisted living center or nursing home.','785836677337472','www.nothingforgotteninc.com',NULL,'info@nothingforgotteninc.com',NULL,'917020988773351,656941113483002,1294594151119548',NULL,NULL,NULL,NULL,NULL,'764580363283286',NULL,NULL,NULL,'1153142435839174',NULL,NULL,NULL),(322,949049494480930,'NYC Housing Connect Lottery',NULL,538730903843188,'Create an online account, search & select housing, enter housing information, and apply to lottery online. Housing in all 5 boroughs.','659515711242608','https://a806-housingconnect.nyc.gov/nyclottery/lottery.html',NULL,NULL,NULL,'632606603203298',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'955971997114080',NULL,NULL,NULL),(323,970737263301233,'Integrity Senior Services Counseling','ISS',NULL,'In-home counseling, accepts Medicaid and Medicare. ','641535127444773,1248664167371555','http://www.integrityseniorservices.com/Services.html',NULL,'info@integrityseniorservices.com',NULL,'1000576764179618,784392560809728',NULL,NULL,NULL,NULL,NULL,'1269788011979782',NULL,NULL,NULL,'889256005961394,957040097525162',NULL,NULL,NULL),(324,972456099283146,'Benefits for Low Income Older Veterans',NULL,1295012969068938,'From their website: \"For Veterans age 65 or older, or totally and permanently disabled, or a patient in a nursing home receiving skilled nursing care, or receiving Social Security Disability Insurance, or receiving Supplemental Security Income. Veterans can apply for the Veteran Pension by filling out and submitting the VAs Application for Pension Form (VA Form 21P-527EZ ) online.\"','575196641931899','https://www.vets.gov/pension/application/527EZ/introduction',NULL,NULL,NULL,'1217112216075611,775024125555217',NULL,NULL,NULL,NULL,NULL,'847865874728097',NULL,NULL,NULL,'903689394971972',NULL,NULL,NULL),(325,977076913058114,'Health for Life Program','HeLP',1260510841196867,'From Website: The free Health for Life Program (HeLP) offers you a enhance your quality of life by showing you how to manage your chronic health conditions, such as high blood pressure, pain, depression and diabetes. Youll learn about managing your medications correctly and improving communication with health care providers and family. The program takes place for two-and-a-half hours a week for six weeks at community-based locations such as houses of worship, senior centers, nonprofit organizations and housing developments throughout Westchester.\n\nPosted 11/19',NULL,'seniorcitizens.westchestergov.com/nutrition-health-safety/health-for-life-program',NULL,'mqcq@westchestergov.com',NULL,'1258526581948590',NULL,NULL,NULL,NULL,NULL,'777730516598468',NULL,'961002207208309',NULL,NULL,NULL,NULL,NULL),(326,976238227660785,'Encore Community Services-Shop & Escort',NULL,NULL,'**As of May 2019: There is a wait list for this program** The program is run with a small number of volunteers. Requirements: for seniors 60 and up, who are not home-bound, and lack assistance and/or formal support (home health aide or family). The use of a wheelchair, walker, or cane is okay.','1174600638087225','http://encorecommunityservices.org/outreach-programs',NULL,NULL,NULL,'784392560809728,910515645454451',NULL,NULL,NULL,NULL,NULL,'1156561623394655',NULL,NULL,NULL,'854091596400759',NULL,NULL,NULL),(327,980285269693573,'Project C.A.R.T.',NULL,929828904477796,NULL,'973643028272240,784828668663007',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1308884611777017',NULL,NULL,NULL,'1284694775771908,1284694775771908',NULL,NULL,NULL),(328,998151779788022,'Neighbor to Neighbor','N2N',850259382865797,'Neighbor-to-Neighbor program (or N2N), offers the help of our carefully selected neighborhood volunteers. N2N is our outreach to neighbors who may need assistance with errands or wish to have company for a walk in the park or a game of Scrabble. Our N2N volunteers are also able to serve as an escort for a trip to the doctor or the grocery store. Must be a member to use services. Become a member by calling or filling out registration form online. Catchment area is W. 96th to W. 110th Street, between Riverside Drive and Central Park West.','561148298054173','https://www.bloominplace.org/neighbor-to-neighbor.html',NULL,NULL,NULL,'910515645454451',NULL,NULL,NULL,NULL,NULL,'858808717862931',NULL,NULL,NULL,'617201724489692',NULL,NULL,NULL),(329,997384431827648,'Community Health Advocates',NULL,979198190503025,'From their website: \nWe help New Yorkers understand how to use their health insurance, resolve medical billing and debt issues, dispute coverage denials and eligibility determinations, get the most from their coverage (get prior authorizations, access specialists, and out-of-network services when needed), access affordable health care services and hospital and prescription financial assistance programs, understand how small business owners can offer health insurance and get health insurance tax credits, understand the health insurance tax credit reconciliation process.','1159983662799826','http://www.communityhealthadvocates.org/',NULL,'cha@cssny.org',NULL,'669623054114376,804710974459801,930870677737263,775024125555217',NULL,NULL,NULL,NULL,NULL,'1234327436511098',NULL,NULL,NULL,'645570276764240',NULL,NULL,NULL),(330,1005399245667696,'Pet Group',NULL,960197992960780,'Monthly pet group, usually dogs, sometimes cats, birds, turtles. 1 hour group with snacks, do not have to be members. Play with animals and discuss animals. Date changes each month, call for date in advance and to RSVP. ','1107802251236437','www.carterburdennetwork.org',NULL,NULL,NULL,'1009228235801069',NULL,NULL,NULL,NULL,NULL,'798812684314671',NULL,NULL,NULL,'674674961934925',NULL,NULL,NULL),(331,1012363399092830,'Dana Reisch, LMSW, CMC',NULL,1290516279271741,'Providing care management and psychotherapy resources\n\nUpdated 11/19',NULL,'www.conciergehealthny.com ',NULL,'dana.reisch@conciergehealthny.com',NULL,'787866332874000',NULL,NULL,'Private pay/no sliding scale',NULL,NULL,'1128138006187300',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(332,1014486277073254,'Seniors Helping Seniors Northern Westchester/Putnam',NULL,NULL,'In-home services that match seniors who want to help with seniors who are looking for help.\n\nPosted 10/19',NULL,'https://seniorcarenorthwestchester.com/',NULL,'SHS.DebraLang@gmail.com',NULL,'1174744908232674,1209400832429047',NULL,NULL,NULL,NULL,NULL,'1055077467037842',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(333,1018081544703448,'Retired & Senior Volunteer Program','RSVP',979198190503025,'From their website: \"Matches the skills and interests of adults 55+ with volunteer opportunities at New York City nonprofit organizations and licensed health care facilities.With nearly 3,000 volunteers, RSVP in New York City is one of the largest senior volunteer programs in the nation.\"','881068512672918','www.cssny.org/pages/FAQ-for-volunteers',NULL,NULL,NULL,'669632099553613',NULL,NULL,NULL,NULL,NULL,'1304543105871368',NULL,NULL,NULL,'955971997114080',NULL,NULL,NULL),(334,963966019084060,'ComForCare',NULL,NULL,'ComForCare NYC offers a unique home care service by hiring and training non-traditional caregivers.  Our caregivers are artists and performing artists, healthcare professionals, nursing and graduate students, and individuals who desire a rewarding \"encore\" or second career.  Our mission is to create meaningful connections between our client and caregivers, along with providing the necessary basic support.  For clients living with dementia or cognitive impairment, we offer free in-home assessments and ongoing support through our partner, Inspired Memory Care (IMC).  IMC is an expert consulting and education company specializing in memory care.  Our only minimum requirement for services is a 4-hour visit, once per week.  As of 2019, our rates are $28-35 per hour.  Our service includes all of Manhattan, northern Brooklyn, Riverdale, and much of Queens. ','1294037843987563','www.ComForCareNYC.com ',NULL,'nyc@comforcare.com',NULL,'910515645454451,1324596060194399',NULL,NULL,NULL,NULL,NULL,'601515975944532',NULL,NULL,NULL,'612259377994849',NULL,NULL,NULL),(335,975722961848397,'Visions-Selis Manor Technology Training',NULL,NULL,'An adapted center that offers an array of services for blind youth and adults. They also offer technology training onsite. There is an in-person intake that takes about 45 minutes. The iPhone and technology training is free of charge. Call to make an appointment for the intake. Selis Manor is open Monday 9am to 7pm, Tuesday 9am to 7:30pm, Wednesday 9am to 7pm, Thursday 9am to 7pm and Friday 9am to 5pm. ','646191607198056','https://www.visionsvcb.org/locations-2/visions-at-selis-manor/',NULL,NULL,NULL,'821861174676380',NULL,NULL,NULL,NULL,NULL,'1298035643432214',NULL,NULL,NULL,'838672917666836',NULL,NULL,NULL),(336,981054173201560,'Kosher Meals for the Homebound',NULL,617910248814061,'Frozen meals delivered to seniors who are homebound and kosher and reside on the upper east side and upper west side of Manhattan. Meals are delivered once a week. Face to face delivery (senior must be home to receive delivery). ','872398746454681','www.dorotusa.org',NULL,NULL,NULL,'830617726149111',NULL,NULL,NULL,NULL,NULL,'637042726567005',NULL,NULL,'1272863013225282','801326186311509',NULL,NULL,NULL),(337,984041615403419,'The Knolls',NULL,591127807689943,'Non-profit retirement community in Valhalla, NY. Amenities include: 30 acres of property, apartment-style living, health/wellness resources including regular doctor visits, special educational/recreational events.\n\nPosted 11/19 ','1128494164406363','theknolls.org',NULL,NULL,NULL,'1281533535852091',NULL,NULL,NULL,NULL,NULL,'622996181384529',NULL,NULL,NULL,'1235319083099402',NULL,NULL,NULL),(338,1004269911149631,'Memory Care at Phelps Hospital',NULL,887752674926237,'This program centers seniors who are cognitively in-tact but would like to stimulate their brains with education, information, mental exercises, and stimulating activities. \n\nPosted 11/19','817374827138799',NULL,NULL,'vitality@northwell.edu',NULL,'853236516099165',NULL,NULL,'No fees',NULL,NULL,'1226053434663014',NULL,NULL,NULL,'1219392319914046',NULL,NULL,NULL),(339,1018060635204154,'Senior Citizen Transportation',NULL,779805618185923,'From their website: \"Serves seniors who are 60 or over to help them stay mobile. Depending on a persons needs, we offer individual car service or ambulette trips to medical and other essential appointments and services, group van shuttle trips to senior centers and group bus trips for educational events, recreation or shopping throughout Brooklyn.\"','869437581538741','www.jccgci.org/our-services/senior-support-systems/senior-transportation-services/',NULL,'SeniorTrips@JCCGCI.org',NULL,'1261747089209037,1048629387183766',NULL,NULL,NULL,NULL,NULL,'634124727626866',NULL,NULL,NULL,'1265939883950171',NULL,NULL,NULL),(340,1013782748708059,'Enriched Housing Programs',NULL,1299053507788813,'\"The programs frail elderly participants receive such services as assistance with personal hygiene, shopping and meals and with medical appointments and other personal needs.\"','930752220056199','http://nyfsc.wpengine.com/housing-services/enriched-housing-programs/',NULL,NULL,NULL,'632606603203298',NULL,NULL,NULL,NULL,NULL,'961316513459220',NULL,NULL,NULL,'680116778539120',NULL,NULL,NULL),(341,1019842691268144,'International Low Vision Support Group\n\n',NULL,NULL,'From their website: \"Free low-vision telephone support group, year-round program of monthly group support sessions held over the telephone. It is designed for low vision seniors in the United States who have no access to the Internet or cannot attend a live support group. A session typically includes a brief update on recent research and developments, followed by listening to and discussing the current months recorded ILVSG presentation. See the Schedule of Presentations. Each session will include the moderator and an average of 8-12 registered members. Members who wish to do so may share their phone numbers with others in the group for personal communication outside of the scheduled sessions. This aspect of the program is optional, with phone numbers otherwise remaining totally private.\"','566266798182272','http://www.mdsupport.org/support/telesupport/',NULL,NULL,NULL,'975020390374256,821861174676380',NULL,NULL,NULL,NULL,NULL,'836864067654459',NULL,NULL,NULL,'1255874882443712',NULL,NULL,NULL),(342,1021042715591141,'Goddard Riverside Senior Center',NULL,NULL,'On-site classes, bingo, group trips, breakfast, lunch, Broadway shows, baseball games, movies, etc.; show ID for short intake process in person, pick up monthly schedules at center, printed at the end of each month.','621483052059786','https://www.goddard.org/grcc/programs/olderadults/seniorcenter/',NULL,NULL,NULL,'975020390374256,1299575089394687,1137020311225588',NULL,NULL,NULL,NULL,NULL,'656053629631443',NULL,NULL,NULL,'1291417137894411',NULL,NULL,NULL),(343,1026935441827200,'Goodwill Industries of Greater New York & Northern New Jersey',NULL,NULL,'They can pick up donations of the following items:\nArts/crafts, automotive, books, media, clothing/personal accessories, electronics, kitchen items, health care, musical instruments, footwear, sports equipment, and toys/games. Call to confirm. West side location: 157 West 72nd Street, (212) 799-2723; east side location: 1114 1st Avenue, (212) 355-5206. ','885139826284948,923381638372747','http://goodwillnynj.org',NULL,'info@goodwillnynj.org',NULL,'796531679969625',NULL,NULL,NULL,NULL,NULL,'1271659781029151,1269690421322012',NULL,NULL,NULL,'1301442294583716,1178259965284475',NULL,NULL,NULL),(344,1028031377774559,'Supportive Housing Programs',NULL,923109536688861,'From their website: \"Provide safe, affordable homes for some of New York City\'s most vulnerable populations, including older adults, formerly homeless people and those with mental illness. Residents receive on-site services ranging from benefits assistance to mental health care to social activities that help ensure that individuals stay connected to their community. Four Manhattan buildings.\"','911424615909247','https://www.goddard.org/grcc/programs/housing/',NULL,NULL,NULL,'632606603203298',NULL,NULL,NULL,NULL,NULL,'1168708032347321',NULL,NULL,NULL,'735399226687979',NULL,NULL,NULL),(345,1034688500831787,'Right at Home: Central & Southern Westchester',NULL,569038408447893,'Right at Home Westchester offers senior care services in the comfort and familiarity of wherever you and your loved one call home. Our team tailors our care to your unique situation through a Custom Care Plan. Individualized elder care programs change as our clients\' needs change.\n\nPosted 10/19',NULL,'http://westchesterseniorcare.com',NULL,NULL,NULL,'1209400832429047',NULL,NULL,NULL,NULL,NULL,'684319794566975',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(346,1063182605278845,'Engaging Alzheimer\'s: Fostering Hope in a Time of Despair',NULL,818395223129575,'Whether youre a Professional Caregiver or a Family Member caring for a loved one, using best-practices in dementia care typically reduces stress for the caregiver and increases the well-being of the person with dementia.\n\nEngaging Alzheimer\'s proven strategies and distinctive approach have helped hundreds of families, as well as healthcare organizations to successfully navigate the many challenges in caring for someone with Alzheimers or a related dementia.',NULL,'http://www.engagingalzheimers.com/',NULL,NULL,NULL,'853236516099165',NULL,NULL,NULL,NULL,NULL,'1203101293367892',NULL,'1257432726339000',NULL,NULL,NULL,NULL,NULL),(347,1077341156049049,'Shira Ruskay Center-Holiday Programs in the Presence of Loss',NULL,1212127567201393,'From their website: The holidays can be a difficult time when experiencing the loss of a loved one. The Shira Ruskay Center offers three programs annually  Coping with the Empty Chair, Gathering the Generations in the Sukkah, and Lights in the Darkness  to provide assistance and comfort during those times.\nAll programs are facilitated by a Rabbi and a Social Worker, and are open to the public at no cost. These programs are offered at the JCC in Manhattan and can also be organized in your community (contact us for more information at (212) 632-4608).','817064838386609','https://jewishboard.org/about-us/programs-services/jewish-community-services/shira-ruskay-center/',NULL,NULL,NULL,'1200594795378183',NULL,NULL,NULL,NULL,NULL,'933399633089109',NULL,NULL,NULL,'812773064685081',NULL,NULL,NULL),(348,1090068972800338,'Helping Hands for the Disabled of NYC',NULL,NULL,'Provides escorting to appointments within the five boroughs of NYC to seniors who are disabled. One week\'s noticed is required in order to find an available volunteer. An application form can be found on their website at https://hhdnyc.org/members. Must provide proof of disability. Membership is $20 per year. Occasionally, seniors without a disability can utilize the service for $10/hour but it depends on their volunteer availability. Director: Alice Crespo. ','1161911553506036','www.hhdnyc.org/services-offered',NULL,'hhdfornyc@aol.com',NULL,'910515645454451',NULL,NULL,NULL,NULL,NULL,'973048330116539',NULL,NULL,NULL,'1117525606695978',NULL,NULL,NULL),(349,1094294586712871,'Lean on We',NULL,NULL,'From website: LeanOnWe helps you take control of the home care that your loved ones need. We\'ll search our database of...home health aides to identify suitable candidates.\n\nPosted 10/19',NULL,'https://leanonwe.com',NULL,NULL,NULL,'1209400832429047',NULL,NULL,NULL,NULL,NULL,'1202655158822384',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(350,1061527495042237,'Integrity Senior Services Case Management','ISS',NULL,'From their website: \"Provides case managers for geriatric and disabled clients. Case managers are health and human service specialists that assist the elderly and disabled in attaining their maximum functional potential. Assessing the needs of their clients, case managers plan for and facilitate the coordination of health and human services to optimize quality of life and overall health outcomes. Case managers plan and manage the everyday, long-term care of their clients by working in collaboration with family members, guardians, and other health care professionals. In addition to facilitating care services, case management also includes but is not limited to advocacy, education, resource management, and communication on their clients behalf. Case managers assess problems and provide solutions that enhance the quality of life for their clients.\" Also provides cleaning and de-cluttering services for clients through Supportive Cleaning Services. Serves the 5 boroughs and Nassau, Suffolk and Westchester counties.','641535127444773,1248664167371555','http://www.integrityseniorservices.com/Services.html#casemgt',NULL,NULL,NULL,'784392560809728,656941113483002,1294594151119548',NULL,NULL,NULL,NULL,NULL,'1269788011979782',NULL,NULL,NULL,'889256005961394,957040097525162',NULL,NULL,NULL),(351,1068692989341970,'New York Foundation for Senior Citizens Case Management',NULL,929828904477796,'They help coordinate home care, home delivered meals and other services for physically and mentally frail residents in Manhattan Districts 1 (TriBeCa, Financial District, Manhattan Civic Center, Battery Park City, South Street Seaport, Battery Park, City Hall Park), 2 (Greenwich Village-West Village, South Village, Washington Square Park, NoHo, SoHo, Little Italy), 3 (Lower East Side, East Village, Alphabet City, Chinatown, Two Bridges), 5 (Times Square, Herald Square, Midtown South, Murray Hill, Gramercy, Union Square), and 6 (Murray Hill, Sutton Place, Beekman Place, Turtle Bay, Tudor City, Gramercy, Kips Bay, Peter Cooper, Stuyvesant Park, Stuyvesant Town). Working to help seniors remain safe, healthy and independent within their own homes, Case Managers meet with seniors at home to determine their eligibility for services, and then arrange and monitor the delivery of services. There is no fee to the seniors who benefit from this program. Funded by DFTA.','1192388551570388','http://www.nyfsc.org/support-services/case-management-program/',NULL,'nyfscinc@aol.com',NULL,'784392560809728',NULL,NULL,NULL,NULL,NULL,'589127829325472',NULL,NULL,NULL,'1179892637853969',NULL,NULL,NULL),(352,1073254137157159,'SilverBills',NULL,NULL,'Personal bill paying services.\n\nPosted 10/19','1151472742702655','www.silverbills.com',NULL,NULL,NULL,'818994090477380,1258526581948590',NULL,NULL,NULL,NULL,NULL,'923113257284691,905809732344344',NULL,NULL,NULL,'955971997114080',NULL,NULL,NULL),(353,1088474245342263,'Henry Street Settlement Out-Patient Mental Health Services',NULL,621590574293234,'Psychiatrist on staff, takes referrals from the community. In an emergency, they will see someone immediately. No catchment area restrictions, individual must be able to travel to their offices. Hours are Monday, Tuesday and Friday 1-5 p.m. and Wednesday 9-5 p.m. Medicaid, Medicare and other third-party insurance providers are accepted. A sliding-scale fee is available for those ineligible for health insurance.','833962289133245','https://www.henrystreet.org/programs/primary-behaviorial-health/mental-health-services/out-patient-mental-health-services/?_ga=1.62102444.1291672894.1487193629',NULL,NULL,NULL,'1000576764179618',NULL,NULL,NULL,NULL,NULL,'1284965322356340',NULL,NULL,NULL,'763388653566204',NULL,NULL,NULL),(354,1088621444656423,'Harrison Community Services',NULL,1255368163438917,'The Town / Village of Harrison Department of Community Service programs include the Senior Safety Check, Senior Medical Transportation, Senior Taxi Vouchers and the Harrison Food Pantry. ln addition, Community Services provides information and referrals to other local services and government assistance agencies. You must be a Harrison resident to participate in Community Services Programs.\n\nPosted 10/19',NULL,'https://www.harrison-ny.gov/community-services',NULL,NULL,NULL,'1260794998607714',NULL,NULL,NULL,NULL,NULL,'631483991919220',NULL,'910733098945105',NULL,NULL,NULL,NULL,NULL),(355,1092487167368004,'Chefs for Seniors',NULL,NULL,'A professional chef visits a senior\'s home and prepares 10-12 fresh meals for the week during a two hour session. Custom meals that incorporate dietary restrictions available for an additional fee. \n\nPosted 11/19',NULL,'chefsforseniors.com/westchester-county-ny',NULL,NULL,NULL,'1252623387709832',NULL,NULL,'$99/Standard Package',NULL,NULL,'946044114777058',NULL,'1071920915775546',NULL,NULL,NULL,NULL,NULL),(356,1109362982511146,'Housing-Anti-Eviction',NULL,1303487432314987,'From their website: \"Empowers communities to advocate for tenant rights by providing information and trainings on tenants rights and partnering with neighborhood-based organizations that work to assist low-income residents and organize tenants in building-wide actions.\" MANHATTAN AND BROOKLYN TENANTS, CALL OUR INTAKE LINE FOR HELP: 212-417-3888, WEDNESDAY & FRIDAY, 2 pm  4:30 pm. BRONX TENANTS, CALL OUR INTAKE LINE FOR HELP: 212-417-3889, THURSDAY, 2 pm  5 pm.','731499650370942,1217859763170475','http://mobilizationforjustice.org/projects/neighborhood-preservation-project/',NULL,NULL,NULL,'632606603203298',NULL,NULL,NULL,NULL,NULL,'1213798608856801,1114624706826072',NULL,NULL,NULL,'908100479316573,908100479316573',NULL,NULL,NULL),(357,1050345041596883,'We Can Do It!',NULL,NULL,'Home cleaning service, price estimate is based on size of the apartment.','945515049623119','www.wecandoit.coop/',NULL,NULL,NULL,'656941113483002,1294594151119548',NULL,NULL,NULL,NULL,NULL,'1100778712020935',NULL,NULL,NULL,'879008158678370',NULL,NULL,NULL),(358,1066263438111374,'Boxwood Alliance',NULL,NULL,'Resources for aging in place in Northern Westchester. Information and referral available to organizations that provide hands-on services. \n\nUpdated 12/19','993272119067025','https://theboxwood.org/',NULL,'info@theboxwood.org',NULL,'808645273134339,1258526581948590',NULL,NULL,NULL,NULL,NULL,'1193938352010588',NULL,NULL,NULL,'774945924769791',NULL,NULL,NULL),(359,1064626459240121,'Marlena Books',NULL,NULL,'From their website: \"Meaningful leisure and cognitive stimulation in the form of reading, features mature content at an appropriate reading level in order for individuals to continue their love of reading while maintaining their dignity.\"','986076717425676','www.marlenabooks.com',NULL,'info@marlenabooks.com',NULL,'943955981947035,642511572093907,1248151266206446',NULL,NULL,NULL,NULL,NULL,'1155073786008965',NULL,NULL,NULL,'955971997114080',NULL,NULL,NULL),(360,1066778325819186,'Senior Law-Goldfarb Abrandt Salzman & Kutzin, LLP',NULL,NULL,'A resource site for seniors, caregivers, and professionals that provides info. on: elder law, Medicare, Medicaid, Medicaid planning, guardianship, estate planning, trusts, and the rights of the elderly and disabled. ','1118541487585825','www.seniorlaw.com',NULL,NULL,NULL,'785468758686103',NULL,NULL,NULL,NULL,NULL,'643939118374039',NULL,NULL,NULL,'797408101854424',NULL,NULL,NULL),(361,1080670404294287,'JM Journeys at The Jewish Museum',NULL,1276803301395536,NULL,'682665557016520',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1128515640697725',NULL,NULL,NULL,'941572564673458',NULL,NULL,NULL),(362,1087963110530465,'Housing Works Bookstore Caf',NULL,597618074285488,'Accepts donations of books, DVDs, CDs, LPs, and textbooks (if less than 1 year old) in saleable condition (drop-off)','842942376713289','https://www.housingworks.org/locations/bookstore-caf',NULL,NULL,NULL,'796531679969625',NULL,NULL,NULL,NULL,NULL,'1094802474701755',NULL,NULL,NULL,'1114497745056986',NULL,NULL,NULL),(363,1107249340978249,'One Shot Deal',NULL,1270724872915789,'From their website: \"A  public assistance program that pays rent arrears if you can prove that you can pay the current and future rent. One-time payment from the Human Resources Administration (HRA) to pay back rent to avoid an eviction. To qualify, you must have a source of income other than public assistance such as employment or SSI. If you receive on-going public assistance or are applying for on-going public assistance and owe back rent you may also qualify for applicant arrears or duplicate shelter allowance. \"','610396374228362','https://www1.nyc.gov/nyc-resources/service/1205/one-shot-deal-short-term-emergency-assistance',NULL,NULL,NULL,'632606603203298',NULL,NULL,NULL,NULL,NULL,'690005646305529',NULL,NULL,NULL,'955971997114080',NULL,NULL,NULL),(364,1103168281653747,'Home Assessment Program',NULL,1215923997960946,'Geared towards seniors and others to ensure their home environment is as safe as possible. Conducted by a licensed occupational therapist, the program was developed to determine the accessibility and safety of the homes of residents. By finding and removing obstacles, and checking for potential dangers like tripping hazards residents can stay safe in their homes for longer periods of timeespecially those who live alone.\n\nPosted 11/19',NULL,'www.burke.org/outpatient/services/occupational-therapy/home-safety-assessment',NULL,NULL,NULL,'808645273134339',NULL,NULL,NULL,NULL,NULL,'739909893666659',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(365,1106906665297264,'Hearing Loss Association of America-NYC',NULL,1184355160704972,'Monthly meetings with speakers, NYC Walk4Hearing.','611465990733201','http://www.hearinglossnyc.org/',NULL,NULL,NULL,'927475609486366',NULL,NULL,NULL,NULL,NULL,'981997316960259',NULL,NULL,NULL,'1180859359074125',NULL,NULL,NULL),(366,1111403286785411,'Senior Health and Consultation Center',NULL,796026064627918,'Provides adults over 60 with affordable primary care and mental health services with a team of psychiatrists, psychiatric social workers, medical doctors and home health aids. Services are provided at the Center. When needed, staff makes home visits. Fees are on a sliding scale. Accept Medicare, Medicaid, and supplemental insurance. Call for eligibility. ','813001250720900','http://www.greenwichhouse.org/senior_health/index',NULL,'lgiuliano@greenwichhouse.org',NULL,'1060789001254366,1000576764179618',NULL,NULL,NULL,NULL,NULL,'1067289555851807',NULL,NULL,NULL,'912776048789701',NULL,NULL,NULL),(367,1061291481423864,'Greenwich House Senior Centers',NULL,796026064627918,'Four senior centers: serve breakfast and lunch daily, offering activities such as: poetry and cinematography clubs, exercise classes (yoga and tai chi), language instruction, health lectures, painting and art classes, movies and card playing. Birthday celebrations, day trips to plays, museums, and more on a monthly basis. The staff can assist seniors in obtaining special services, benefits, entitlements, and referrals to remain independent. Call for eligibility and nearest location. ','1141607429542130','http://www.greenwichhouse.org/senior_center/index',NULL,'info@greenwichhouse.org',NULL,'1119821956066449,956181681492566,869870722824619,1311468932506646,775024125555217,1299575089394687',NULL,NULL,NULL,NULL,NULL,'948635916005516',NULL,NULL,NULL,'624190706027718',NULL,NULL,NULL),(368,1057390879186620,'Alzheimer\'s and Dementia Care, LLC',NULL,NULL,'Service areas are Fairfield and New Haven counties in Connecticut and Westchester, New York.\n\nPosted 10/19',NULL,'http://www.alzdementiacare.com',NULL,NULL,NULL,'1209400832429047,853236516099165',NULL,NULL,NULL,NULL,NULL,'654042501298642',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(369,1060912758231579,'Doctors on Call',NULL,NULL,'Home visits are available 7 days a week, 8:00 am  7:00 pm. Serves five boroughs of New York City, Long Island, and Lower Westchester. Upon scheduling your first appointment, Doctors on Call customer service will inform you of any deductible and/or co-payment which may apply. Medicare may require you to pay a co-payment/deductible. A medical provider will then visit your home at the scheduled day and time. Prepare all your medications, vitamins, home remedies, and prescriptions; copies of medical logs and test results; any hospital discharge papers and patient summaries. During the initial visit, a comprehensive physical examination and include any necessary diagnostic and medical testing including blood work, EKGs, x-rays, ultrasounds, and ECHOs will be performed. A customer service representative is available Monday to Friday, 8:00 am to 6:00 pm.','1183283614648112','https://doctorsoncallnyc.com/',NULL,NULL,NULL,'821933984736558,1060789001254366',NULL,NULL,NULL,NULL,NULL,'894087961872425',NULL,NULL,NULL,'759884246631330',NULL,NULL,NULL),(370,1066497640168657,'Response Link',NULL,NULL,'Personal emergency response and safety systems.','875669545190590','https://www.responselink.com',NULL,NULL,NULL,'913198060459802,949152871495532',NULL,NULL,NULL,NULL,NULL,'785603674665239',NULL,NULL,NULL,'1214115814960131',NULL,NULL,NULL),(371,1063459575997908,'Home Modifications Program',NULL,827409210356131,'Call I&R to do an intake in order to use their free service to provide and install grab bars, stair lifts, ramps, etc. for families caring for disabled individuals.','1160012504793222','www.adaptcommunitynetwork.org',NULL,NULL,NULL,'895588724473906,913198060459802,949152871495532',NULL,NULL,NULL,NULL,NULL,'953129348295807',NULL,NULL,NULL,'1120080866522434',NULL,NULL,NULL),(372,1129939373114087,'Memory Minyan',NULL,832749361091520,'From their website: \"The worlds first dementia-friendly Shabbat prayer and Shabbat meal experience in a synagogue. Caregivers can invite old friends to worship and share a meal in a space they have shared for years.\" (914) 419-7219','1192824025321946','https://beyondmemory.org/memory-minyan/',NULL,NULL,NULL,'853236516099165,943955981947035,642511572093907,1248151266206446',NULL,NULL,NULL,NULL,NULL,'748856120890280',NULL,NULL,NULL,'1177660468233004',NULL,NULL,NULL),(373,1134697933733017,'Access-A-Ride Paratransit Service','AAR',1236593696201843,'Fares are the same as full fare on public transit. Show the driver your AAR MetroCard/ID and pay the exact fare as you board the vehicle. Personal Care Attendant (PCA) ride free of charge. Provides service in NYC and within a three-quarter-of-a-mile corridor beyond fixed-route service across the NYC borderline to nearby areas of Nassau and Westchester counties. Application process: It may take up to 21 days to process your application after your in-person assessment. A subscription service is available if you travel to the same places at the same time of day at least once each week. You are eligible for Access-A-Ride if you have a disability that prevents you from using the public buses or subways. We will review your application, any medical documentation you provide, and ask you to undergo an individualized assessment. During the assessment, we will ask you to demonstrate whether you can: go up or down subway stairs; travel to a subway or bus station; get on, ride, and exit a subway or bus; and ride or navigate the bus or subway system independently. Evaluating your ability to do these things will help us determine if you are eligible for conditional or full Access-A-Ride services. We will also evaluate your gait, balance, endurance, strength, range of motion, and, if applicable, assess whether you have any cognitive or psychological conditions that may prevent you from using the bus or subway. The price is the same as full fare on public transportation.','1230715117809400','http://web.mta.info/nyct/paratran/guide.htm',NULL,NULL,NULL,'1048629387183766',NULL,NULL,NULL,NULL,NULL,'842939708242492',NULL,NULL,NULL,'903689394971972',NULL,NULL,NULL),(374,1066576182461485,'Atria Assisted Living',NULL,553501090665356,'Assisted living facility with studio, one bedroom, and two bedroom units. Multiple dining venues, including formal and casual restaurants serving gourmet cuisine (not Kosher) with full table service and a caf offering lighter fare, 24-hour doorman, concierge services, city and river views, rooftop terrace and fitness center, penthouse salon and spa, library, physical therapy available on-site, pet-friendly (allowed with a fee). Alzheimers Unit at a different location, personal care available (different levels of care), medication management also available.','637170263897132','https://www.atriaseniorliving.com/retirement-communities/atria-west-86/',NULL,NULL,NULL,'1149247622463332,1157747719793788',NULL,NULL,NULL,NULL,NULL,'589069927288045',NULL,NULL,NULL,'736904742039377',NULL,NULL,NULL),(375,1078136644723933,'Affordable Housing',NULL,1299053507788813,'Provide social services to help residents effectively age in place. They provide an apartment-based lifestyle for well, frail and handicapped seniors  complete with the specialized services that many require.','773444037771857','http://www.nyfsc.org/housing-services/affordable-housing/',NULL,NULL,NULL,'632606603203298',NULL,NULL,NULL,NULL,NULL,'1109654065242959',NULL,NULL,NULL,'903689394971972',NULL,NULL,NULL),(376,1095268672603108,'Educational Alliance Career Connect',NULL,781836024471454,NULL,'587659450099991',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'960980821578445',NULL,NULL,NULL,'855425134285440',NULL,NULL,NULL),(377,1102354014602661,'Housing Assistance For Veterans',NULL,1295012969068938,'Through public housing authorities, HUD provides rental assistance vouchers for privately owned housing to Veterans who are eligible for VA health care services and are experiencing homelessness. VA case managers may connect these Veterans with support services such as health care, mental health treatment and substance use counseling to help them in their recovery process and with maintaining housing in the community. Among VA homeless continuum of care programs, HUD-VASH enrolls the largest number and largest percentage of Veterans who have experienced long-term or repeated homelessness.\nEnhanced-Use Lease (EUL) Program: VA portfolio management tool that allows certain land and buildings to be leased to eligible private entities for approved supportive housing and related projects for homeless and at-risk Veterans. In addition to supportive housing, VAs EUL partners often provide Veterans with job training, financial management, haircuts, computer and laundry facilities, fitness centers and other services. Veterans and their families are prioritized for EUL developments, which are also convenient to VA health care facilities.\n\nPosted 11/19','575196641931899','https://www.va.gov/homeless/housing.asp',NULL,NULL,NULL,'1217112216075611,632606603203298',NULL,NULL,NULL,NULL,NULL,'825569529745946',NULL,NULL,NULL,'903689394971972',NULL,NULL,NULL),(378,1107517585026390,'Sage Friendly Visiting Program',NULL,1202577900100445,'\"Helps alleviate isolation and reconnect LGBT elders to their communities across generations; client is assigned a Sage care manager who makes a home visit to assess their needs, including the Friendly Visiting program. If interested and appropriate, they are assigned a Friendly Visiting volunteer. Commit to spend at least one year visiting a friend at home once a week. SAGE clients are LGBT and over 60 (over 50 if they are transgender, a veteran, or living with HIV).\" All boroughs except Staten Island. ','908721052299840','www.sageusa.org/friendlyvisitorprogram',NULL,NULL,NULL,'969672981978469',NULL,NULL,NULL,NULL,NULL,'950651487644294',NULL,NULL,NULL,'832417426130330',NULL,NULL,NULL),(379,1113339829525706,'CityMeals Friendly Visiting',NULL,783887432172900,NULL,'1163679734692717',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'894968669101358',NULL,NULL,NULL,'1137742849854717',NULL,NULL,NULL),(380,1119672043446510,'Sue Groppe',NULL,905957020671664,'From website: Geriatric Care Manager Sue Groppe provides individualized professional services to families dealing with the challenges of providing care to elderly loved ones, especially when it is over long dis