871,'From their website: \"Senior owners of private homes, condos, co-ops and renters, with consent of and after attempts to enlist their landlords, are benefiting from free home maintenance and repair services.  Offered to individuals with limited finances, these services include minor plumbing, gutter-cleaning, masonry, electrical, carpentry, caulking, weather-stripping, home readiness for winter and summer, and installing smoke detectors, crime prevention devices, grab bars, as well as some emergency services. Also offers free home safety audits for seniors by the home repair staff who check for, identify and correct safety hazards in their homes.\"','1192388551570388','http://www.nyfsc.org/support-services/repair-safety-services/',NULL,NULL,NULL,'1070189534488260',NULL,NULL,NULL,NULL,NULL,'576410874144939',NULL,NULL,NULL,'1179892637853969',NULL,NULL,NULL),(393,1090033410306276,'SeniorTech NYC',NULL,724662437776878,'From their website: \"Teaching those over 50 how to ease into the world of technology, multi-media devices and computers. Register online or on the phone. Classes are held in the Multimedia Room on LevelL2 at the JCC unless otherwise specified. All registrationis on a first-come,first-served basis. JCC members receive a discount.\" Most classes  are one-day sessions and cost $15-$25.00. ','1312695594585888','https://jccmanhattan.org/programs/seniortech-nyc-one-one-all-devices-1?utm_source=60Plus&utm_medium=11-5-19&utm_campaign=SeniorTechF20',NULL,NULL,NULL,'1137020311225588',NULL,NULL,NULL,NULL,NULL,'906124092352617',NULL,NULL,NULL,'809698659267160',NULL,NULL,NULL),(394,1093514835093035,'NORC at Franklin Plaza Transportation Program',NULL,1299477450227528,'From their website: \"Only for residents of Union Settlement NORC (Naturally Occurring Retirement Community) at Franklin Plaza: provides East Harlem seniors with an array of trips for necessities, such as visiting the pharmacy or the bank, and group recreational excursions. The program enhances many