related neurocognitive disorder, independent in activities of daily living, 60 years of age or older. Meet with staff before admission to the \"Beginnings\" program. During initial meeting, potential members and their families have the opportunity to discuss \"Beginnings\" with group leaders to ensure the program will be a mutual fit. 11 am-2 pm Tuesdays and Thursdays.\" Call to confirm dates and times.  ','672103964786737','http://renewalcare.org/services/social-programs/',NULL,NULL,NULL,'943955981947035,642511572093907,1248151266206446',NULL,NULL,NULL,NULL,NULL,'772011305196605',NULL,NULL,NULL,'837527037278398',NULL,NULL,NULL),(398,1117862118489759,'Richard L. Menschel Education Center',NULL,905326057005957,'Education classes relating to health (on-site & online webinars); Public & Patient Education (free programs & lectures), exercise classes, workshops, education & support programs; Greenberg Academy for Successful Aging (free lectures, exercise classes, workshops), at multiple locations in Manhattan and on demand webinars on website.','868173819991970','hss.edu/pped',NULL,'wimmerm@hss.edu',NULL,'1060789001254366,804710974459801',NULL,NULL,NULL,NULL,NULL,'633080382906941',NULL,NULL,NULL,'821308674757836',NULL,NULL,NULL),(399,1119307712797759,'Night Care',NULL,1139716345357307,'From their website: \"A safe, compassionate place for people with Alzheimers disease and related dementias to spend the night, so family members can have much-needed overnight relief.\" ','668507123937673','https://jewishhome.org/our-services/adult-day-health-care-2/',NULL,NULL,NULL,'943955981947035,642511572093907,1248151266206446',NULL,NULL,NULL,NULL,NULL,'1105065196815752',NULL,NULL,NULL,'746735676880343',NULL,NULL,NULL),(400,1124735196190933,'Karpoff Affiliates, Inc.-Senior Move Manager & Real Estate Broker',NULL,NULL,'Senior move manager and real estate broker, Marilyn Karpoff (founder and CEO). A full-service real estate company that specializes in both residential and commercial sal