ter. Line is open Monday-Friday, 9:00 am-5:00 pm. Leave a message and an intake worker will call back between those hours. Only leave name and phone # on message, do not leave anonymous info. or client info. If calling after 5:00 pm, call Safe Horizon (212) 577-7777 (for victims of crime and abuse).','962950961587263','https://www1.nyc.gov/site/dfta/services/elder-abuse-crime.page',NULL,NULL,NULL,'617361975501329',NULL,NULL,NULL,NULL,NULL,'1094435385725307',NULL,NULL,NULL,'1091732696488921',NULL,NULL,NULL),(423,1168278429230315,'Lifeforce in Later Years','LiLY',NULL,'Morningside Village volunteers & West Harlem volunteers escort seniors to and from medical appointments and shopping help (catchment area: W.105th Street, Riverside Drive, W. 122nd Street, & Morningside Drive OR between Riverside Drive and Convent Avenue, from W. 123rd Street to W. 135th Street).','1010634024590412','http://lifeforce-in-later-years.org',NULL,NULL,NULL,'910515645454451',NULL,NULL,NULL,NULL,NULL,'1061408127915601',NULL,NULL,NULL,'855652185568285',NULL,NULL,NULL),(424,1129429578221496,'Selfhelp Queens North Case Management',NULL,685028959367331,'Case management and Friendly Visiting serving seniors in College Point, Bayside, Whitestone, and Flushing, Queens.','946178298934653','www.selfhelp.net',NULL,NULL,NULL,'981685343230150,969672981978469,784392560809728',NULL,NULL,NULL,NULL,NULL,'1110385106581796',NULL,NULL,NULL,'1186852906133131',NULL,NULL,NULL),(425,1141987247581089,'David Glasser, Esq. ',NULL,1252378773278748,'Elder law attorney. No voicemail box. \nPosted 10/19','1099317967582149','https://www.kblaw.com/',NULL,NULL,NULL,'885600197309781',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'927057286685811',NULL,NULL,NULL),(426,1145748128914250,'JCC Senior Lounge ',NULL,NULL,'Would you like a place to catch up with friends, socialize, relax between programs, or meet fellow 60+ community members? Come to our Senior Lounge for an afternoon of conversation, comfortable chairs, and complimentary coffee and tea. Drop by, drop in, or stay for the entire session. No registration is required. Free of charge to members and to the public. Mondays from November 11 through December 30, 2019 at 1:00-04:00 pm.',NULL,'https://jccmanhattan.org/programs/senior-lounge?utm_source=60Plus&utm_medium=email-11-2-19&utm_campaign=seniorloungef20',NULL,'info@jccmanhattan.org',NULL,'1299575089394687',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(427,1148416635808831,'R.A.I.N. Inc. Social Services','Regional Aid for Interim Needs',1237041489023557,'From their website: \"A multi-social service agency offering a myriad of services with a focus on the provision of continuum of care that includes a range of services for seniors and people with disabilities.  R.A.I.N. has eleven Bronx based and one Manhattan based full-service neighborhood senior centers, friendly visiting, home-delivered meals to homebound elderly, transportation services, assistance with benefits and entitlements, case management and elder abuse services, and Cucina Dolores, a community-based mobile meals program for homeless and hungry persons in the South Bronx in collaboration with the Bob and Dolores Hope Foundation. R.A.I.N.s commitment to the elderly also includes the sponsorship of two residential housing projects providing apartments for low-income seniors. R.A.I.N.s affiliated Home Health Care Program provides in-home attendant and personal care services for elderly, disabled and homebound individuals of any age. Serves community districts 7-12.\"','856148060589960','https://www.raininc.org',NULL,'info@raininc.org',NULL,'784392560809728,1048629387183766,830617726149111,775024125555217,969672981978469,634570173416697',NULL,NULL,NULL,NULL,NULL,'940025562772061',NULL,NULL,NULL,'918692831732158',NULL,NULL,NULL),(428,1150218177163134,'Sprint CapTel',NULL,1050877856522867,'No cost for phone or service. Requires hearing loss, internet access, and third party Certification Form signed by a doctor or an audiologist. Enables you to follow live captions of your phone calls. Includes choice of four phones, one-touch 24-hour support, no-cost installation and training. Your own phone can also be paired with Sprint Web CapTel on an iPad. Some phone models work without internet. Contact Ladi Dell\'aira at (347) 981-1195 or ladi.dellaira@sprint.com or call the number below. ',NULL,'www.sprintcaptel.com',NULL,'ladi.dellaira@sprint.com',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'961613698737700',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(429,1155205412613057,'Sirovich Center for Balanced Living',NULL,781836024471454,'From their website: \"An innovative center for older adults, 60+, arts, trips to museums, gardens, opera appreciation, short story discussion, writers and storytellers, public safety workshops, open tech lab, singing groups and concerts, meals onsite, free registration required (bring ID).\" ','564742220711597','www.edalliance.org',NULL,NULL,NULL,'1299575089394687',NULL,NULL,NULL,NULL,NULL,'896837821919114',NULL,NULL,NULL,'1102510485832658',NULL,NULL,NULL),(430,1155279974732807,'Upper East Side Thrift Shop',NULL,597618074285488,'From their website: \"Accepts clothing, shoes, books, furniture, and household items: Furniture in excellent condition, Clean apparel (in plastic garbage bags only), Accessories / shoes (boxed or bagged), Antiques, Art, Decorative items, Clean housewares (properly packed in boxes only), Jewelry, Lighting, Unusual finds, Clean rugs (up to 6\' x 9\' with occasional exceptions), Up to 4 boxes of books (24\" x 24\" box max), pick-up available for furniture, drop-off other items.\"','836161221805129','https://www.housingworks.org/locations/upper-east-side-thrift-shop-lex',NULL,NULL,NULL,'796531679969625',NULL,NULL,NULL,NULL,NULL,'785381637784339',NULL,NULL,NULL,'545540211397517',NULL,NULL,NULL),(431,1172430819139792,'Disposophobia',NULL,981078018121008,'\"Contents restoration management firm,\" Assists with de-cluttering or with extreme hoarding cases.','1049459846753377','disp.theplan.com',NULL,NULL,NULL,'656941113483002,1294594151119548',NULL,NULL,NULL,NULL,NULL,'833238021687378',NULL,NULL,NULL,'955971997114080',NULL,NULL,NULL),(432,1183723038408337,'Circle of Care','PSS',1304558048970027,'Support services for caregivers of seniors who are frail, chronically ill, or have memory loss. Support groups are available on the phone and in-person. ','835561221232887','https://pssusa.org/',NULL,'careinfo@pssusa.org',NULL,'943955981947035,642511572093907,1248151266206446,877451051471319',NULL,NULL,NULL,NULL,NULL,'1232693793553802',NULL,NULL,NULL,'1010477474135532',NULL,NULL,NULL),(433,1181805580091514,'Single Stop',NULL,923109536688861,'From their website: \"Housing Court, consumer issues, drafting a will, legal issues involving Social Security or disability. Monday, Wednesday, Thursday & Friday, 9 am  5 pm, Tuesday 9 am  6 pm. Call for an appointment or just walk in.\"','911424615909247','www.goddard.org/grcc/programs/singlestop/',NULL,NULL,NULL,'775024125555217,1080473071775397,785468758686103',NULL,NULL,NULL,NULL,NULL,'830342116391284',NULL,NULL,NULL,'735399226687979',NULL,NULL,NULL),(434,1189113237018242,'Flex Physical Therapy',NULL,NULL,'Therapist-owned physical therapy practice offering one-on-one patient care. Rehabilitation for general discomfort, injury, post-surgery or other conditions. Also offers hand and upper extremity physical therapy. Accepts Medicare and most insurances. In home physical therapy (as needed) is out-of-pocket. Staff includes professionals with backgrounds in oncology, women\'s health/pelvic floor health, and sports and fitness. Joel Giffin, PT, DPT, CHT.','688527544165377,911852996585160','https://flexptny.com/',NULL,'uws@flexptny.com',NULL,'911994732331817,1060789001254366,804710974459801',NULL,NULL,NULL,NULL,NULL,'1265504111539942',NULL,NULL,'598028347064172,902558075788766','964533507086015,778774751786400',NULL,NULL,NULL),(435,1147084205975419,'Project Lifesaver',NULL,1001687203013089,'This free program uses radio-frequency technology to find seniors who wander and safely return them home. It works through bracelets with special batteries the seniors wear on their wrists. Should someone become lost, specially trained and equipped county police officers can locate them by tracking a radio signal the bracelets transmit. \n\nTo be eligible a senior must: live in Westchester County, be dependent upon the person they live with, and have a tendency to wander. \n\nPosted 10/19',NULL,'https://seniorcitizens.westchestergov.com/project-lifesaver-program',NULL,NULL,NULL,'1133396357269256,853236516099165',NULL,NULL,NULL,NULL,NULL,'953499454354789',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(436,1144146399031754,'Cash Assistance',NULL,772084713101318,'\"Your family can get cash if you are in need. The funds come on a debit card that you can use at any ATM or store where EBT cards are accepted.\"','1155415203679238','https://access.nyc.gov/programs/cash-assistance/',NULL,NULL,NULL,'1080473071775397',NULL,NULL,NULL,NULL,NULL,'776697174992944',NULL,NULL,NULL,'955971997114080',NULL,NULL,NULL),(437,1147705615071897,'BronxWorks Senior Services',NULL,1248389670987541,'Senior centers, senior housing assistance program, minor repair program, elder abuse services, senior mental health programs, seniors homelessness prevention project; also has Single Stop Hotline; offers walk-in and telephone services to help Bronx residents resolve problems.Offices are staffed by skilled, compassionate professionals who are specialists in housing, government benefits, consumer rights, immigration, senior services, and other matters.All walk-in personnel speak both English and Spanish.','574635489323480','http://www.bronxworks.org/',NULL,NULL,NULL,'1000576764179618,1299575089394687,617361975501329,1070189534488260,775024125555217,632606603203298,634570173416697',NULL,NULL,NULL,NULL,NULL,'883164703652351',NULL,NULL,NULL,'1010565069679249',NULL,NULL,NULL),(438,1153448061575610,'Mental Health Program',NULL,827525452625081,'VNSW employs registered nurses with advanced psychiatric training. The nurses conduct home visits for assessment, evaluation, and development of a treatment plan. \n\nPosted 11/19',NULL,'www.vns.org/home-care-services/mental-health-home-care',NULL,'mentalhealth@vns.org',NULL,'871376605323560',NULL,NULL,NULL,NULL,NULL,'1150717829642233',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(439,1164516472526850,'Diana Singer',NULL,1086318888077882,'Diana assists older adults and their families with housing choices in Connecticut. There is no charge for her services--she is paid by facilities to which she refers. \n\nPosted 11/19',NULL,NULL,NULL,'diana@senior-living-choices.net',NULL,'618819454720928',NULL,NULL,NULL,NULL,NULL,'1224954904365931',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(440,1168651622416736,'Sinai Free Synagogue',NULL,604657247231584,'Kosher home-delivered meals for homebound individuals in Mt. Vernon, parts of Yonkers, New Rochelle, Eastchester, Pelham, Bronxville, Hartsdale and White Plains.\n\nPosted 10/19',NULL,'http://www.wjcs.com/senior-programs-in-mt.-vernon/',NULL,NULL,NULL,'1252623387709832',NULL,NULL,NULL,NULL,NULL,'1221250537563568',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(441,1176517928581962,'SCRIE Applications',NULL,561510100662143,'From their website: \"Helps those eligible stay in affordable housing by freezing their rent. Under this program, a property tax credit covers the difference between the actual rent amount and what you (the tenant) are responsible for paying at the frozen rate.\" ','939569956066267','www1.nyc.gov/site/rentfreeze/index.page',NULL,NULL,NULL,'775024125555217',NULL,NULL,NULL,NULL,NULL,'658514823314988',NULL,NULL,NULL,'1299601042782651',NULL,NULL,NULL),(442,1181470161325641,'DRIE Clinics',NULL,798994226105048,'Disability Rent Increase Exemption - (DRIE) Clinic\nDo you have a disability and need help with rent?\n-ARE YOU 18 YEARS OR OLDER?\n-ARE YOU RECEIVING DISABILITY-RELATED BENEFITS?\n-DO YOU PAY MORE THAN 1/3 OF YOUR INCOME TOWARDS RENT?\n-IS YOUR ANNUAL HOUSEHOLD INCOME $50,000 OR LESS?\nFIND OUT IF YOU ARE ELIGIBLE FOR DRIE, GET ASSISTANCE APPLYING OR RECERTIFYING; For an appointment or information, contact us.\nPlease let us know if you need a reasonable accommodation; necessary transportation will be provided.','1267609685792488','http://www.lenoxhill.org/legaladvocacy/',NULL,'DRIE@lenoxhill.org',NULL,'669623054114376,775024125555217',NULL,NULL,NULL,NULL,NULL,'1107297795302467',NULL,NULL,NULL,'870634650166451',NULL,NULL,NULL),(443,1181459905867825,'Legal/Social Work Elder Abuse Program','LEAP',1120414012913334,'From their website: \"Offers specially trained attorneys and social workers to identify, eliminate, and prevent abuse. This innovative team approach positions JASA as the go-to expert. LEAP staff provide legal assistance and social services directly to seniors, and also conduct comprehensive training for professionals, gatekeepers, and community members.\"','875912436812678,792071260366274,1195785480679036','www.jasa.org/community/legal-assistance',NULL,NULL,NULL,'785468758686103,617361975501329,1261747089209037,981685343230150',NULL,NULL,NULL,NULL,NULL,'1291266517439032',NULL,NULL,NULL,'837955669488262,577107505117577,1192151437389051',NULL,NULL,NULL),(444,1183381495912211,'Cancer Support Team',NULL,NULL,'From Website: \nThe Cancer Support Team (CST) is the only Westchester County-based nonprofit home care program, licensed by the New York State Department of Health, providing:\n\naccess to essential health care services,\nprofessional nursing,\nsocial work counseling,\ncase management and\nother supportive services\n*at not cost and without regard to insurance coverage to our patients and their families at any stage of the illness.\n\nPosted 10/19','1217106007448556','https://cancersupportteam.org/',NULL,'cst@cancersupportteam.org',NULL,'1184375293767958',NULL,NULL,NULL,NULL,NULL,'746108880512512',NULL,NULL,NULL,'585239224439197',NULL,NULL,NULL),(445,1193042326559791,'Samantha Fox Care Consulting',NULL,NULL,'A staff of private geriatric care managers. A bio-psychosocial and spiritual assessment will be completed during an initial home visit, which takes about an hour and fifteen minutes. It is often most beneficial if the client and a family member  or reliable source of information  can be present for a portion of the visit.\nAfter which, a Care Plan is completed with solutions to all of the identified challenges. Your Geriatric Care Manager then reviews the Care Plan with the client, their family and support systems.','1037868065351449','http://samanthafoxcare.com/',NULL,'Samantha@SamanthaFoxCare.com',NULL,'863555368755651',NULL,NULL,NULL,NULL,NULL,'1115075307162181',NULL,NULL,NULL,'1289820726513689',NULL,NULL,NULL),(446,1191469119701878,'Day/Evening Programs for Memory Impaired Seniors',NULL,1139716345357307,'TheDayprogram runs from 9:30 am to 2:30 pm, Monday through Saturday. TheEveningprogram is offeredfrom 2:30 pm to 7:00 pm, Monday through Friday. Six days a week in Manhattan and The Bronx, five days a week in Westchester. The program accepts most insurances, Medicaid (no long term care insurance). Certified Nursing Assistants supervise programs and meals are provided. ','1222768164489701,1241863926704431','https://jewishhome.org/our-services/adult-day-health-care-2/',NULL,NULL,NULL,'1106100275196851,943955981947035,642511572093907,1248151266206446',NULL,NULL,NULL,NULL,NULL,'878152686288081,627128567055441,1171165992654808',NULL,NULL,NULL,'746735676880343,1146787602507424',NULL,NULL,NULL),(447,1197949764240847,'The Buddy Program-NYU',NULL,839836754614022,'**As of December 10, 2019: registration for Spring Semester, February 2020 is starting now** A small program consisting of 16 seniors per year that matches nursing students and medical students from NYU with seniors who have early-stage memory loss. Two programs: one during academic year, October through April (visits are paused during holiday breaks) and the Service Learning Program with NYU undergraduate students who visit every week from September  December, 2019. The caregiver should contact the program directly and staff will perform a brief intake over the phone. They will add senior to the interest list and then will contact the caregiver at a later date for a full intake (screening for appropriateness). Then an assessment will be done either in their office or in the senior\'s home if they cannot get to their office. Criteria for Participation-MENTOR (Person with Dementia): have a documented diagnosis of an early stage dementia, OR signs of memory loss and thinking disorders that suggest an early stage dementia that has not been formerly diagnosed; demonstrate an understanding of the program and an expressed interest in participating; have no significant behavioral problems that would make it difficult to engage in an activity with a student; have the ability to converse adequately to convey and comprehend a verbal message; be independent in the activities of daily living (ADLs)*. live within the five boroughs of New York City; live with a family member or friend who can be involved in the program and contacted in case of emergency.                                                                                                                                            \nCAREGIVER  Criteria for Program Participation: live with the Mentor;\nrecognize that the program is an intergenerational learning experience for the student, an opportunity for social engagement and purpose for the Mentor and a chance for the caregiver to have some respite time;\nrecognize that the Buddy Program is not a companion service; while it may be an entry point, it is not a substitute for a paid home care companion or aide; be accessible by phone and e-mail; be willing to coordinate and schedule meetings of the Mentor and Buddy as needed, and generally be present for the first and last few minutes of the visit; participate in periodic telephone conversations with Program Coordinators to evaluate the Program. TO MAKE PROFESSIONAL REFERRALS, contact Thea Micoli  thea.micoli@nyulangone.org  646-754-2282 or\nAnn Burgunder  ann.burgunder@nyulangone.org  646-754-2283.\n*They may make case-by-case exceptions to this rule, so check first if you are unsure about them accepting a client who receives some assistance. ','590969374564289','https://nyulangone.org/locations/alzheimers-disease-related-dementias-family-support-program',NULL,'BuddyProgram@nyulangone.org',NULL,'943955981947035,642511572093907,1248151266206446',NULL,NULL,NULL,NULL,NULL,'1095470244940987',NULL,NULL,NULL,'901434766768659',NULL,NULL,NULL),(448,1196279776508741,'Suffolk County Office for the Aging',NULL,NULL,'From their website: The Suffolk County Office for the Aging is the designated Area Agency on Aging under the Older Americans Act. For over 40 years, Suffolk County Office for the Aging has administered federal, state and county programs for persons 60 years of age and older. ','1117572001125322','http://suffolkcountyny.gov/aging/Home.aspx',NULL,'aging.office@suffolkcountyny.gov',NULL,'594263482089475',NULL,NULL,NULL,NULL,NULL,'1223298989673747',NULL,NULL,NULL,'1115099782867957',NULL,NULL,NULL),(449,1199367281369419,'Care NYC',NULL,826319322006898,'Caregiver support specialist helpline for support to caregivers of older adults living with Alzheimer\'s/Dementia and chronic illness. Program locations are in Manhattan, Brooklyn, Queens, and Staten Island. You can find a current schedule of events here: https://www.scsny.org/care-nyc/events','1274139224824287','www.scsny.org/care-nyc',NULL,'carenyc@scsny.org',NULL,'1261747089209037,981685343230150,877451051471319',NULL,NULL,NULL,NULL,NULL,'1326390678901346',NULL,NULL,NULL,'903689394971972',NULL,NULL,NULL),(450,1201583321309745,'The Hunter Helpers Program',NULL,751944288598510,'From their website: \"Service that helps meet the needs of local community members while also providing Hunter students with productive work opportunities. Currently, Hunter Helpers offers the following services: babysitting, dog walking, party assistance, student tutors, and miscellaneous errands. Hunter Helpers is an efficient and safe way to find a Hunter College student for desired services. Our program provides clients with the opportunity to hire a student who will best meet their needs. We do not share a clients personal information with anyone. \n1. A client submits a Client Request for Service Application\n2. The Hunter Helpers Program Coordinator sends out a listing to all Hunter students that are registered to the Hunter Helpers Program.\n3. The contact information of the first seven to eight qualified students who respond to the job listing is sent to the client.\n4. At this time, the client may contact individual students for additional information or to schedule interviews.\"','834032044609787','http://www.hunter.cuny.edu/hunterhelpers',NULL,NULL,NULL,'1070189534488260,1137020311225588',NULL,NULL,NULL,NULL,NULL,'1203914228897654',NULL,NULL,NULL,'839756563631856',NULL,NULL,NULL),(451,1203465702858620,'80th Street Residence Assisted Living',NULL,NULL,'Assisted living facility with staff specially trained in dementia care, nurses onsite and available 24/7, leadership Team onsite 7 days a week including holidays, medication ordering, supervision & assistance 24/7, coordination & transportation for medical appointments with Care Manager escort, onsite Physician visits available, personal Care, supervision, encouragement & assistance as needed 24/7.','951758667159396','www.80thstreetresidence.com',NULL,NULL,NULL,'943955981947035,642511572093907,1248151266206446,1149247622463332,1157747719793788',NULL,NULL,NULL,NULL,NULL,'876671128368411',NULL,NULL,NULL,'829061882805759',NULL,NULL,NULL),(452,1141581628840504,'William Alanson White Institute',NULL,NULL,NULL,'602072727071999',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'734017481451860',NULL,NULL,NULL,'877827575879592',NULL,NULL,NULL),(453,1142292415068269,'Visiting Eyecare Service',NULL,NULL,'Primarily services assisted living communities on a monthly basis. Waiting list available for individuals. ',NULL,'www.visitingeyecareservice.com',NULL,'sfichtenbaum@visitingeyecareservice.com',NULL,'777530238542021,1258526581948590',NULL,NULL,NULL,NULL,NULL,'567760979781750',NULL,'1167549789577224',NULL,NULL,NULL,NULL,NULL),(454,1153985667300935,'Key Food',NULL,NULL,'$50 delivery minimum, under $50 there is a $5 delivery fee, $5 additional fee for ordering over the phone, no fee if you can get to the store and shop yourself. ','1139260310168743','https://www.keyfood.com/',NULL,NULL,NULL,'1235894498248246',NULL,NULL,NULL,NULL,NULL,'845570959150135',NULL,NULL,NULL,'806047141290257',NULL,NULL,NULL),(455,1158111918004941,'The Pearl I. Barlow Center for Memory Evaluation and Treatment',NULL,839836754614022,'Consultation with a neurologist to provide an early diagnosis and the appropriate treatments for memory loss, along with support services.','910746664162625','https://nyulangone.org/locations/pearl-i-barlow-center-for-memory-evaluation-treatment',NULL,NULL,NULL,'943955981947035,642511572093907,1248151266206446',NULL,NULL,NULL,NULL,NULL,'715581660281221',NULL,NULL,NULL,'901434766768659',NULL,NULL,NULL),(456,1155024736332656,'The Teal Room-Memory Caf',NULL,1288044313088279,NULL,'792647573931865',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'848577785284000',NULL,NULL,NULL,'1150624172907663',NULL,NULL,NULL),(457,1163635550532432,'Court Square Law Project',NULL,1057674245692822,'\"Court Square Law Project thinks everyone should be able to afford justice, so we offer sliding scale rates based on what you earn to ensure all New Yorkers have access to quality legal representation. Created by the New York City Bar Association and the City University of New York School of Law to provide high-quality civil legal services to moderate-income clients.\"','558690609490523','http://www.courtsquarelaw.org',NULL,NULL,NULL,'785468758686103',NULL,NULL,NULL,NULL,NULL,'984358794830648',NULL,NULL,NULL,'590336741343629',NULL,NULL,NULL),(458,1171987185469806,'Helpline for Concerned Persons',NULL,1175135443135866,'From their website: \"A NON-EMERGENCY service providing information and support between 9:00 AM to 5:00 PM, Monday through Friday. Calls received evenings, weekends, &  holidays will be responded to the next business day. Not for reporting abuse, a free and confidential Service for concerned persons in the lives of elder abuse victims.\" ','1150100255705864','https://nyceac.org/wp-content/uploads/2018/04/HelplineBrochure.pdf',NULL,'helpline@nyceac.org',NULL,'617361975501329',NULL,NULL,NULL,NULL,NULL,'787187721543563',NULL,NULL,NULL,'955971997114080',NULL,NULL,NULL),(459,1187283213398988,'Club 76',NULL,1120414012913334,'Social programs, arts and cultural programs, exercise, inter-generational activities, computer literacy and training, health screenings, serve daily kosher and non-kosher meals in a group setting. ','800115976710076','https://www.jasa.org/community/senior-centers#.W3sXwc5KiUk',NULL,NULL,NULL,'1299575089394687',NULL,NULL,NULL,NULL,NULL,'600653563177346',NULL,NULL,NULL,'653767757476457',NULL,NULL,NULL),(460,1197386597844620,'Visiting Neighbors-Friendly Visiting',NULL,NULL,'From their website: \"Seniors enjoy a few hours of company each week, offering both the senior and volunteer an opportunity to learn from one another. Each visit is as unique as the two individuals involved.\nSeniors and volunteers share memories and warm conversation; they may listen to music together, watch a favorite movie or enjoy a hobby or a game of cards. Volunteers benefit from learning about an older person\'s life experiences, and seniors enjoy an opportunity to share their views with younger generations and stay connected with the outside world..\" Catchment area: Manhattan, 30th Street and below, river to river.','1211523035276152','http://www.visitingneighbors.org/friendly-visiting.html',NULL,NULL,NULL,'969672981978469',NULL,NULL,NULL,NULL,NULL,'1218728178643114',NULL,NULL,NULL,'1165366254470860',NULL,NULL,NULL),(461,1201897000634222,'The Jewish Board-Supportive Housing',NULL,1212127567201393,'From their website: \"We provide both transitional and long-term options for individuals. We provide apartments directly in the community. These apartments, known as scatter-site apartments, enable individuals to live independently in the community while still accessing responsive, wraparound care coordination. Specialized populations, such as young adults and the formerly homeless, live in community residences, which are home-like sites that focus on reintegration into the community, psychiatric stability, wellness, and educational and vocational goals. Our staff work with individuals in their homes and communities to support goals, build skills for independence, link to neighborhood resources, and ensure a strong network of treatment and support.\"','817064838386609','https://jewishboard.org/how-we-can-help/supportive-housing/',NULL,NULL,NULL,'632606603203298',NULL,NULL,NULL,NULL,NULL,'785303374266542',NULL,NULL,NULL,'812773064685081',NULL,NULL,NULL),(462,1202003470308319,'Ambulance Patient Finder',NULL,969674882530844,'Find apatientwho was transported to a hospital byambulance if 911 was called.','1147876269467435','https://www1.nyc.gov/nyc-resources/service/1047/find-an-ambulance-patient',NULL,NULL,NULL,'913198060459802,949152871495532',NULL,NULL,NULL,NULL,NULL,'1167190457320337',NULL,NULL,NULL,'955971997114080',NULL,NULL,NULL),(463,1210602165678189,'Lott Residence',NULL,NULL,'From their website: Assisted living facility that accepts Medicaid, approved by the New York State Department of Health for seniors, aged 65 and older, who require some home care services, medical attention and assistance. Studio apartment with full kitchen, living area, and private bathroom. 24-hour concierge, personal emergency response system, routine monitoring of residents day and night, included in single monthly fee. Assistance with activities of daily living 24-hours, personal care assistants help with individual needs (bathing, dressing, toileting, grooming, laundry and housekeeping). Medication administration managed by registered nurse, case management provided by social work staff, physician specializing in geriatric care available full-time on premise. Dining room serving three meals a day, overlooking Central Park. Beauty Parlor, meditation room, computer-equipped library, activity center, TV lounge, and a garden. Daily activities, spiritual programs, and weekly outings. They accept residents with mild dementia. ','1063151263507542','https://lottresidence.org',NULL,NULL,NULL,'1149247622463332,1157747719793788',NULL,NULL,NULL,NULL,NULL,'834192182171667',NULL,NULL,NULL,'604072454289404',NULL,NULL,NULL),(464,1149681920153095,'CIDNY','Center for Independence of the Disabled, New York',NULL,'Advocacy and direct services for people with disabilities. Their staff includes social workers, lawyers, and other professionals, most of whom are people with disabilities. During drop-in hours, staff will be available: in Manhattan, every Monday, Tuesday and Thursday from 10 am to 1:00 pm and 2:00  3:00 pm. In Queens, every Monday 10 am to 3 pm.\n(Updated 11.25.19)','818466611933505,950895428982391','www.cidny.org',NULL,'lhamilton@cidny.org. ',NULL,'981685343230150,669623054114376,895588724473906',NULL,NULL,NULL,NULL,NULL,'748797576054618,608135417497622',NULL,NULL,NULL,'1257871518955807,832033576342207',NULL,NULL,NULL),(465,1151487379935411,'Meet Me at MoMA',NULL,774788058651420,'Education programs for individuals with Alzheimer\'s disease and their care partners, free of charge.','1236472041118282','www.moma.org/visit/accessibility/dementia',NULL,'accessprograms@moma.org',NULL,'869870722824619,943955981947035,642511572093907,1248151266206446',NULL,NULL,NULL,NULL,NULL,'884626270698487',NULL,NULL,NULL,'908312139806035',NULL,NULL,NULL),(466,1175389810228890,'Well Connected Telephone & Online Classes',NULL,828585188982858,'Educational classes, support groups, and social call programs for isolated seniors. Programs are free, in pacific time zone. Classes meet 365 days a year by phone or online. Audio and Braille catalogs are also available to low-vision and blind participants. For seniors who are 60 and up.\nFrom their website: Well Connected members call in via a toll-free number at a set time each week, with some groups also offering the option to connect via computer, tablet, or mobile device. Most groups last 30 minutes to an hour with around 12 participants. Newcomers are always welcome! If you dont feel like talking at first, youre welcome to just listen as long as youve let the group know youre there. ','1125554127221753,614547283019295','https://covia.org/services/well-connected/',NULL,'coviaconnections@covia.org',NULL,'821861174676380,975020390374256,1119821956066449,1063168571768300',NULL,NULL,NULL,NULL,NULL,'915897563436802',NULL,NULL,NULL,'937132598457152',NULL,NULL,NULL),(467,1213036607295521,'Senior Employment Services','SESU ',616711493480804,'From their website: \"SESU has decades of experience placing older adults in jobs in data processing, administrative work, customer service, security services, airport services, home care, and other fields. Participants must be 55+, unemployed, Have a family income of no more than 125 percent of the federal poverty level, and be willing to learn new skills. SESU prepares trainees for employment through classes on computers, customer service, job-search techniques, resume-writing, and interviewing. SESU also offers on-the-job training and the opportunity to earn at least the minimum wage through placements at government agencies and nonprofits throughout the City. Trainees meet regularly with career counselors to discuss their goals, progress, and concerns. Job fairs, employer referrals, and placement assistance help trainees find permanent employment. When calling 311, ask for senior employment services.\"','1196705040717547','http://www1.nyc.gov/site/dfta/services/senior-employment.page',NULL,NULL,NULL,'669632099553613',NULL,NULL,NULL,NULL,NULL,'825609315730847,578208419719036',NULL,NULL,NULL,'1091732696488921',NULL,NULL,NULL),(468,1219423561765310,'ALZConnected Online Community',NULL,569329087549179,'A free online community powered by the Alzheimer\'s Association for everyone affected by Alzheimer\'s or another dementia, including: people with the disease, caregivers, family members, friends, and individuals who have lost someone to Alzheimer\'s.',NULL,'https://www.alzconnected.org/',NULL,NULL,NULL,'1063168571768300,943955981947035,642511572093907,1248151266206446,877451051471319',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(469,1157865767601907,'NYU College of Dentistry',NULL,1088122643739149,'Low-cost/sliding scale dental services provided by dental students.','1290928693472525','http://dental.nyu.edu/patientcare.html',NULL,NULL,NULL,'1060789001254366,930870677737263',NULL,NULL,NULL,NULL,NULL,'958208151578401',NULL,NULL,NULL,'1089588257205887',NULL,NULL,NULL),(470,1161101279343612,'Home Health Services',NULL,604657247231584,' Founded in 1947, Home Health Services of WJCS is a NY State-licensed home care service agency (LHCSA) and a leader in setting the standards for trusted and compassionate home care. WJCS Home Health Services accept clients on a fee for services basis only. \n\nUpdated 11/19',NULL,'http://www.wjcs.com/home-health-services-of-wjcs/',NULL,'scottrell@wjcs.com',NULL,'1209400832429047',NULL,NULL,NULL,NULL,NULL,'1245944667568992',NULL,'1123811319306652',NULL,NULL,NULL,NULL,NULL),(471,1164298769266153,'Whole Foods-Delivery',NULL,NULL,'Groceries Delivered in 1 Hour, or 2 hours, delivery fee $3.99-$5.99. Order online. See website for details.','868815111389782','https://delivery.wholefoodsmarket.com/',NULL,NULL,NULL,'1235894498248246',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'955971997114080',NULL,NULL,NULL),(472,1169883829298447,'The Holocaust & Human Rights Education Center',NULL,NULL,'From Website: The Holocaust & Human Rights Education Center is a not-for-profit organization, serving Westchester, Fairfield and Putnam counties. Our Mission is to enhance the teaching and learning of the lessons of the Holocaust and the right of all people to be treated with dignity and respect. We encourage students to speak up and act against all forms of bigotry and prejudice.\n\nOur work with students and teachers helps schools fulfill the New York State mandate that the Holocaust and other human rights abuses be included in their curriculum.\n\nPosted 11/19',NULL,'www.hhrecny.org',NULL,'cadamsky@hhrecny.irg',NULL,'875265416588372',NULL,NULL,NULL,NULL,NULL,'976959028911498',NULL,'1095704468210002',NULL,NULL,NULL,NULL,NULL),(473,1183768810883258,'Senior Helpers',NULL,NULL,'Serving Mount Kisco, Armonk, Bedford, Bedford Hills, Chappaqua, Elmsford, Harrison, Hartsdale, Hawthrone, Katonah, Mamaroneck, Pleasantville, Rye Brook, Purchase, Rye, Larchmont, Scarsdale, Thornwood, Valhalla, White Plains, W. Harrison.\n\nPosted 10/19',NULL,'https://www.seniorhelpers.com/westchestercounty-ny/',NULL,'SHWestchesterinfo@seniorhelpers.com',NULL,'1209400832429047',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(474,1183965065246467,'Synergy Homecare of Westchester',NULL,NULL,'Serving Scarsdale, Southern Westchester County including Hastings on Hudson, Irvington, White Plains, Yonkers, Bronxville, Pelham, Rye, Eastchester, Mamaroneck, and Port Chester for personal home care.\n\nPosted 10/19',NULL,'https://www.synergyhomecare.com/agencies/ny/westchester/ny02/',NULL,NULL,NULL,'1209400832429047',NULL,NULL,NULL,NULL,NULL,'965031904402236',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(475,1193096074780780,'A Place for Mom-Senior Living Advisors',NULL,NULL,'Senior living advisers are available to guide you through finding an assisted living facility. Compare costs, see photos, and read reviews. There is no charge for their services (they are paid by their partner communities if you choose to move in). Jacqueline Cocklin is the NYC-area Healthcare Account Representative for A Place for Mom. Their website includes an online resource for information about assisted living communities. ','597549259313335','https://www.aplaceformom.com/assisted-living',NULL,'Jackie.Cocklin@aplaceformom.com',NULL,'632606603203298,1149247622463332,1157747719793788',NULL,NULL,NULL,NULL,NULL,'1049856550473262',NULL,NULL,NULL,'955971997114080',NULL,NULL,NULL),(476,1194049297811679,'A Friend For Rachel',NULL,749199819507130,'Ongoing companionship/friendly visitor for early-stage Dementia clients with Junior and Senior Columbia pre-med student volunteers. Students are recruited for the program in September, so the best time to make referrals is between August and the end of September.\nA Friend for Rachels requirements: \n-for seniors with mild dementia\n-must be mobile, not use a walker or cane, has to be able to get out of the house on their own\n-must be cognizant of their memory problem, must remember the student they are matched with\n-the catchment area is Manhattan','1054665442712864','https://www.mailman.columbia.edu/public-health-now/events/friend-rachel',NULL,'jg2673@cumc.columbia.edu',NULL,'943955981947035,642511572093907,1248151266206446',NULL,NULL,NULL,NULL,NULL,'1212229874575931',NULL,NULL,NULL,'1182065464688915',NULL,NULL,NULL),(477,1195859334581308,'The LOFT',NULL,NULL,'LGBT Community Services Center','811993746307414','http://www.loftgaycenter.org',NULL,NULL,NULL,'975649390383808,1258526581948590',NULL,NULL,NULL,NULL,NULL,'1051677779208174',NULL,'1339927758244835',NULL,'1249188438419399',NULL,NULL,NULL),(478,1210604705530709,'Financial Assistance',NULL,926566663310552,'\"Financial assistance is one of the tools our case managers can use to stabilize families in crisis. We help prioritize needs, create a budget and set realistic financial goals. We also provide financial literacy classes to keep problems from reoccurring.\"','846027636612970','https://catholiccharitiesny.org/our-agencies/catholic-charities-community-services',NULL,NULL,NULL,'1080473071775397',NULL,NULL,NULL,NULL,NULL,'904954366117014',NULL,NULL,NULL,'602099679392461',NULL,NULL,NULL),(479,1226671765894576,'Alex Guitelman',NULL,1186448007384606,'While completely automating medical attention and care giving is not possible, it is possible to provide some peace of mind through smart devices and services that ensure prompt response to emergencies. ResponseLINKs medical emergency monitoring systems provide this through 24 hour monitoring and response.\n\nPosted 10/19',NULL,'https://www.responselink.com',NULL,'Responselinknyc@hotmail.com',NULL,'1133396357269256',NULL,NULL,NULL,NULL,NULL,'1129368496050475,939180792836656',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(480,1167152764322572,'Council Lifetime Learning Bereavement Groups',NULL,1005320638690324,'\"Our staff social worker leads two Bereavement Groups each week, helping members cope with the loss of a spouse or partner.\" ','1148870007460109','https://www.ncjwny.org/programs/council-lifetime-learning/',NULL,'lmaun@ncjwny.org',NULL,'1200594795378183',NULL,NULL,NULL,NULL,NULL,'1327558543154001',NULL,NULL,NULL,'578674092200867',NULL,NULL,NULL),(481,1168858159570625,'COHME Home Care ','Concerned Home Managers for the Elderly',NULL,'COHME is a non-profit licensed home care agency. They provide a social work case manager at no additional cost. COHME offers both short-term and longer-term home care. Their home care aides are certified by the New York State Department of Health and insured with both liability insurance and workers compensation. After an initial free consultation assessment, a contract with costs will be provided. They accept most long-term insurance policies. Services are available throughout the five boroughs and in facilities. There is a minimum of 12 hours per week.',NULL,'http://cohme.org',NULL,'referrals@cohme.org',NULL,'1324596060194399',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1222454904705084',NULL,NULL,NULL,NULL),(482,1189715623722716,'Gramatan Village',NULL,1108217418123219,'From Website: Gramatan Village is a non-profit organization that supports adults ages 55 and up who want to age in the home and neighborhood (Bronxville) that they love. At Gramatan Village, members receive services such as transportation to local appointments, referrals to vetted community partners, technology support, home maintenance support, home safety checks, assistance in financial planning and in navigating Medicare/Medicaid, workshop and seminar offerings, priority consideration for skilled nursing and assisted living facilities, support groups, counseling, volunteer opportunities, as well as social and cultural outings.\n\nPosted 10/19','1333755199774058','www.gramatanvillage.org/',NULL,'info@gramatanvillage.org',NULL,'808645273134339',NULL,NULL,NULL,NULL,NULL,'1121050199373564',NULL,NULL,NULL,'962627788475931',NULL,NULL,NULL),(483,1199554422793113,'Project C.A.R.T. ','Community Arranged Resident Transportation Program ',NULL,'From their website: \"Van service for seniors 60+, provides free specialized transportation for the frail elderly. Operating in Manhattan, from the Battery to 96th Street on the East Side and to 110th Street on the West Side, five vans take seniors to and from medical appointments and hospitals, planned activities at senior centers and entitlements on which they depend. Also provides private car service for seniors who need special transportation within Manhattan (approved for emergencies as well as for medical, social service and entitlement appointments). Also available for visits to relatives and friends in hospitals or nursing homes. Five days a week 9 am-3:45 pm. $1 suggested contribution per ride. Call to register by phone (provide your contact information and emergency contacts).\"',NULL,'http://www.nyfsc.org/support-services/free-transportation/',NULL,NULL,NULL,'1048629387183766',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(484,1210357886180971,'Council Lifetime Learning Caregiver Support Group',NULL,1005320638690324,'\"Weekly Caregivers Support Group for people caring for a loved one with Alzheimers Disease.\"','1148870007460109','https://www.ncjwny.org/programs/council-lifetime-learning/',NULL,'lmaun@ncjwny.org',NULL,'642511572093907,1248151266206446,943955981947035,877451051471319',NULL,NULL,NULL,NULL,NULL,'1327558543154001',NULL,NULL,NULL,'578674092200867',NULL,NULL,NULL),(485,1213146706836283,'Hebrew Free Burial Society',NULL,NULL,'Provides burials for those of the Jewish faith without resources or family and offers pre-arrangement end of life plan. Preparations are made in accordance with the Jewish law and tradition. ','1121951781319959','https://www.hebrewfreeburial.org/',NULL,NULL,NULL,'774097722351721',NULL,NULL,NULL,NULL,NULL,'666411295779411',NULL,NULL,NULL,'1263798668853558',NULL,NULL,NULL),(486,1218662248579999,'Antonio Olivieri Drop-In Center for the Homeless',NULL,585352554048372,'Drop-In center for the poor and/or homeless. Soup kitchen, showers, and other services available to members of the program. Clients may drop-in during business hours, see intake, and may join the program if they qualify (cannot be part of another program for at least the past year). Open Monday-Sunday, 7:30 am-8:30 pm.','571527641040410','http://www.urbanpathways.org',NULL,'outreachteam@urbanpathways.org',NULL,'632606603203298',NULL,NULL,NULL,NULL,NULL,'1179023264803097',NULL,NULL,NULL,'1308671721967520',NULL,NULL,NULL),(487,1232107467923366,'Harry & Jeanette Weinberg Center for Elder Justice',NULL,NULL,'Accepts professional referrals. ','1310893124940771','www.weinberg-center.org',NULL,NULL,NULL,'617361975501329',NULL,NULL,NULL,NULL,NULL,'996336481967979',NULL,NULL,NULL,'1210173169151479',NULL,NULL,NULL),(488,1243533464065853,'Lighthouse Guild-Social Services & Counseling',NULL,NULL,'Nursing, physical therapy, speech therapy, meals, vision rehabilitation, therapeutic activities, social work, nutrition, and counseling. Clients arrive between 8:30 and 9:30 am. Breakfast starts at 9:15 am, groups follow at 10 am and 11 am. Lunch is at 12 pm. Two more groups meet in the afternoon and dismissal happens by 3 pm. Attend three to five days a week, on the 4th floor. Car service can be paid by Medicaid and the senior has to arrange for it themselves. Medical services available on-site, on the 3rd floor. Counseling services are also available to non-visually impaired seniors. ','946288203514985','www.lighthouseguild.org/',NULL,NULL,NULL,'1000576764179618,821861174676380',NULL,NULL,NULL,NULL,NULL,'1285440487842205',NULL,NULL,NULL,'944853548512062',NULL,NULL,NULL),(489,1189124293941749,'Premier Home Health Care',NULL,NULL,'Home care with a holistic approach. Services range from homemaker/companion to 24-hour live-in. Offers home health aides and escorting services. Also offers a Comprehensive Care Management Program (clients are assigned a RN as their primary care manager who oversees all care needs). Private pay and MLTC. Home health aide rates are $26/hour with a required minimum of 3 days, 4 hours. Companion/escort $26/hour with a required minimum of 4 hours. Live-in rates are $338-$386 daily, LPN (licensed practical nurse) $65/hour (4 hour minimum), RN (registered nurse) $85/hour (4 hour minimum). Rates as of 2019. Serves New York, New Jersey, Connecticut, Massachusetts, Florida, Illinois, and North Carolina. Nancy Depowski, RN-Manager of Business Development (Private Pay Division).','940815650068994','http://www.premierhomehealthcare.com/',NULL,'ndepowski@phhc.com',NULL,'910515645454451,1324596060194399',NULL,NULL,NULL,NULL,NULL,'1230870544718391',NULL,NULL,NULL,'1000297805548472',NULL,NULL,NULL),(490,1201612629668842,'Inclusionary Housing Program',NULL,934538978948043,'Supportive housing for low-income seniors, 62+.','831035079823150','https://www.metcouncil.org',NULL,'housing@metcouncil.org',NULL,'632606603203298',NULL,NULL,NULL,NULL,NULL,'1041608668461119',NULL,NULL,NULL,'959807357164828',NULL,NULL,NULL),(491,1206081281714242,'Center for Aging in Place','CAP',NULL,'CAP provides information and resources to communities, organizations and individuals to support the goals of aging in place and advocate for robust multi-generational neighborhoods.\n\nPosted 10/19',NULL,'http://www.centerforaginginplace.org',NULL,NULL,NULL,'808645273134339,1258526581948590',NULL,NULL,NULL,NULL,NULL,'645524379406182',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(492,1214881164658172,'The Met Council on Jewish Poverty',NULL,NULL,'Benefits access, crisis intervention, family violence services, kosher food, and housing. ','584835880268323','www.metcouncil.org',NULL,NULL,NULL,'632606603203298,830617726149111,775024125555217,1080473071775397',NULL,NULL,NULL,NULL,NULL,'737887887424485',NULL,NULL,NULL,'959807357164828',NULL,NULL,NULL),(493,1217330047058019,'Sage Center Bronx',NULL,1202577900100445,'From their website: \"Sage Bronx serves LGBT older adults from across the borough and throughout the City with a diverse array of social events and support groups, daily hot nutritional lunches, a cyber center, health and wellness programs, arts and cultural events.\"','796422747447092','https://sagenyc.org/nyc/centers/bronx.cfm',NULL,NULL,NULL,'1220426167240011',NULL,NULL,NULL,NULL,NULL,'561552896796419',NULL,NULL,NULL,'624304836218464',NULL,NULL,NULL),(494,1228720163916900,'Outpatient Mental Health Services',NULL,1010051820509387,'From their website: \"Provides a variety of community-based outpatient programs for adults who are seeking assistance managing their behavioral health conditions and meeting their healthcare and personal goals. All of The Bridges outpatient services are located in one building in the Morningside Heights neighborhood of Manhattan, allowing clients to receive multiple services in one convenient location.\"','873392952410289','https://www.thebridgeny.org/',NULL,NULL,NULL,'1000576764179618',NULL,NULL,NULL,NULL,NULL,'1177629503271093',NULL,NULL,NULL,'1095778859933494',NULL,NULL,NULL),(495,1232906762960956,'79th Street Pharmacy',NULL,NULL,'Pharmacy with medicine, health products, canes, walkers, wheelchairs, and surgical and medical supplies. Delivery.','641065871140037','https://stores.healthmart.com/79thstreetpharmacy',NULL,NULL,NULL,'913198060459802,1082992753996569',NULL,NULL,NULL,NULL,NULL,'1226588119065450',NULL,NULL,NULL,'587992724534286',NULL,NULL,NULL),(496,1242765695469023,'Jewish Board Mental Health Clinics',NULL,1212127567201393,'15 mental health clinics in all 5 boroughs of New York City. Provide individual, couples, family and group therapy, as well as evaluation, assessment and medication management.','817064838386609','https://jewishboard.org/about-us/programs-services/mental-health-clinics/',NULL,NULL,NULL,'1000576764179618',NULL,NULL,NULL,NULL,NULL,'785303374266542',NULL,NULL,NULL,'812773064685081',NULL,NULL,NULL),(497,1250787331434938,'Ashley Le Winn, MSN, RN, AGNP-BC, NP-C: Geriatric Nurse Practitioner',NULL,1248205088392388,'Posted 10/19',NULL,NULL,NULL,'alewinn@geriatricmedicalassociates.com',NULL,'777530238542021,1258526581948590',NULL,NULL,NULL,NULL,NULL,'885909433526466',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(498,1193482002785457,'West 74th Street Residence',NULL,NULL,'From their website: \"Supportive residential community that offers furnished private rooms with either private or shared baths at all-inclusive monthly fee includes full meal service, housekeeping, laundry service, personal care, medication supervision, recreation activities, in-room emergency response system, 24-hour security and supportive social services.\"','684977594666329','http://www.w74street.org/',NULL,'istulbaum@wsfssh.org',NULL,'1149247622463332,1157747719793788',NULL,NULL,NULL,NULL,NULL,'1322162073767565',NULL,NULL,NULL,'765414916137459',NULL,NULL,NULL),(499,1203292248460080,'R.A.I.N. Transportation Program',NULL,1237041489023557,'Provides transportation services within Bronx Community Districts 9, 10 and 11 to medical appointments, other appointments or to/from a senior center. Several R.A.I.N. senior centers also provide neighborhood-based transportation services by taxi.  There is a $2 suggested donation for each trip, no one is turned away. Schedule appointment in advance. If you are in need of transportation.','793686677552335','www.raininc.org',NULL,'info@raininc.org',NULL,'634570173416697,1048629387183766',NULL,NULL,NULL,NULL,NULL,'661238878446092,940025562772061',NULL,NULL,NULL,'729434234446855',NULL,NULL,NULL),(500,1215223295083959,'Karen Rosenberg Caccavo, MBA',NULL,NULL,'Personal money manager--no charge for phone consultation.\n\nPosted 11/19',NULL,'www.personalmoneymanager.net',NULL,'Karen@personalmoneymanager.net',NULL,'818994090477380',NULL,NULL,NULL,NULL,NULL,'967537996903928',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(501,1246286170157896,'Outreach Rehab',NULL,NULL,'From their website: \"Physical therapy available in home and in clinic; serves at-home patients in Manhattan, Brooklyn, Queens, The Bronx, Staten Island, and sections of Westchester, Long Island, and New Jersey. Specializes in working with older adults and those who are memory impaired (Alzheimer\'s/Dementia). Accepts most private insurance plans, Medicare, and Medicaid. Call to find out if they are providers for your insurance company. As of 2019, they have expanded the insurance companies they accept.\"','859169562955552','https://www.outreach-rehab.com',NULL,NULL,NULL,'821933984736558,911994732331817,1060789001254366,804710974459801',NULL,NULL,NULL,NULL,NULL,'1339305463724338',NULL,NULL,NULL,'850115772007273',NULL,NULL,NULL),(502,1259922028949843,'Falk Surgical',NULL,NULL,'Assistive devices for rent or sale, other medical supplies.','1219070393872677','www.falksurgical.com',NULL,NULL,NULL,'913198060459802,949152871495532',NULL,NULL,NULL,NULL,NULL,'1298614051577895',NULL,NULL,NULL,'601682727064892',NULL,NULL,NULL),(503,1196577705674533,'Housing Court Answers',NULL,NULL,'Hotline open Tuesday to Thursday 9:00 am-5:00 pm, They also have an information table, available Monday to Friday, 9:00 am to 4:00 pm (may be closed for lunch). Both help with: Housing Court and Housing Court procedures, landlord & tenant rules and regulations, enforcement of housing code violations, referrals for free legal help, referrals to community organizations that help with housing problems. They do not provide direct financial help for paying back rent  they will refer you to a charitable organization or provide you with information about the Human Resources Administrations rules for assistance with back rent; screening by phone: If you qualify*, they will tell you which charities have funds, what requirements they have, and how to contact them. They can also explain how to apply for a one shot deal. *To qualify for rent arrears assistance from charities, you must meet four criteria: you must have a case in housing court or a rent demand from your landlord, explain how you fell behind, the ability to pay the current rent going forward, and back rent that is not too high.','1204123759895785','www.housingcourtanswers.org',NULL,NULL,NULL,'632606603203298',NULL,NULL,NULL,NULL,NULL,'743968299973017',NULL,NULL,NULL,'599284764119306',NULL,NULL,NULL),(504,1196073958400903,'New Rochelle Cares Aging in Place',NULL,1108217418123219,'New Rochelle Cares Aging in Place is a not-for-profit organization providing support to New Rochelle residents to live independently at home. \n\nPosted 11/19',NULL,'https://newrochellecares.org/',NULL,'info@newrochellecares.org',NULL,'808645273134339,1260794998607714',NULL,NULL,'Full membership $180/year for single and $300',NULL,NULL,'909184666935775',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(505,1201949109066241,'Sara Meyers',NULL,1288718690585705,'This practice works with elderly clients, their adult children and even young families who want to plan now for the future.\n\nPosted 10/19','572437871684762','https://www.esslawfirm.com/',NULL,'s.meyers@esslawfirm.com',NULL,'885600197309781',NULL,NULL,NULL,NULL,NULL,'912165790914098',NULL,NULL,NULL,'837025004887312',NULL,NULL,NULL),(506,1217784119892646,'BJCC Social Services',NULL,608478388100121,'Our social work staff works tirelessly to help Bronx residents to their best of their abilities by offering services that will help them remain independent and enhance their day to day lives. The services we offer include but are not limited to the enrollment and renewal of:\nSCRIE/DRIE, food stamps, Medicare/Medicaid, referral to legal services, domestic violence assistance, Meals on Wheels, etc., Social Security and SSI, Wills, Healthcare proxy, power of attorney, pre-needs burial, eviction prevention, emergency assistance. For more information please call Judy Uman. ','803273260259437','http://www.bjcconline.org/bjcc-social-services/#services',NULL,'info@bjcconline.org',NULL,'774097722351721,634570173416697,775024125555217',NULL,NULL,NULL,NULL,NULL,'676041189580868',NULL,NULL,NULL,'800166269666778',NULL,NULL,NULL),(507,1213543511414419,'New York State Commission for the Blind-Adaptive Living Program',NULL,NULL,'For people 55+ who are retired: they provide in-home training through their Adaptive Living Program. The program is designed to help the person maintain their independence and part of the training includes technology and smart phones. The senior sets up personal goals with their assigned counselor and when all the goals are met the case is closed. Theres an application process in which the person needs to have proof that they are legally blind (from an eye care professional) and proof of residency. The application is reviewed by a counselor and then the senior is referred to an agency in their area for the program. There is no charge for the program. The application can be done over the phone or if the person has someone who can help them fill out a printed application, it can be mailed in.  ','1115949119526284','https://www.nyconnects.ny.gov/providers/new-york-state-commission-for-the-blind-sofanya439266',NULL,NULL,NULL,'821861174676380',NULL,NULL,NULL,NULL,NULL,'675094256224616',NULL,NULL,NULL,'1120080866522434',NULL,NULL,NULL),(508,1219895967348154,'Senior Services',NULL,1132655505483770,'Health, medical, and social services for seniors. \n-Outpatient services\n-VoiceCare Response System: two-way emergency response device installed in a patient\'s home\n-medSmart medication management: automated system that organizes, reminds, and dispenses\n-Alternative Living Arrangements\n-HealthAccess: Special membership program for older adults. Promotes wellness, links seniors to vital health services. Membership benefits include I&R, health information in hospital publications, health lectures, seminars, and screenings, discounts on hospital parking, cafeteria, and local shops. MallWalkers exercise program.\n\nPosted 11/19','822930793411589',NULL,NULL,NULL,NULL,'1258526581948590',NULL,NULL,NULL,NULL,NULL,'1155760614038028',NULL,NULL,NULL,'1296826628696565',NULL,NULL,NULL),(509,1228602875739845,'SilverBills ',NULL,NULL,'From their website: \"SilverBills receives, scrutinizes and ensures that Clients bills are paid correctly for a monthly fee. Clients dont have to open envelopes, write checks or remember due dates. Paper is not innocuous, it can be a portal to fraud and identity theft. SilverBills gets rid of much of clients paper, thereby reducing the risk of elder financial fraud.\" They are fully insured. Marci Lobel-Esrig, Founder and General Counsel, mlesrig@silver-bills.com.',NULL,'www.SilverBills.com',NULL,'info@silverbills.com',NULL,'1012417089448021,1080473071775397',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(510,1229260991425809,'Lenox Hill Neighborhood House Caregiver Program',NULL,798994226105048,'The Neighborhood Houses Caregiver Program offers a variety of services to those providing care for family members and friends in Community Districts 8-12, covering the East Side of Manhattan from 59th Street to 143rd Street, and the West Side from 110th Street through 220th Street. The Caregiver Program provides caregivers of any age with a variety of services to help them in caring for family members and friends. The program is designed to support the caregiving dyad  the giver of care and the receiver of care  so that the relationship can thrive amidst changing roles and experiences. Our team provides individualized assistance to caregivers, offering supportive counseling and help accessing government benefits and entitlements. This counseling can take place in person, over the phone or via video conference. We also facilitate educational events, meaningful programming and support groups provided at Lenox Hill Neighborhood House, Saint Peters Church, our Casa Mutua residence in East Harlem and other community partnership sites. The Caregiver Program offers respite care through homecare agencies and certain supplemental services, such as referrals and linkages to other service providers. Caregiver Program clients can include:\nAdults 18 and older providing unpaid care for an older adult age 60 or older, Adults 18 and older providing unpaid care for an adult with dementia or a related disorder, Older adults 55 and over caring for a family member of any age with a disability, Older adults 55 and over caring for 1 or more family members who are 18 and younger.','940883776000708','https://www.lenoxhill.org/caregiverprogram',NULL,'caregiver@lenoxhill.org',NULL,'877451051471319',NULL,NULL,NULL,NULL,NULL,'1119956223653677',NULL,NULL,NULL,'748216179850947',NULL,NULL,NULL),(511,1241384952119080,'Therapy Dog International','TDI',NULL,'Referrals are made through a social worker or case manager. TDI will provide them with paperwork that needs to be filled out by senior and their doctor. TDI will reach out to volunteers who live near the senior and will get in touch with the social worker or case manager if someone is interested in visiting the senior with their dog.','579397005327715','www.tdi-dog.org/OurPrograms.aspx?Page=Home+Visits',NULL,'tdi@gti.net',NULL,'1009228235801069',NULL,NULL,NULL,NULL,NULL,'1248698563233972',NULL,NULL,NULL,'610509037893528',NULL,NULL,NULL),(512,1251567811006539,'Catholic Guild for the Blind',NULL,926566663310552,'\"Travel/orientation and mobility, low-vision services and devices, case management, special services for seniors aged 55+ who are legally blind including: techniques for safe meal preparation, equipment specially designed to help people with low vision manage everyday chores, home organization assistance to make it easier to access belongings, tips for banking and paying bills, special labeling of clothes for easier identification, mobility training to safely access homes and neighborhoods, help with personal and health care needs, access to community resources.\"','1183790945873310','https://catholiccharitiesny.org/blog/free-services-visually-impaired',NULL,NULL,NULL,'821861174676380',NULL,NULL,NULL,NULL,NULL,'1313515072072285',NULL,NULL,NULL,'602099679392461',NULL,NULL,NULL),(513,1253191866003089,'Masbia Pantry  ',NULL,NULL,'Pantry take-home packages are distributed every Thursday at Masbia of Flatbush from 7:00am - 10:00am. You can also receive packages Sunday - Thursday from 5:00pm - 6:00pm. Masbia of Boro Park distributes packages from 8:00am - 11:00am. Masbia of Queens distributions are Sunday - Thursday from 2:00pm - 6:00pm. Please note for Masbia of Queens and Masbia of Flatbush, only one package per week can be picked up. Anyone can receive a package. No identification is required. Those who want a package must sign in to our digital pantry system. Items on the pantry form vary depending on availability. Please wait patiently in line while being helped. Disorderly conduct causes disruption in the process. Do not come before the starting pantry time. Flatbush, Brooklyn #: 718-972-4446 x208, 718-534-7410, Boro Park, Brooklyn  #: 718-972-4446 x205, 718-289-0635, Queens #: 718-972-4446 x207, 718-534-7321',NULL,'https://www.masbia.org/pantry',NULL,'info@masbiaboropark.org',NULL,'1113477575023431,1261747089209037,981685343230150',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(514,1253214211998009,'Memory Tree',NULL,NULL,'For seniors with mild memory loss; all participants must schedule an interview prior to attending the program since the program is not equipped to handle drop-ins. If you would like to schedule an appointment please contact Elizabeth Fine.','568630493978873,1107417462373750','http://thememorytree.org',NULL,' info@thememorytree.org',NULL,'943955981947035,642511572093907,1248151266206446',NULL,NULL,NULL,NULL,NULL,'1150702256939137',NULL,NULL,NULL,'801326186311509,1292165976548285',NULL,NULL,NULL),(515,1261034223345738,'Donated Dental Services',NULL,1211403588691295,'\"DDS volunteers provide comprehensive treatment to eligible patients, volunteers do not provide emergency services, Eligibility: applicants must lack adequate income to pay for dental care and: have a permanent disability, or are elderly: age 65 or older, or qualify as medically fragile. Download application on website or call to request application by mail.\"','656162201896628','https://dentallifeline.org/new-york/',NULL,'mlebron@DentalLifeline.org',NULL,'1060789001254366,930870677737263',NULL,NULL,NULL,NULL,NULL,'1209412013333739',NULL,NULL,NULL,'1107694687614602',NULL,NULL,NULL),(516,1264727299118618,'ElderCare Program',NULL,669344150847762,'\"Drug and alcohol rehab program designed for the special needs of people 55 years old and above with individualized treatment plans. In East Harlem, the East Village, and the Bronx.\"','985856060520089','https://odysseyhousenyc.org/treatment-programs/for-seniors/',NULL,'admissions@odysseyhousenyc.org',NULL,'1000576764179618',NULL,NULL,NULL,NULL,NULL,'1086674481818674',NULL,NULL,NULL,'955971997114080',NULL,NULL,NULL),(517,1263303943455451,'Expanded in-home Services for the Elderly Program','EISEP',1260510841196867,'For ages 60+ who need help with activities of daily living and instrumental activities of daily living. Includes case management as well as non-medical in-home services such as housekeeping, respite car, homemaking, and ancillary services (safety and health equipment). \n\nPosted 10/19',NULL,'https://seniorcitizens.westchestergov.com/eisep-services',NULL,NULL,NULL,'808645273134339,1209400832429047',NULL,NULL,'Sliding Scale',NULL,NULL,'1243644132902868',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(518,1267289355151812,'City Bar Justice Center',NULL,NULL,'Legal advice and information for low-income people ($30,000-$33,000/year and under), also assists with Wills.','1122972654216380','https://www.citybarjusticecenter.org/',NULL,NULL,NULL,'785468758686103',NULL,NULL,NULL,NULL,NULL,'880385099178589',NULL,NULL,NULL,'919181871279364',NULL,NULL,NULL),(519,1266327100220698,'Alzheimer\'s Foundation of America-Caregiver Support Groups',NULL,1288044313088279,'Support groups to help individuals living with Alzheimers disease, their caregivers and families.','1149107541488250','https://alzfdn.org/caregiving-resources/2860-2/',NULL,NULL,NULL,'943955981947035,642511572093907,1248151266206446,877451051471319',NULL,NULL,NULL,NULL,NULL,'848577785284000',NULL,NULL,NULL,'1218004392452674',NULL,NULL,NULL),(520,1211921186340565,'Office of the State Long Term Care Ombudsman',NULL,NULL,'New York state\'s Long Term Care Ombudsman acts as an advocate and resource for older adults and persons with disabilities who live in nursing homes, assisted living and other licensed adult care homes. Ombudsmen help residents understand and exercise their rights to good care in an environment that promotes and protects their dignity and quality of life. The Ombudsman Program advocates for residents by investigating and resolving complaints made by or on behalf of residents; promoting the development of resident and family councils; and informing government agencies, providers and the general public about issues and concerns impacting residents of long-term care facilities. Claudette Royal is the New York State Ombudsman. **CIDNY-Center for Independence of the Disabled, NY (http://www.cidny.org/) is managing the program for New York City and can be reached at (212) 674-2300.** ','1283815184009985','https://www.ltcombudsman.ny.gov/',NULL,NULL,NULL,'669623054114376',NULL,NULL,NULL,NULL,NULL,'621305926010699',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(521,1206865188941552,'Hazel Brooks Center',NULL,933567985906060,'Neighborhood senior center ','1191099419278865','http://www.fortgreenecouncil.org/neighbrhood-senior-centers',NULL,NULL,NULL,'1261747089209037',NULL,NULL,NULL,NULL,NULL,'1215653065279338',NULL,NULL,NULL,'1238210936535122',NULL,NULL,NULL),(522,1217365969513100,'Pathways to Care',NULL,604657247231584,'Care consultations for Alzheimers disease and other related dementias; counseling for those with chronic or life-threatening illnesses. WJCS conducts home visits, provides referrals, coordinates advance care planning, and provides support for families of individuals with dementia. \n\nPosted 10/19',NULL,'http://www.wjcs.com/pathways-to-care/',NULL,'grittmaster@wjcs.com; jslevin@wjcs.com',NULL,'1093941699026800,1184375293767958,853236516099165',NULL,NULL,NULL,NULL,NULL,'869945483283646',NULL,'808592986680666,1155522796880172',NULL,NULL,NULL,NULL,NULL),(523,1226151206612260,'A-HOME',NULL,NULL,'Strengthening northern Westchester neighborhoods with safe and affordable housing. Clients are often low-income individuals with disabilities, and single-parent families who, because of age, disability or family status, cannot afford market-rate rents. Often people are homeless or living in sub-standard housing. \n\nPosted 11/19','808376525570252','www.a-homehousing.org',NULL,'info@a-homehousing.org',NULL,'606548005480946','Applying for housing at A-HOME involves a number of steps, beginning with the submission of a preliminary application. After the application is received by A-HOME, a staff member will contact the applicant by telephone to describe the next steps which may include a more detailed application, an in-person interview, a visit to an A-HOME residence, and the submission of additional documents including a medical history, income verification and personal references. The application process is intended to ensure that potential residents will be a good match for A-HOMEs housing and the kinds of services that A-HOME provides.',NULL,NULL,NULL,NULL,'556535857464980',NULL,NULL,NULL,'1195064303629753',NULL,NULL,NULL),(524,1234039610795036,'NY Presbyterian Allen Hospital-Geriatric Medicine and Aging',NULL,874300745043714,'Provides older adults with medical, functional, cognitive, and psychosocial care, as well as other support services to promote optimum health in later years. Also provide support for the caregivers of older adults.','873928710407607,820259091149125','https://www.nyp.org/allenhospital/clinical-services/geriatric-medicine-and-aging',NULL,NULL,NULL,'1060789001254366,804710974459801',NULL,NULL,NULL,NULL,NULL,'1246135799460196',NULL,NULL,'647669571908978','955964085225954',NULL,NULL,NULL),(525,1240661118232957,'Encore Friendly Visiting',NULL,624854977524323,'\"Must have case management through DFTA agency to use the program; Matches volunteers with home-bound seniors in need of companionship. Volunteers visit for one hour on a weekly basis, forging friendships and helping to alleviate loneliness.\"','1174600638087225','www.encorecommunityservices.org/outreach-programs/',NULL,NULL,NULL,'969672981978469',NULL,NULL,NULL,NULL,NULL,'586082207235553',NULL,NULL,NULL,'854091596400759',NULL,NULL,NULL),(526,1244030712574348,'Health Advocates for Older People Healthy Aging Program',NULL,1219582025275697,'Home safety initiative, wellness classes, educational presentations, and social activities. ','1275743859932320','http://www.hafop.org/healthyagingactivities.htm',NULL,NULL,NULL,'1299575089394687',NULL,NULL,NULL,NULL,NULL,'1131121820107153',NULL,NULL,NULL,'886253808274487',NULL,NULL,NULL),(527,1247905330263033,'Riverstone Senior Life Services Memory Center (Washington Heights)',NULL,NULL,'Cognitive exercises, brain games/puzzles, arts & crafts, dance, exercise, discussion groups, music therapy (transportation provided if within catchment area), program operates Mon.-Sat. 10 am-3 pm, (flexible Saturday hours  participants can attend from 1-5 hrs); Fees may be covered by Medicaid Long Term Care (MLTC), Private Long Term Care or private pay. Also offer caregiver support. Catchment area:Washington Heights & Bronx for transportation. Call to confirm dates and times.','1175734426903224','www.riverstonenyc.org/riverstone-memory-center/',NULL,NULL,NULL,'943955981947035,642511572093907,1248151266206446,877451051471319',NULL,NULL,NULL,NULL,NULL,'998355037014838',NULL,NULL,NULL,'1175754335304989',NULL,NULL,NULL),(528,1264560206833433,'Senior Housing Assistance Program',NULL,1216230676050080,'Westchester Residential Opportunities, Inc. is a non-profit organization whose mission is to promote equal, affordable and accessible housing opportunities for all residents of our region.\n\nPosted 11/19','1184828226037831','wroinc.org',NULL,'seniorhousing@wroinc.org',NULL,'606548005480946',NULL,NULL,NULL,NULL,NULL,'1182562626860534',NULL,'910018283883430',NULL,'897137425209527,1038598330856856',NULL,NULL,NULL),(529,1267509651892520,'Susan Stone-Groppe OTR, M.S.',NULL,NULL,'Registered Occupational Therapist and Geriatric Care Manager with over 30 years of experience in the healthcare field. She has consulted with numerous nursing homes in Westchester and New York City. \n\nPosted 10/19',NULL,'www.elderservicesny.com',NULL,'ssgotr@aol.com',NULL,'1160439364324685',NULL,NULL,NULL,NULL,NULL,'851844795723386',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(530,1271204612274121,'Visiting Nurse Service Hospice Care',NULL,1293251363005201,'VNSNY Hospice and Palliative Care provides care wherever you call homea private residence, a nursing home or assisted living facility, an inpatient facility, or VNSNYs hospice residence. Special Hospice Services and Programs are: Hospice Care Program for Veterans, Grief Support, Hospice Outreach Support, LGBT Cultural Competency Training. Service areas include the Bronx, Brooklyn, Manhattan, Queens, and Staten Island.                ','1242042751047449','https://www.vnsny.org/how-we-can-help/hospice-palliative-care/',NULL,NULL,NULL,'1217112216075611,1212182778974229',NULL,NULL,NULL,NULL,NULL,'1000855809770843',NULL,NULL,NULL,'955971997114080',NULL,NULL,NULL),(531,1271034966305715,'6 Square Feet-Affordable Living Lotteries Directory',NULL,NULL,'Updated directory of current NYC housing lotteries in the five boroughs. ',NULL,'https://www.6sqft.com/category/affordable-housing/housing-lotteries-affordable-housing/',NULL,NULL,NULL,'632606603203298',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(532,1279457659225203,'Assisted Living Locators',NULL,NULL,'No-cost referral service specializing in senior living. Entails a needs assessment, recommendations, assisted selection process, and facilitated transition. \n\nPosted 11/19',NULL,'assistedlivinglocators.com/',NULL,NULL,NULL,'606548005480946',NULL,NULL,'N/A',NULL,NULL,'610736119421890',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(533,1275995476418606,'Elderly Project','VOLS',884859466341687,'\"The Elderly Project staff and pro-bono attorneys provide free legal advice, information, document drafting, and other brief services to low-income ($25,000/year and under) Manhattan residents aged 60 and over, and to the social workers and advocates who assist them. These services include direct counseling on critical issues involving housing, government benefits, and consumer debt, and the drafting and execution of wills, powers of attorney, and other essential life-planning documents. Discuss your legal question with one of our attorney referral counselors or submit it online. All information you provide will be kept confidential to the fullest extent possible under the law. Get referred to a screened and qualified lawyer or the right resource. Initial consultations are $35 or free, depending on the type of case, and last up to 30 minutes. We conduct 12 monthly walk-in legal advice and brief service clinics at Manhattan senior centers. At the clinics, seniors can discuss their legal problems with an attorney in confidence, receive advice and brief services, and, if appropriate, obtain a referral to a volunteer lawyer for representation. Seniors receive advice on legal matters in the areas of housing, consumer debt, public benefits, and life-planning documents. Referrals are also provided to organizations that can provide representation in these and other types of legal matters.\"','837281295142369','http://www.volsprobono.org/projects/elderly-project',NULL,NULL,NULL,'785468758686103',NULL,NULL,NULL,NULL,NULL,'805325028502814',NULL,NULL,NULL,'596852445446641',NULL,NULL,NULL),(534,1249500327678308,'Lewy Body Dementia Association (Westchester County)',NULL,1331595394417841,'Caregivers support group once per month on the second Tuesday from 11:00 am - 12:30 pm.\n\nPosted 10/19',NULL,'https://lewybodyresourcecenter.org/',NULL,'norma@lbdny.org',NULL,'853236516099165',NULL,NULL,NULL,NULL,NULL,'804875796965957',NULL,'766362012206385',NULL,NULL,NULL,NULL,NULL),(535,1256987994244947,'Encore Residence Housing',NULL,624854977524323,'\"These housing facilities provide safe, decent and affordable housing for low-income seniors, and contribute to the revitalization and stability of the Times Square and Clinton communities in midtown Manhattan.\"','1174600638087225','http://www.encorecommunityservices.org/',NULL,NULL,NULL,'632606603203298',NULL,NULL,NULL,NULL,NULL,'980143642587210',NULL,NULL,NULL,'854091596400759',NULL,NULL,NULL),(536,1277861289893407,'Onsite & Special Programs',NULL,617910248814061,'Join peers for a variety of discussion groups, wellness classes, music performances and creative aging workshops. Programs take place in DOROTs main office. Suggested Donation: $5 per class (cash or check). A doctor\'s note is required indicating it is safe for you to participate in the exercise classes.   ','872398746454681','www.dorotusa.org',NULL,NULL,NULL,'956181681492566,1311468932506646,869870722824619,1119821956066449',NULL,NULL,NULL,NULL,NULL,'637042726567005',NULL,NULL,'1272863013225282','801326186311509',NULL,NULL,NULL),(537,1277328910091903,'Friendship Line-Hotline',NULL,1073669140612840,NULL,'1108016909440840',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'977144619464111',NULL,NULL,NULL,'1229897682694786',NULL,NULL,NULL),(538,1279542912229691,'Community Hearing Services',NULL,NULL,'Hearing loss assessment and hearing aid fitting.\n\nPosted 11/19','1063973581790538','www.communityhearingservices.com/',NULL,NULL,NULL,'1133396357269256,1200164878065478',NULL,NULL,NULL,NULL,NULL,'959748493066942,773418629410310',NULL,NULL,NULL,'1139790966644919,601535167627038',NULL,NULL,NULL),(539,1282944752309630,'The Bristal Assisted Living',NULL,NULL,'Independent and assisted living with protected memory care unit and Alzheimer\'s day program. \n\nPosted 11/19','636785171594340','thebristal.com',NULL,NULL,NULL,'1114469131907548,853236516099165,1281533535852091,979043836689591',NULL,NULL,NULL,NULL,NULL,'1234249647149572',NULL,NULL,NULL,'1202000137791062',NULL,NULL,NULL),(540,1283877760992968,'Visiting Neighbors-Shop & Escort',NULL,1298442639123920,'From their website: \"For a frail senior, crossing New York City\'s busy streets can be an overwhelming challenge. Our volunteers help seniors make trips to the grocery store or pharmacy. When the weather is bad, or the senior is not up to a trip outside, volunteers can go shopping for them. We escort seniors to medical appointments to provide them with both a steady arm to lean on and emotional support. On nice days, our volunteers may walk outside with seniors for exercise, fresh air and companionship.\" Catchment area: Manhattan, 30th Street and below, river to river.','1211523035276152','http://www.visitingneighbors.org/shop---escort-services.html',NULL,NULL,NULL,'910515645454451',NULL,NULL,NULL,NULL,NULL,'1218728178643114',NULL,NULL,NULL,'1165366254470860',NULL,NULL,NULL),(541,1288178816196946,'JASA-Case Management',NULL,999420709614592,'Case management for seniors 60 and over and those who are disabled and under 60. Their catchment area covers West 76th Street and below and East 81st Street  East 144th Street.','1304313664181912','www.jasa.org',NULL,'help@jasa.org',NULL,'784392560809728',NULL,NULL,NULL,NULL,NULL,'887655578966616',NULL,NULL,NULL,'1256625945825770',NULL,NULL,NULL),(542,1227805757052460,'New York Legal Assistance Group (NYLAG)',NULL,NULL,'From their website: \"Direct legal services, class action and other impact litigation, legal case consultation, community education, volunteer programs, Swiss Bank Settlements, German Slave and Forced Labor Fund.\" Serves all 5 boroughs and Long Island.\"','698464460411906','http://www.nylag.org/',NULL,NULL,NULL,'785468758686103',NULL,NULL,NULL,NULL,NULL,'973262116396783',NULL,NULL,NULL,'1180366400470295',NULL,NULL,NULL),(543,1229958599094903,'Heights and Hills',NULL,NULL,'From their website: \"Our services are provided free of charge to those over the age of 60 and their family caregivers without regard to race, religion, national origin, gender, disability, marital status, sexual orientation, or economic status. Overall, we serve 19 different neighborhoods  providing case management and caregiver services as well as volunteer and inter-generational programs in 18 of those neighborhoods, and caregiver services in one additional neighborhood.*\"','1302546941077364','www.heightsandhills.org',NULL,NULL,NULL,'1299575089394687,1261747089209037',NULL,NULL,NULL,NULL,NULL,'1183996528159268',NULL,NULL,NULL,'1243005692710265',NULL,NULL,NULL),(544,1257352985791981,'Philips Lifeline',NULL,NULL,'Philips Lifeline is a medical alert system that lets you summon help any time of the day or night  even if you cant speak. All you have to do is press your medical alert button, worn on a wristband or pendant, and a trained Personal Response Associate will respond.\n\nPosted 10/19',NULL,'https://www.lifeline.philips.com/medical-alert-systems.html',NULL,NULL,NULL,'1133396357269256',NULL,NULL,NULL,NULL,NULL,'944865759683051',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(545,1260362559796750,'Westchester Jewish Community Services',NULL,NULL,'From Website: Westchester Jewish Community Services (WJCS) is one of the largest human service agencies in Westchester, providing care to people of all ages and diverse backgrounds who are confronting significant challenges. Agency experts provide mental health, trauma, disabilities, youth, home care and geriatric services. \n\nPosted 11/19','1322880754340982','wjcs.com',NULL,'jfink@wjcs.com',NULL,'1258526581948590',NULL,NULL,NULL,NULL,NULL,'875283516813907',NULL,'781976875386812',NULL,'974738233198185',NULL,NULL,NULL),(546,1261701871106227,'CityMeals on Wheels',NULL,783887432172900,'Home delivered meals to seniors through DFTA case management. Go to www.citymeals.org and enter senior\'s zip code to locate the agency providing meals in their area. ','1163679734692717','www.citymeals.org',NULL,NULL,NULL,'830617726149111',NULL,NULL,NULL,NULL,NULL,'894968669101358',NULL,NULL,NULL,'1137742849854717',NULL,NULL,NULL),(547,1263717593353769,'Alzheimer\'s Foundation of America-Bereavement Support Group',NULL,1288044313088279,'In-person support group for those who have experienced the death of someone with Alzheimer\'s or related dementias. Group is free and open to all. Call to register. ','1149107541488250','https://alzfdn.org/',NULL,NULL,NULL,'642511572093907,1200594795378183,1248151266206446,943955981947035',NULL,NULL,NULL,NULL,NULL,'848577785284000',NULL,NULL,NULL,'1218004392452674',NULL,NULL,NULL),(548,1268019740852547,'Interim Healthcare',NULL,NULL,'Home Care Services are cost-effective and designed to meet the individual needs of each patient. Interim HealthCare of White Plains is here for you and your family whether you need home care for a short time when you return from a hospital stay or non-medical senior care to help with some of the tasks of daily living.\n\nPosted 10/19','1287424250598133','https://www.interimhealthcare.com/whiteplainsnewyork/home/',NULL,NULL,NULL,'1209400832429047',NULL,NULL,NULL,NULL,NULL,'621920966796170',NULL,NULL,NULL,'1283192987057603',NULL,NULL,NULL),(549,1269430735797847,'Hospice Care of Westchester & Putnam',NULL,620738975119388,'Hospice and coordinated services including hospital care, if needed. Emphasizes continuity of care 24 hours a day, 7 days a week. Palliative care and Healing Arts Program, which utilizes holistic therapies including massage, art, music, and pet therapies. Support for family members. \n\nPosted 11/19',NULL,'www.hospicewestchesterputnam.org/',NULL,'	Hospice@vnahv.org',NULL,'892286200872415',NULL,NULL,NULL,NULL,NULL,'1027962465990811',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(550,1279087106048740,'Right at Home: Northern Westchester',NULL,569038408447893,'Our Right at Home of Northern Westchester, Dutchess, Rockland and Putnam Counties, NY office offers senior care services in the comfort and familiarity of wherever you and your loved one call home. We tailor our care to your unique situation through a Custom Care Plan. Individualized elder care programs change as our clients\' needs change.\n\nPosted 10/19',NULL,'https://www.rightathome.net/north-westchester-putnam',NULL,NULL,NULL,'1209400832429047',NULL,NULL,NULL,NULL,NULL,'936295913818873',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(551,1282890056251489,'Savage Organizing',NULL,NULL,'Professional organizer, two hour minimum. Everything is 100% confidential, as the handling of personal and financial documents is taken very seriously. ','1224882677936208','http://savageorganizing.com',NULL,'elizabeth@savageorganizing.com  ',NULL,'1012417089448021,656941113483002,1294594151119548',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'955971997114080',NULL,NULL,NULL),(552,1281730196978815,'Dementia Care Coach Program',NULL,862733777014880,'Coaches or \"ReServists\" go through an intensive training process and have an online certification. They come from all walks of professional life, including: Anthropologists, Artists, Art Therapists, Engineers, Attorneys, Corporate Executives, Educators, HR Directors, Journalists, Nurses and Social Workers. The Dementia Care Coach program provides caregivers and family members support so they can deal with the progression of the seniors condition. Serves all 5 boroughs, charge of $25/hour (send a monthly invoice to caregiver or designated person), no minimum requirement for number of days or hours, a caregiver or social worker can make direct referrals to them. A social worker from ReServe does a phone intake or in-person intake with caregiver. The person making the referral will get a list of coach resumes and they will select who they want from the list. They will meet with the chosen person or speak on the phone with them. The caregiver can be re-matched with a new coach if necessary. Telephone coaching is also available. Some respite care is available. ','863631366142452,1259822172928040','www.reserveinc.org',NULL,'info@reserveinc.org',NULL,'853236516099165,943955981947035,642511572093907,1248151266206446,877451051471319',NULL,NULL,NULL,NULL,NULL,'865162677191334',NULL,NULL,NULL,'955971997114080,955971997114080',NULL,NULL,NULL),(553,1289293867285970,'Our Place Memory Cafe',NULL,1230148919177278,'The Our Place Memory Caf welcomes people and their loved ones into a secure, comfortable, and socially engaging venue (at a local restaurant) where they not only experience an afternoon of fun and entertainment, but also patience, understanding and true camaraderie with friends who are going through the same.  \n\nPeople living with a diagnosis of Dementia or Alzheimers disease continue benefitting from seeking and keeping positive social connections. It is also equally important for people caring for a loved one with this diagnosis to have a place where they, too, can relax, socialize, share thoughts, emotions, and find answers to key questions.\n\nPosted 10/19','915020233717830','https://thebristal.com/memory-cafe/',NULL,NULL,NULL,'853236516099165',NULL,NULL,NULL,NULL,NULL,'1030364882603753',NULL,NULL,NULL,'1248372735543186',NULL,NULL,NULL),(554,1295698396831869,'Soul Ryeders',NULL,NULL,'SOUL RYEDERS is a volunteer-driven charitable organization, based in Westchester County, NY, committed to empowering those in our community who are affected by all types of cancer. From diagnosis through treatment, recovery and survivorship, they offer practical resources and support.\n\nPosted 10/19',NULL,'www.soulryeders.org',NULL,NULL,NULL,'1184375293767958',NULL,NULL,NULL,NULL,NULL,'1295207466809678',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(555,1296189276087159,'Positive Approach to Care',NULL,NULL,'Making use of the skills retained while providing support, and substituting our skill, for what is no longer available.',NULL,'www.teepasnow.com',NULL,NULL,NULL,'853236516099165',NULL,NULL,NULL,NULL,NULL,'584603051743244',NULL,'1133998774191160',NULL,NULL,NULL,NULL,NULL),(556,1235328331316271,'Live Connected Private Case Management',NULL,NULL,'Katie Kluger and Elissa Kleinhaus; From their website: \"A team of experienced geriatric social workers who provide older adults and caregivers with professional and personal support. Our focus is to maximize independence, minimize stress, keep you connected to the community and safe at home. Our customized plans allow you to choose services that meet your individual needs and help you age and connect in the place you are most comfortable.\"  \nServices include: daily check-in calls, home visits, referrals, assessments, transitional support, caregiver support, etc. ','1287825669530980','https://www.liveconnectedny.com/',NULL,'Info@LiveConnectedNY.com',NULL,'863555368755651',NULL,NULL,NULL,NULL,NULL,'1178064784808101',NULL,NULL,NULL,'955971997114080',NULL,NULL,NULL),(557,1241027936084868,'Adult Day Health Care Program-Amsterdam Nursing Home',NULL,1352629276802338,'From their website: For older adults who are able to live in the community. We operate seven days a week and provide many of the same services that are offered to residents of the facility; skilled nursing care, medication management, recreation, social services, and rehabilitation.  Open 7 days a week, 8:00 am to 3:30 pm. Round trip, door to door transportation is available (including to medical appointments). Each registrant has an individualized care plan tailored to his/her needs and abilities; a continental breakfast on arrival each day, a midday lunch, and snacks to take home. There are social group activities; day trips, arts and crafts, theater, movies, music, readings, exercise sessions, and holiday celebrations. Our registered nurses and social workers coordinate care with physicians and others in the registrants community. Medicaid and private payment are accepted. Some long-term managed care Medicaid programs are accepted (call for more details).','1147679058222084','www.amsterdamcares.org',NULL,NULL,NULL,'1106100275196851',NULL,NULL,NULL,NULL,NULL,'1131100545612628',NULL,NULL,NULL,'845216248501461',NULL,NULL,NULL),(558,1240262444839301,'Robin Freimann, Esq.',NULL,NULL,'From Website: Welcome to Elder Law and Trusts. My practice is entirely devoted to Elder Law and legal and financial planning for the elderly and disabled. I personally work with families to figure out solutions to the issues that will make sense to them...always with my clients\' best interests at heart.\n\nPosted 10/19','1336866946964704','http://elderlawandtrusts.com/',NULL,NULL,NULL,'885600197309781',NULL,NULL,NULL,NULL,NULL,'1184506857002876',NULL,NULL,NULL,'612094659530356',NULL,NULL,NULL),(559,1243032936986058,'Plaza Jewish Community Chapel',NULL,NULL,'From their website: \"Communally owned and operated Jewish funeral chapel, arrangements made 24 hours a day, funeral services in all synagogues and graveside, streaming funerals on the web, pre-arrangement services are recommended.\" ','1160980520314476','www.plazajewish.org',NULL,'plaza@plazajewish.org',NULL,'774097722351721',NULL,NULL,NULL,NULL,NULL,'902460920708433',NULL,NULL,NULL,'605021630756792',NULL,NULL,NULL),(560,1256447779430795,'LINC Program','Council House',1107570769963899,'Provides people with memory impairment and their paid caregivers with a 3 hour recreation/activities program on Wednesdays and Fridays, from 11:30 am-2:30 pm. Program includes cognitive activities, discussion, music and movement, and a light lunch. Participants are screened by their ability to relate to others, to participate in activities & function in a group. Family members usually visit the program prior to enrolling their family member and discuss its appropriateness with Project Coordinator or NCJW NYs Licensed social worker. ','895924441806597','www.ncjwny.org/programs/council-lifetime-learning/',NULL,NULL,NULL,'943955981947035,642511572093907,1248151266206446',NULL,NULL,NULL,NULL,NULL,'635073118879437',NULL,NULL,NULL,'578674092200867',NULL,NULL,NULL),(561,1255781308313872,'Eldercare Locator-Area Agencies on Aging',NULL,NULL,'An online database and telephone helpline provided by the U.S. Administration on Aging. Provides information on Area Agencies on Aging and connects individuals to services for older adults and their families. This is a helpful resource for callers and others contacting I&R who are out of state and need resources. ',NULL,'https://eldercare.acl.gov',NULL,NULL,NULL,'594263482089475,1063168571768300,1126107523105430',NULL,NULL,NULL,NULL,NULL,'1238917470213019',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(562,1264942737150905,'Luncheon Club & Senior Program',NULL,940635116893810,'From their website: \"provides socialization, recreation, education, congregate luncheon meals, activities, day trips, computer training and holiday parties. The program also delivers daily meals to homebound individuals. Case assistance is offered to members/participants who need help in applying for government benefit programs, addressing landlord/tenant disputes, or accessing medical care. Open to anyone age 60 or over, regardless of where s/he lives.\" ','1313811808076784','http://www.carterburdennetwork.org/cblc',NULL,'watkinsj@carterburdennetwork.org',NULL,'1299575089394687',NULL,NULL,NULL,NULL,NULL,'941524237713523',NULL,NULL,NULL,'1238038149570670',NULL,NULL,NULL),(563,1261123757547801,'Elder Abuse Prevention & Scam Awareness',NULL,1165481515831627,'\"We present workshops and distribute flyers on specific threats such as telephone and email scams, and provide direct lines to call if abuse is suspected.\"','1157439885702996','http://ujceastside.org/ujc-social-services',NULL,NULL,NULL,'617361975501329',NULL,NULL,NULL,NULL,NULL,'925884348453654',NULL,NULL,NULL,'620719617398611',NULL,NULL,NULL),(564,1275378296799320,'VNSNY Bereavement Services',NULL,1293251363005201,'Bereavement support for general loss, loss of a sibling, loss of an adult child, spouse/partner loss, father/mother. Call for schedule and locations.    ','1242042751047449','www.vnsny.org/how-we-can-help/hospice-palliative-care/our-services/grief-support/ ',NULL,'bereavement@vnsny.org',NULL,'1200594795378183',NULL,NULL,NULL,NULL,NULL,'1194647666288235',NULL,NULL,NULL,'955971997114080',NULL,NULL,NULL),(565,1288051650495794,'The Legal Aid Society',NULL,NULL,'From their helpline: \"Helpline with general intake; Through our Civil, Criminal Defense, and Juvenile Rights Practices, we offer an unmatched depth and breadth of legal expertise to vulnerable New Yorkers in over 300,000 legal matters each and every year. Also assist with obtaining health care proxy and Power of Attorney.\" Multiple locations throughout the 5 boroughs.','592006797094234','http://www.legal-aid.org',NULL,NULL,NULL,'785468758686103',NULL,NULL,NULL,NULL,NULL,'984462671444449',NULL,NULL,NULL,'955971997114080',NULL,NULL,NULL),(566,1290801142635486,'Sundays at JASA',NULL,999420709614592,'\"College level continuing education program for adults 55+. Offers 20 courses and 10 unique lunchtime lectures on a wide range of topics. Our instructors include luminaries from the worlds of politics, the arts, media, and more. Pre-registration is strongly recommended as seating is limited, $225/semester.\"','1102077225658071','https://www.jasa.org/community/nextact/sundays-at-JASA#.W-C4mtVKiUk',NULL,'nextact@jasa.org',NULL,'1119821956066449',NULL,NULL,NULL,NULL,NULL,'1236355961989830',NULL,NULL,NULL,'804402164230756',NULL,NULL,NULL),(567,1299306345384176,'Shira Ruskay Center-Bereavement Support Groups',NULL,1212127567201393,'From their website: We offer bereavement support groups that are individualized for specific types of loss, and for various Jewish cultural, spiritual, and religious needs. Our groups include participants with similar losses such as individuals who have lost spouses, parents, children, and other loved ones. We attempt to group participants of similar age.\nOur eight-week groups are co-lead by a Social Worker and a Rabbi, and are offered throughout the year. Currently, many of our groups are offered in partnership with the JCC of Manhattan and within individual synagogue congregations. Pre-registration is required and fees apply.\nTo Register for Loss of a Parent or Spouse/Partner, contact Amy Warren, LMSW, at 212.693.4608 or AWarren@jbfcs.org. For all other groups, contact Rabbi Simkha Y. Weintraub, LCSW, at 212.632.4770 or SWeintraub@jbfcs.org.','817064838386609','https://jewishboard.org/about-us/programs-services/jewish-community-services/shira-ruskay-center/',NULL,NULL,NULL,'1200594795378183',NULL,NULL,NULL,NULL,NULL,'933399633089109',NULL,NULL,NULL,'812773064685081',NULL,NULL,NULL),(568,1307397345920479,'University Avenue Assisted Living',NULL,1167195867217331,'A 72-bed facility for seniors aged 65 years or over, or for Medicaid-eligible New Yorkers, who are independent yet require supportive services (help with medications, showering, dressing, grooming, housekeeping, laundry and supervision).','1106697137818738','https://jewishhome.org/our-services/housing/assisted-living/',NULL,NULL,NULL,'1149247622463332,1157747719793788',NULL,NULL,NULL,NULL,NULL,'1183181876248255',NULL,NULL,NULL,'1278000830181039',NULL,NULL,NULL),(569,1313190884786760,'Delta Dental Insurance Plan',NULL,647842580706283,'For AARP members, search for plans by state.','1064932718237290,1107817196477166','https://www.deltadentalins.com/aarp/index',NULL,NULL,NULL,'930870677737263',NULL,NULL,NULL,NULL,NULL,'635107388906301',NULL,NULL,NULL,'955971997114080',NULL,NULL,NULL),(570,1314379582554480,'Sage Vets',NULL,889219993877335,'Helps LGBT older adults who are military service veterans improve their access to VA benefits and their overall health and wellness.','1284971768096785','https://sagenyc.org/nyc/sagevets/index.cfm',NULL,'info@sageusa.org',NULL,'1217112216075611,775024125555217',NULL,NULL,NULL,NULL,NULL,'793906394089229',NULL,NULL,NULL,'832417426130330',NULL,NULL,NULL),(571,1250503896058178,'Integrity First Senior Care',NULL,1263268381661439,'From their website: \"Dementia care & behavior management-serve 5 boroughs, Long Island, and Westchester, 24/7 caregiver availability, weekly social worker visits (optional), weekly care coordination staff meetings, client caregiver and family communication coordination.\"','641535127444773','www.integrityfirstseniorcare.com',NULL,' info@integrityfirstseniorcare.com',NULL,'943955981947035,1324596060194399',NULL,NULL,NULL,NULL,NULL,'1125706579524232',NULL,NULL,NULL,'889256005961394',NULL,NULL,NULL),(572,1252521081622287,'Westfair Rides',NULL,NULL,'WestFair Rides provides volunteer rides to medical appointments for older adults and adults with vision impairments who live in and travel to medical appointments in Westchester County.\n\nPosted 10/19','574376589030689','https://www.westfairrides.org',NULL,NULL,NULL,'1174744908232674,1260794998607714',NULL,NULL,NULL,NULL,NULL,'884059462151547',NULL,NULL,NULL,'1246275154405508',NULL,NULL,NULL),(573,1254802786086522,'Safe Horizon 24-Hour Hotline',NULL,1208219125277798,'If you need immediate help from a counselor please call one of our 24 hour Hotlines:\nFor domestic violence victims: 800-621-HOPE (4673)\nFor victims of crime and their families: 866-689-HELP (4357)\nFor rape & sexual assault victims: 212-227-3000\nFor domestic violence victims: 800-621-HOPE (4673)\nFor victims of crime and their families: 866-689-HELP (4357)\nFor rape & sexual assault victims: 212-227-3000','1166518935930177','https://www.safehorizon.org/',NULL,NULL,NULL,'617361975501329',NULL,NULL,NULL,NULL,NULL,'803292458166778,1233318263292572',NULL,NULL,NULL,'1091732696488921',NULL,NULL,NULL),(574,1257888729107302,'Free Home Repairs',NULL,1110611044448437,'HomeFront volunteers are ready to repair homes at no cost to qualified homeowners. \n\nPosted 10/19',NULL,'http://www.homefrontprogram.org/',NULL,NULL,NULL,'1257808542253052',NULL,NULL,NULL,NULL,NULL,'1013510748368807',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(575,1269213379965326,'New York Public Library Tax Preparation',NULL,839827527698327,NULL,'914639497723129,1327394866894620',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'847570665921272,762835641076831',NULL,NULL,NULL,'1123406869458717,1313979703298136',NULL,NULL,NULL),(576,1283332656253529,'Urban Pathways Housing',NULL,585352554048372,'Helps adults move rapidly into housing from the street, public spaces, or temporary shelter. Services include outreach, a drop-in center, safe havens, permanent and temporary supportive housing, a medical wellness program, an employment assistance program, and a Moving On Initiative. Urban Pathways has programs across four of the five boroughs in New York City and at Newark Liberty International Airport. If you are homeless and in need of housing, or would like information about eligibility for services, please call and ask to speak with the Outreach Team.',NULL,'http://www.urbanpathways.org',NULL,'outreachteam@urbanpathways.org',NULL,'632606603203298',NULL,NULL,NULL,NULL,NULL,'1274646555790731',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(577,1288869394363879,'Martine Center for Rehabilitation and Nursing',NULL,867926967155229,'Rehabilitation facility with 6 days of one-on-one therapy per week. Every client has a personalized care plan. Both short-term and long-term therapy are available. \n\nPosted 11/19','718148789386701','www.martinecenter.com',NULL,NULL,NULL,'624542557113105',NULL,NULL,NULL,NULL,NULL,'1334376350290842',NULL,NULL,NULL,'985003568514780',NULL,NULL,NULL),(578,1287996806329445,'Alzheimer\'s Disease Resource Center Toll-Free Hotline Service',NULL,NULL,'Provides information, programs, education, services, and support for families affected by Alzheimer\'s disease including a toll-free hotline service 24 hrs/7 days a week. Serves the greater New York Metropolitan area, which includes Nassau County, Suffolk County, Brooklyn, Queens and Manhattan. ','775481941389324','http://www.adrcinc.org/',NULL,'Info@ADRCinc.org',NULL,'981685343230150,1261747089209037,594263482089475,943955981947035,642511572093907,1248151266206446',NULL,NULL,NULL,NULL,NULL,'1283549482595881',NULL,NULL,NULL,'898285584260360',NULL,NULL,NULL),(579,1292864991200757,'Masbia Pantry',NULL,NULL,NULL,'608050564781011,1177711895016605,956575318109690',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1223508587714383,661159058078744,750099343938839',NULL,NULL,NULL),(580,1300575732417581,'Queens Community House Senior Center',NULL,854389601348497,'Queens Community House\'s five senior centers provide culturally-rich environments where older adults can engage with peers, make new friends, enjoy a hot meal, keep physically active, learn new skills and explore new interests, and give back through volunteer opportunities.\nEach center offers a wide variety of physical activities, including yoga, Zumba, ballroom dance, stretching, tai chi, chair aerobics, and ping pong, for older adults looking to maintain their health. We also provide support in managing chronic health conditions through free screenings, health education workshops, and nutritious meals. Drivers provide rides to and from Queens Community House senior centers, as well as to events, shopping, and doctors appointments, for older adult participants. Queens locations: Forest Hills, Rego Park, Jackson Heights, Kew Gardens, Pomonok/Flushing.','1114814832620769','https://www.qchnyc.org/programs/older-adult-services/transportation',NULL,NULL,NULL,'981685343230150,1299575089394687,1048629387183766',NULL,NULL,NULL,NULL,NULL,'1303878558683146',NULL,NULL,NULL,'1234611396518606',NULL,NULL,NULL),(581,1257451204059413,'Daily Money Management',NULL,796026064627918,'From their website: The Daily Money Management (DMM) program at Greenwich House assists seniors capable of making financial decisions, yet who need help with day-to-day fiscal tasks, such as:\n-Writing checks and balancing check books\n-Going to the bank\n-Organizing bills and important paperwork\n-Monitoring monthly income and expenses to remain on a budget\n\nAssistance from the DMM Coordinator is designed to help organize finances and preserve self-sufficiency. The DMM Coordinator does not replace accountants or investment professionals. Clients make all financial decisions independently. This program is free. The coordinator is a professional with expertise in accounting, makes home visits or meets with clients at Greenwich House offices, and works with individuals to determine their needs and form an agreement outlining those terms. Eligibility: 60 or older, have the cognitive capacity to participate, live between Canal and 24th Streets in Manhattan.','1141607429542130','http://www.greenwichhouse.org/cc_senior_centers/daily-money-management',NULL,'kkramer@greenwichhouse.org',NULL,'1080473071775397',NULL,NULL,NULL,NULL,NULL,'797171340132062',NULL,NULL,NULL,'624190706027718',NULL,NULL,NULL),(582,1272518728948067,'Community Advisory Program for the Elderly','CAPE',1275780377457872,'\"Outpatient Mental Health Clinic for persons aged 50 and over and their families. CAPE offers individual, group and family therapy, psychiatric evaluations and medication monitoring for both clinic and homebound older adults. Children of elderly parents, and family members or caregivers of persons with dementia may attend family treatment and caregiver support groups in Western Queens, also has satellite clinics throughout Queens.\"','1286900051399672','http://www.sfy.org/community-mental-health-services/',NULL,'cape@sfy.org',NULL,'981685343230150,1000576764179618',NULL,NULL,NULL,NULL,NULL,'852539902947802',NULL,NULL,NULL,'885146589556516',NULL,NULL,NULL),(583,1274529813061855,'National Academy of Elder Law Attorneys (NAELA)',NULL,NULL,'Directory of elder law attorneys.','869389940541744','https://www.naela.org/findlawyer',NULL,NULL,NULL,'785468758686103',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'955971997114080',NULL,NULL,NULL),(584,1299966772928860,'Housing Assistance Program',NULL,827409210356131,'Advocacy and referrals for housing resources for people with disabilities. ','1160012504793222','www.adaptcommunitynetwork.org',NULL,'projectconnect@adaptcommunitynetwork.org',NULL,'895588724473906,669623054114376,632606603203298',NULL,NULL,NULL,NULL,NULL,'953129348295807',NULL,NULL,NULL,'1120080866522434',NULL,NULL,NULL),(585,1298860129512584,'The Doula Program to Accompany and Comfort',NULL,NULL,'From their website: \"Our Doula Volunteers provide an ongoing relationship as illness progresses. Activities vary depending upon each individual / and safety and can include: talking, reading, listening to music, watching TV or a movie, special projects, walking outside, or sitting quietly. Doula Volunteers visit weekly with one individual until he or she dies. These meaningful relationships last weeks, months and years. The Doula Volunteer will continue to visit if the location changes, services change or the person is admitted into the hospital.\" For people with a life threatening illness or advanced illness, limited support from family and friends; or could benefit from a relationship with a Doula Volunteer, a professional is monitoring the needs of this person as their illness progresses. Memory impairment is individually assessed.','1127756116271969','www.doulaprogram.org/',NULL,' alevine@doulaprogram.org',NULL,'774097722351721,969672981978469',NULL,NULL,NULL,NULL,NULL,'751780588775178',NULL,NULL,NULL,'623025679459970',NULL,NULL,NULL),(586,1317272831608081,'Starkey Hearing Foundation',NULL,NULL,'From their website: \"Free hearing aides, Starkey Hearing Foundation has provided more hearing help to people in the United States than to any other country. Hear Now is our application-based program that provides hearing help to low-income Americans. Each person we help is fit with new, top-of-the-line digital hearing aids that are customized to their hearing loss.\"','665908716099324','https://www.starkeyhearingfoundation.org/Hear-Now',NULL,'hearnow@starkeyfoundation.org ',NULL,'949152871495532,927475609486366',NULL,NULL,NULL,NULL,NULL,'661098508518727',NULL,NULL,NULL,'781905515728114',NULL,NULL,NULL),(587,1271796728231431,'Adult Day Health Care Program-New Jewish Home',NULL,1167195867217331,'Open 6 days a week in Manhattan and the Bronx. The program is for people who have chronic health conditions. Day program runs from  9:30 am-2:30 pm.Eveningprogram runs from 2:30 pm-7:00 pm. Healthcare supervision by skilled nurses, Certified Nursing Assistant for help with personal needs, Physical, occupational and speech therapists on staff, Specialized health and wellness programs for those with chronic medical needs, medication management, telehealth, nutritional counseling, SW services, care management, counseling, therapeutic recreational activities (art, escorted field trips).','1100086303377827,563591937429247','https://jewishhome.org/our-services/adult-day-health-care-2/',NULL,NULL,NULL,'1106100275196851',NULL,NULL,NULL,NULL,NULL,'878152686288081,627128567055441,1171165992654808',NULL,NULL,NULL,'1146787602507424,746735676880343',NULL,NULL,NULL),(588,1273182297854066,'University Without Walls',NULL,617910248814061,'Offers hundreds of classes each year that appeal to a wide range of interests including the arts, history, current events, games, holidays, and more. To Your Health classes enable seniors to learn more about their health concerns from professionals in the health care field. It also connects seniors with their peers, who can provide emotional support and the benefit of experience with similar conditions. \nClasses in Russian also available. Call (877) 819-9147 to register.','872398746454681','http://www.dorotusa.org/site/PageServer?pagename=seniors_programs_on_phone_D#.XAbt1ttKiUl',NULL,NULL,NULL,'1063168571768300,1220426167240011,821861174676380,1119821956066449,877451051471319',NULL,NULL,NULL,NULL,NULL,'637042726567005,1053545479364272',NULL,NULL,'1272863013225282','801326186311509',NULL,NULL,NULL),(589,1275555407513349,'Eye Doctors-SUNY College of Optometry',NULL,1250690553852125,'Eye exams, cataracts, contacts, diabetic eye care, glaucoma, low-vision, vision therapy.','1263931920202948','www.universityeyecenter.org/services/adults/',NULL,NULL,NULL,'1060789001254366,804710974459801',NULL,NULL,NULL,NULL,NULL,'803183586724113',NULL,NULL,NULL,'637888517639066',NULL,NULL,NULL),(590,1277195383446930,'Arc XVI Fort Washington Transportation & Escorting',NULL,NULL,'For Manhattan residents: there are 9 buses in Manhattan, which provide free curb-to curb transportation services for seniors from West 220th Street to West 110th Street, North to South, and from the Hudson River to Harlem River, West to East. In Manhattan, we have a new program that allows disabled individuals with mobility, visual or audio impairments over 50 yrs of age and seniors citizens 60 years of age or older to become more independent and age in place, with the support of Mobility Facilitators. We will pick you up at your front door, escort you to your desired location and return you back to your front door, giving qualifying disabled and community seniors increased mobility and access to more community-based resources.\nFor the Bronx: there are 5 buses in the Bronx from Crotona Park to Hunts Point and from the Sheridan Expressway West to Webster Avenue and Port Morris, comprising Bronx Community Boards 1, 2, and 3. Seniors receive transportation to and from the Senior Centers, and to and from medical and other appointments. Seniors also are advised on how to apply for Access-A-Ride.','853419853061010','http://arcseniors.org/transport.html',NULL,'info@arcseniors.org',NULL,'910515645454451,1048629387183766,634570173416697',NULL,NULL,NULL,NULL,NULL,'1117573030692744,964093103655057',NULL,NULL,'827112157293504','822773848376509',NULL,NULL,NULL),(591,1302356729977275,'Companion: Dolly Floriano',NULL,NULL,'Meal preparation, light housekeeping, medication reminder, shopping errands, outside trips.\n\nPosted 10/19: Unavailable as of 10/19 due to injury',NULL,NULL,NULL,'hellodolly10@icloud.com',NULL,'1258526581948590,1209400832429047',NULL,NULL,NULL,NULL,NULL,'641563601435038',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(592,1308196365475201,'Catholic Charities Brooklyn & Queens Home Delivered Meals & Friendly Visiting',NULL,1057271249593433,NULL,'774273106095161',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'843528306148758',NULL,NULL,NULL,'995073113368146',NULL,NULL,NULL),(593,1322256938475139,'Select Care',NULL,NULL,'Serving Manhattan, Brooklyn, the Bronx and Queens since 1985.','802703984103645','https://www.selectcarenyc.com/',NULL,'info@selectcarenyc.com        ',NULL,'1324596060194399',NULL,NULL,NULL,NULL,NULL,'571539544273047',NULL,NULL,NULL,'901328021315746',NULL,NULL,NULL),(594,1327603866686607,'Hospital Patient Library',NULL,606353313876904,'Accepts donations of books and magazines for patients, drop-off at volunteer office. Call New York Presbyterian at 212-746-5454 or Lenox Hill at (212) 434-2000 for more information. ','657361025169638','https://www.northwell.edu/find-care/locations/lenox-hill-hospital/volunteer-services',NULL,NULL,NULL,'796531679969625',NULL,NULL,NULL,NULL,NULL,'753557336459670,1187435639779273',NULL,NULL,NULL,'1234206261029242',NULL,NULL,NULL),(595,1337566135151280,'Atria Short-Term Respite Stay',NULL,553501090665356,'In order to stay short-term, a nurse will go to the rehab facility or wherever the client is to do an initial assessment. Short-term stay is generally 30-days, but sometimes it can be shorter. The client needs to be able to ambulate on their own or with a walker. They also need to transfer on their own and take care of oxygen, colostomy bags, etc. on their own. Included in Short-Term Respite Stay: private fully furnished apartment, emergency call system, cable TV, phone and internet, 24-hour medication assistance, 24-hour care staff, 24-hour licensed nurse, daily meals served in dining room, daily fitness opportunities, daily bed making, weekly housekeeping, daily trash removal, weekly personal laundry washed and towels washed twice a week, over 200 on-site and off-site activities per month. ','637170263897132','www.333w86.com',NULL,NULL,NULL,'1149247622463332,1157747719793788',NULL,NULL,NULL,NULL,NULL,'1100948996979897',NULL,NULL,NULL,'736904742039377',NULL,NULL,NULL),(596,1339230793187649,'Bergen County Division of Senior Services-Area Agency on Aging',NULL,NULL,'Aging and disability resource connection for Bergen county. Can provide information on the following:\nAdult Day Care, Age-Friendly Community Initiatives (AFCI), Benefits Eligibility, Care Management, Food Pantries, Home Care Programs, Home Modifications, Housing, Long Term Care Facilities, Meals on Wheels, Medicaid / Other Insurance, Medicare, Mental Health, Pharmaceutical Assistance, Reverse Mortgage Counseling, SAVVERS Discount Program, Senior Activity Centers, Senior Lunch Program, Tax Relief, Transportation, Wellness Check Program, etc.','1259360515070465','https://www.co.bergen.nj.us/division-of-senior-services',NULL,NULL,NULL,'1126107523105430',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'861724245335885',NULL,NULL,NULL),(597,1294162364398922,'Family & Children\'s Association',NULL,NULL,'Case management, senior center, friendly visiting, benefits assistance (in multiple locations); Serves community districts 1-6.','1333065740668009','https://fcali.org/',NULL,NULL,NULL,'784392560809728,775024125555217,969672981978469,594263482089475',NULL,NULL,NULL,NULL,NULL,'604400354182330',NULL,NULL,NULL,'1178537728854068',NULL,NULL,NULL),(598,1296981513923077,'Awaken Seniors',NULL,NULL,'Sensory programs for individuals, senior groups, and memory care. \n\nFrom Website: In the Awaken Seniors program the senses of taste, smell, sight, hearing and touch are used as a means of connecting the participants to other people, their surroundings, and themselves. The memories and discussions that are activated through interaction with natural materials and sensory rich objects such as herbs, flowers, textiles, and hand held musical instruments, help promote and maintain current cognitive abilities. The program consists of a series of one hour sessions.\n\nPosted 11/19',NULL,'www.awakenseniors.com',NULL,'info@awakenseniors.com',NULL,'691234617893799',NULL,NULL,NULL,NULL,NULL,'883157495394268',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(599,1304713068423859,'Jessica Seidel, LCSW',NULL,NULL,'Clinical Social Worker\n\nPosted 10/19','803531070000649',NULL,NULL,NULL,NULL,'787866332874000',NULL,NULL,NULL,NULL,NULL,'1149034166829265',NULL,NULL,NULL,'810313990766352',NULL,NULL,NULL),(600,1304456190659449,'HomeBase Program to Prevent Homelessness',NULL,691561025475829,'From their website: \"Homelessness prevention program administered by Community-Based Organizations (CBOs) in high-need neighborhoods. The CBOs provide casework services and also help individuals and families locate existing community-based resources such as job training, child care, and anti-eviction legal services.\nYou are strongly encouraged to call your nearest HomeBase location before visiting. Depending on your address and situation, you may be advised to go to a different HomeBase office in your borough.\"','1177121134721965','https://www1.nyc.gov/site/hra/help/homebase.page',NULL,NULL,NULL,'632606603203298',NULL,NULL,NULL,NULL,NULL,'1196111546467169',NULL,NULL,NULL,'955971997114080',NULL,NULL,NULL),(601,1306565861277471,'Garito Manor at Union Square',NULL,NULL,'Affordable independent senior living--two daily meals, 24 hour security, weekly housekeeping, and transportation to medical appointments within 10 miles available. Utilities are complementary. \n\nPosted 11/19','612641952771609','www.garitomanor.com',NULL,'jtrifono@garitomanor.com',NULL,'1281533535852091',NULL,NULL,NULL,NULL,NULL,'947850805673902',NULL,NULL,NULL,'743224050994340',NULL,NULL,NULL),(602,1316829671731361,'Our Place: Social Senior Program',NULL,618125844603285,'Social, recreational, and therapeutic programs for seniors who have memory challenges or need help with activities of daily living. 8:30-3:30 Monday-Friday, 9-3 Saturday.\n\nPosted 11/19','870043042179331','www.elderserve.org',NULL,NULL,NULL,'1114469131907548',NULL,NULL,NULL,NULL,NULL,'771507333748332',NULL,NULL,NULL,'595551308665055',NULL,NULL,NULL),(603,1332086045056594,'College at 60',NULL,662313486318802,'\"The program offers noncredit courses in areas such as creative writing, U.S. history, philosophy and literature. The name College at 60 refers to its location at Fordhams Lincoln Center campus on West 60th Street and also to its studentsmost of whom are over the age of 60.\"',NULL,'https://www.fordham.edu/downloads/file/7226/college_at_60_courses',NULL,NULL,NULL,'1119821956066449',NULL,NULL,NULL,NULL,NULL,'1309152599619615',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(604,1335605835095590,'PSS Home Care',NULL,NULL,' Caregivers, companions, Certified Nursing Assistants, home health aides, RN, LPN\'s, and housekeepers','697325863842099','http://psshomecare.com',NULL,'info@psshomecare.com',NULL,'1294594151119548,1324596060194399',NULL,NULL,NULL,NULL,NULL,'1203085986302192',NULL,NULL,NULL,'650308176658513',NULL,NULL,NULL),(605,1336043764520811,'Project Find',NULL,1273153354756247,'Walk-in free tax preparation help (call for days/times).','1054819580338538','http://www.projectfind.org/hamilton_center',NULL,NULL,NULL,'905605959147804',NULL,NULL,NULL,NULL,NULL,'563473723331446,1239814947010570',NULL,NULL,NULL,'1192682334798639',NULL,NULL,NULL),(606,1344051922955818,'Hunter College Senior Citizen Auditors',NULL,751944288598510,'College classes for seniors 60 years and older who are New York state residents. The Senior Citizen Auditor program is free, but there are processing fees for each semester/session: $65.00 general fee is due at the time of registration and $15.00 consolidated services fee is due at the time of registration. Auditors are also responsible for the costs of any course materials, such as textbooks. Once you have applied and submitted all of your documents you will be notified of your admission status within 2-3 weeks via email. The Winter session is not available to lifelong learners.','561779752822615','http://www.hunter.cuny.edu/admissions/admissions-information/senior-learners',NULL,NULL,NULL,'1119821956066449',NULL,NULL,NULL,NULL,NULL,'1170024339255780',NULL,NULL,NULL,'839756563631856',NULL,NULL,NULL),(607,1342090175039886,'Vintage Thrift ',NULL,NULL,'From their website: \"Benefits the UJC. Accepts donations of resalable men\'s and women\'s clothing, accessories, shoes, jewelry, furniture, lamps, mirrors, artwork, pottery, decorative items, housewares, china, crystal, serving items, kitchenware, pots & pans, flatware, glassware, housewares, table linens, CDs, DVDs, cameras, and collectibles. Old or new, vintage or contemporary. We take just about everything! In fact, it\'s easier to tell you what we don\'t accept than to list the multitude of items we accept. In general, we do NOT accept the following items: laminated particle board furniture, Ikea furniture, furniture in poor condition, major appliances, air conditioners, medical equipment, exercise equipment, home and office electronics (computers, monitors, printers, fax machines), children\'s and infants\' items, books (with the exception of art books, or collectible books), magazines (with the exception of vintage magazines-- 25 years or older) bed frames, mattresses or futons. However, we do make exceptions to these general rulesfrom old manual typewriters, to old fashion magazines, to antique toys. For donation inquiries and pick-up requests for large donations call or FILL OUT OUR ONLINE REQUEST FORM. Drop-off donations are welcome at our Gramercy Park location during all business hours. All donations are tax deductible & donors are given blank donation receipts to fill out at the time of drop-off or pick-up.\"',NULL,'www.vintagethriftshop.org/donate/',NULL,NULL,NULL,'796531679969625',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
